INSERT INTO `rk_kategorie` (`id`, `nazev`, `alias`, `keywords`, `description`, `display`, `poradi`, `_rm_updated_date`, `_rm_updated_by`) VALUES
(1, 'Motorové oleje pro osobní vozy', 'motorove-oleje-pro-osobni-vozy', 'motor,olej,oil,vozy,vůz,osobní,auto,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních motorových olejů pro osobní vozy za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 1, '2015-10-28 14:28:58', 3),
(2, 'Převodové oleje pro osobní vozy', 'prevodove-oleje-pro-osobni-vozy', 'převod,olej,oil,vozy,vůz,osobní,auto,auto,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních převodových olejů pro osobní auta za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 2, '2015-10-28 14:29:32', 3),
(3, 'Oleje pro motocykly a skútry', 'oleje-pro-motocykly-a-skutry', 'motor,olej,oil,moto,skútr,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních motorových olejů pro skútry a motocykly za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 3, '2015-10-28 14:29:49', 3),
(4, 'Oleje pro zahradní techniku', 'oleje-pro-zahradni-techniku', 'sekačka,pila,zahrada,technika,olej,oil, motor,převod,auto,mineralni,5w,10w,15w,api,sae,', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních motorových a převodových olejů pro zahrndní techniku, jako sekačky či pily za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 4, '2015-10-28 14:30:01', 3),
(5, 'Motorové oleje pro nákladní vozy', 'motorove-oleje-pro-nakladni-vozy', 'motor,olej,oil,vozy,vůz,osobní,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních motorových olejů pro nákladní auta za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 5, '2015-10-28 14:30:14', 3),
(6, 'Převodové oleje pro nákladní vozy', 'prevodove-oleje-pro-nakladni-vozy', 'motor,olej,oil,převod,vozy,vůz,nákladní,tir,truck,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních motorových olejů pro nákladní vozy (tir) za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 6, '2015-10-28 14:30:26', 3),
(7, 'Oleje pro zemědělskou techniku', 'oleje-pro-zemedelskou-techniku', 'hydraulický,hydraulika,motor,olej,oil,převod,vozy,vůz,nákladní,tir,truck,zemědělská,technika,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních motorových a převodových olejů za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 7, '2015-10-28 14:30:37', 3),
(8, 'Oleje pro stavební techniku', 'oleje-pro-stavebni-techniku', 'hydraulicky,hydraulika,motor,olej,oil,převod,vozy,vůz,nákladní,tir,truck,stavební,technika,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních motorových motových, převodových a hydraulických olejů za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 8, '2015-10-28 14:30:47', 3),
(9, 'Plastická maziva', 'plasticka-maziva', 'mazivo,maziva,plastická,motor,olej,oil,vůz,auto,osobní', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních motorových olejů a maziv za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 9, '2015-10-28 14:30:59', 3),
(10, 'Autochemie', 'autochemie', 'autokosmetika,autochemie,motor,olej,oil,převod,vozy,vůz,osobní,nákladní,tir,truck', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních průmyslových olejů za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 10, '2015-10-28 14:31:14', 3),
(11, 'Autokosmetika', 'autokosmetika', 'autokosmetika,autochemie,motor,olej,oil,převod,vozy,vůz,osobní,nákladní,tir,truck', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitní autokosmetiky a chemie za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 11, '2015-10-28 14:31:31', 3),
(12, 'Spreje', 'spreje', 'autokosmetika,sprej,motor,olej,oil,převod,vozy,vůz,osobní, nákladní,tir,truck', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitní autokosmetiky a chemie za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 12, '2015-10-28 14:31:42', 3),
(13, 'Průmyslové oleje - obráběcí kapaliny', 'prumyslove-oleje-obrabeci-kapaliny', 'motor,olej,oil,převod,vozy,vůz,osobní, nákladní,tir,truck,průmysl,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních průmyslových olejů za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 13, '2015-10-28 14:31:53', 3),
(14, 'Průmyslové oleje - převodové oleje', 'prumyslove-oleje-prevodove-oleje', 'motor,olej,oil,převod,vozy,vůz,osobní, nákladní,tir,truck,průmysl,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních průmyslových olejů za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 14, '2015-10-28 14:44:42', 3),
(15, 'Průmyslové oleje - hydraulické oleje', 'prumyslove-oleje-hydraulicke-oleje', 'motor,olej,oil,převod,vozy,vůz,osobní, nákladní,tir,truck,průmysl,mineralni,5w,10w,15w,api,sae', 'Společnost Pro-Oil se zabývá prodejem a distribucí kvalitních průmyslových olejů za přijatelné ceny. Známé trh s oleji a mazivy.', 1, 15, '2015-10-28 14:44:39', 3);
