INSERT INTO `rk_polozka` (`id`, `kategorie_id`, `vyrobce_id`, `dostupnost_id`, `nazev`, `popis_kratky`, `popis_dlouhy`, `specifikace_sae`, `specifikace_api`, `specifikace_acea`, `specifikace_vyrobce`, `cena_bez_dph`, `baleni_pocet`, `baleni_mj`, `page_main`, `page_akce`, `img`, `alias`, `keywords`, `schvaleno_oem`, `_rm_updated_date`, `_rm_updated_by`) VALUES
(1, 1, 8, 1, 'MOL Dynamic Long Life III 5W-30', 'Motorový olej MOL Dynamic Long Life III 5W-30 je plně syntetický low-saps olej určený pro osobní a dodávkové vozy. Motorový olej MOL Dynamic Long Life III 5W-30 je určen pro benzínové a dieselové motory skupiny VW s prodloužným výměnným intervalem, které', 'Motorový olej MOL Dynamic Long Life III 5W-30 je vysoce kvalitní  plně syntetický low saps olej určený pro osobní a dodávkové vozy. Motorový olej MOL Dynamic Long Life III 5W-30 je určen pro benzínové a dieselové motory skupiny VW s prodlouženým výměnným intervalem. Olej MOL Dynamic Long Life III 5W-30 je určen pro motory, které jsou osazeny filtrem pevných částic (DPF), nebo třícestným katalyzátorem (TWC). Motorový olej MOL Dynamic Long Life III 5W-30 má přímé schválení skupiny VW 504.00/507.00', 'SAE 5W-30', 'API SM/CF', 'ACEA A3/B4/C3', 'VW 504 00/507 00', '139.0', 1, 'L', 1, 1, 'Mol_Dyn_Gold_LLIII_5W-30_1L.png', 'mol-dynamic-long-life-iii-5w-30-1l', 'mol,dynamic,long,life,III,sae,5W,30,VW,50400,50700,olej,oil,motor,levny,levne,kvalitni,syntetický,synt', 'Schváleno výrobci: SHELL, MOTORolej, SUZUKI', '2016-03-03 15:15:40', 3),
