(4, 1, 8, 1, 'MOL Dynamic Prima 5W-40', 'Motorový olej MOL Dynamic Prima 5W-40 je kvalitní plně syntetický low saps olej určený pro osobní a dodávkové vozy nejen skupiny VW. Motorový olej MOL Dynamic Prima 5W-40 je určen pro benzínové a dieselové motory s filtry pevných částic (DPF/TWC).', 'Motorový olej MOL Dynamic Prima 5W-40 je vysoce kvalitní syntetický olej určen pro benzínové a dieselové motory osobních a dodávkových vozů nejen skupiny VW. Motorový olej MOL Dynamic Prima 5W-40 je určen pro motory, které jsou osazeny filtrem pevných částic (DPF), nebo třícestným katalyzátorem (TWC). Motorový olej MOL Dynamic Prima 5W-40 je dále vhodný pro motory koncernu VW s technololgií vstřikování PD - čerpadlo/tryska. Motorový olej MOL Dynamic Prima 5W-40 je také možno použít jako klasický motorový olej pro všechny přeplňované dieselové a nepřeplňované benzínové motory.', 'SAE 5W-40', ' API SM/CF', ' ACEA A3/B4/C3', ' VW 502 00/505 00/505 01', '151.0', 1, 'L', 0, 0, 'Mol_Dyn_Prima_5W-40_1L.png', 'mol-dynamic-prima-5w-40-1l', 'mol,dynamic,prima,sae,5W,40,PD,VW,50501,olej,oil,motor,levny,levne,kvalitni,synt', '', '2016-03-03 14:50:37', 3),
