(8, 1, 8, 1, 'MOL Dynamic Star PC 5W-30', 'Motorový olej MOL Dynamic Star PC 5W-30 je kvalitní syntetický low-saps olej určený pro benzínové a dieselové motory osobních i dodávkových vozů Citroen a Peugeot.', 'Motorový olej MOL Dynamic Star PC 5W-30 je vysoce kvalitní syntetický low-saps olej určen pro nejnovější benzínové a dieselové motory osobních i dodávkových vozů Citroen a Peugeot. Motorový olej MOL Dynamic Star PC 5W-30 je určen pro motory osazeny filtry pevných částic (DPF), nebo třícestným katalyzátorem (TWC). Motorový olej MOL Dynamic Star PC 5W-30 má přímé schválení PSA B71 2290.', 'SAE 5W-30', ' API SM/CF', ' ACEA A5/B5/C2', ' Renault RN0700', '144.0', 1, 'L', 0, 0, 'Mol_Dyn_StarPC_5W-30_1L.png', 'mol-dynamic-star-pc-5w-30-1l', 'mol,dynamic,star,PC,low,saps,sae,5W,30,PSA,B71,2290,olej,oil,motor,levny,levne,kvalitni,synt', '', '2016-03-03 14:50:37', 3),
