(10, 1, 8, 1, 'MOL Dynamic Star RN 5W-30', 'Motorový olej MOL Dynamic Star RN 5W-30 je vysoce kvalitní syntetický low saps olej pro nejmodernější dieselové a benzínové motory osobních i dodávkových vozů značky RENAULT.', 'Motorový olej MOL Dynamic Star RN 5W-30 je vysoce kvalitní syntetický olej pro nejmodernější osobní automobily a lehká užitková vozidla. Motorový olej MOL Dynamic Star RN 5W-30 zásluhou mimořádných vlastností a nízkého obsahu sulfátového popela, fosforu a síry (Low SAPS) je kompatibilní se systémy na dodatečnou úpravu výfukových plynů (TWC, DPF). Motorový olej MOL Dynamic Star RN 5W-30 zabezpečuje dlouhou životnost a nejvyšší stupeň ochrany benzínových a naftových motorů. Motorový olej MOL Dynamic Star RN 5W-30 má přímé schválení automobilky Renault.', 'SAE 5W-30', ' ACEA C4', ' RENAULT RN0720', ' RENAULT RN0720', '162.0', 1, 'L', 0, 0, 'Mol_Dyn_SzntRN_5W-30_1L.png', 'mol-dynamic-star-rn-5w-30-1l', 'mol,dynamic,star,RN,low,saps,sae,5W,30,renault,c4,olej,oil,motor,levny,levne,kvalitni,synt', '', '2016-03-03 14:50:37', 3),
(11, 1, 8, 1, 'MOL Dynamic Star RN 5W-30', 'Motorový olej MOL Dynamic Star RN 5W-30 je vysoce kvalitní syntetický low saps olej pro nejmodernější dieselové a benzínové motory osobních i dodávkových vozů značky RENAULT.', 'Motorový olej MOL Dynamic Star RN 5W-30 je vysoce kvalitní syntetický olej pro nejmodernější osobní automobily a lehká užitková vozidla. Motorový olej MOL Dynamic Star RN 5W-30 zásluhou mimořádných vlastností a nízkého obsahu sulfátového popela, fosforu a síry (Low SAPS) je kompatibilní se systémy na dodatečnou úpravu výfukových plynů (TWC, DPF). Motorový olej MOL Dynamic Star RN 5W-30 zabezpečuje dlouhou životnost a nejvyšší stupeň ochrany benzínových a naftových motorů. Motorový olej MOL Dynamic Star RN 5W-30 má přímé schválení automobilky Renault.', 'SAE 5W-30', ' ACEA C4', ' RENAULT RN0720', ' RENAULT RN0720', '8140.0', 55, 'L', 0, 0, 'SUD-60L-MOL.png', 'mol-dynamic-star-rn-5w-30-55l', 'mol,dynamic,star,RN,low,saps,sae,5W,30,renault,c4,olej,oil,motor,levny,levne,kvalitni,synt', '', '2016-03-03 14:50:37', 3),
(12, 2, 8, 1, 'MOL Hykomol TDL 75W-90', 'Převodový olej MOL Hykomol TDL 75W-90 je kvalitní plně syntetický převodový olej do mechanických převodovek, diferenciálů a rozvodovek.', 'Převodový olej MOL Hykomol TDL 75W-90 je vysoce kvalitní syntetický převodový olej typu total drive line (TDL), který může být použit do mechanických převodovek, diferenciálů, rozvodovek osobních, dodávkových i užitkových vozidel. Převodový olej MOL Hykomol TDL 75W-90 svou úpravou zaručuje lehký chod ústrojí při nízkých teplotách a vysokou stálost při extrémním tepelném zatížení.', 'SAE 75W-90', ' API GL-5', ' MT-1', ' MAN 3343 SL', '2197.0', 10, 'L', 0, 0, '', 'mol-hykomol-tdl-75w-90-10l', 'prevodovy,diferencial,rozvodovka,sae,75W,90,hykomol,TDL,mol,dynamic,hykomol,olej,oil,motor,levny,levne,kvalitni,', '', '2016-03-03 14:50:37', 3),
(13, 2, 8, 1, 'MOL Hykomol TDL 75W-90', 'Převodový olej MOL Hykomol TDL 75W-90 je kvalitní plně syntetický převodový olej do mechanických převodovek, diferenciálů a rozvodovek.', 'Vysoce kvalitní syntetický převodový olej typu total drive line, který může být použit do převodovek, diferenciálů, rozvodovek osobních, dodávkových i užitkových vozidel. Olej svou úpravou zaručuje lehký chod ústrojí při nízkých teplotách a vysokou stálost při extrémním tepelném zatížení.', 'SAE 75W-90', ' API GL-5', ' MT-1', ' MAN 3343 SL', '9462.0', 57, 'L', 0, 0, 'SUD-60L-MOL.png', 'mol-hykomol-tdl-75w-90-57l', 'prevodovy,diferencial,rozvodovka,sae,75W,90,hykomol,TDL,mol,dynamic,hykomol,olej,oil,motor,levny,levne,kvalitni,', '', '2016-03-03 14:50:37', 3),
(14, 2, 8, 1, 'MOL Hykomol 80W-90', 'Kvalitni prevodovy olej - MOL Hykomol 80W-90.', 'Vysoce kvalitní převodový olej vyrobený s hluboce rafinovaného základového oleje, který je doplněn vhodným balíkem aditiv tak, aby splňoval nejnáročnější podmínky použití. Olej je určen k mazání všech převodovek, rozvodovek a diferenciálů, které nejsou osazeny hypoidním ozubením.', 'SAE 80W-90 API GL-4 MIL-L-2105', 'SAE 80W-90 API GL-4 MIL-L-2105', 'SAE 80W-90 API GL-4 MIL-L-2105', 'SAE 80W-90 API GL-4 MIL-L-2105', '602.0', 4, 'L', 0, 0, '', 'mol-hykomol-80w-90-4l', 'prevodovy,sae,80W,90,hykomol,mol,dynamic,olej,oil,motor,levny,levne,kvalitni,', '', '2016-03-03 14:50:37', 3),
