(36, 3, 8, 1, 'MOL Dynamic Moto 4T GP 20W-50', 'Kvalitní motorový olej pro čtyřtaktní motocyklové motory - MOL Dynamic Moto 4T GP 20W-50', 'Vysoce kvalitní motorový olej pro čtyřtaktní motocyklové motory. Zásluhou jeho vysoké viskozity vytváří pevný mazací film a tím výrazně snižuje opotřebení motoru a také snižuje spotřebu oleje. Olej je zvlášť vhodný pre motocykly, kde je předepsaný olej viskozitní třídy SAE 20W-50 (např. Buell), nebo v motorech u kterých dochází k zvýšené spotřebě oleje.', 'SAE 20W-50 API SG JASO MA2', 'SAE 20W-50 API SG JASO MA2', 'SAE 20W-50 API SG JASO MA2', 'SAE 20W-50 API SG JASO MA2', '110.0', 1, 'L', 0, 0, 'Mol_Dyn_Moto4T_RacingPro_5W60_1L.png', 'mol-dynamic-moto-4t-gp-20w-50-1l', 'motorka,synteticky,moto,mol,dynamic,olej,oil,motor,levny,levne,kvalitni,sae,20w,50,4t,gp', '', '2016-03-03 14:50:37', 3),
