(38, 12, 8, 1, 'MOL Dynamic Moto Chain Clean O-X', 'MOL Dynamic Moto Chain Clean O-X je kvalitní sprej na mazání řetězů motocyklů pro cestovní a terénní motocykly.', 'MOL Dynamic Moto Chain O-X je sprej na mazání řetězů motocyklů pro cestovní a terénní motocykly. MOL Dynamic Moto Chain O-X nabízí jedinečnou přilnavost a ochranu vůči oděru. MOL Dynamic Moto Chain O-X chrání před korozí a je odolný vůči vodě. Sprej obsahuje teflonovou přísadu (PTFE), která dodáva mazivu špičkové parametry. Jestliže se MOL Dynamic Moto Chain O-X používá pravidelně, zaregistrujete zvýšený výkon motocyklu. Výrobok sa doporučuje pro řetězy s O a také s X kroužky. MOL Dynamic Moto Chain O-X prodlužuje životnost řetězu. Před použítím je nutno protředek dobře protřepat.', '', '', '', '', '150.0', 400, 'ML', 0, 0, 'Mol_Dyn_Moto_Chain_O-X_400ml.png', 'mol-dynamic-moto-chain-clean-o-x-400ml', 'moto,mol,dynamic,olej,oil,motor,levny,levne,kvalitni,mazaci,sprej,retezy,chain,clean,', '', '2016-03-03 14:50:37', 3),
(39, 5, 8, 1, 'MOL Dynamic Tornado 5W-30', 'Motorový olej MOL Dynamic Tornado 5W-30 je kvalitní plně syntetický olej nejvyšší kvality pro nejnovější motory nákladních vozidel a užitkové techniky - ', 'Motorový olej MOL Dynamic Tornado 5W-30 je plně syntetický motorový olej nejvyšší kvality pro nejnovější motory nákladních vozidel a užitkové techniky. Motorový olej MOL Dynamic Tornado 5W-30  je ideálním mazivem pro flotilu moderních vysoko zatěžovaných naftových vozidel v nákladní dopravě. Je zvlášť vhodný pro kamióny a autobusy v dálkové dopravě, vybavené motory Euro III a Euro IV bez DPF. Je ho možno používat pro systém SCR a EGR.  Zásluhou speciálního, na míru užitého aditivačního systému je olej zvláště vhodný pro vozidla s nejmodernějšími motory DAF. Na základě originálních schválení výrobců motorů ve vybraných typech vozidel je výměnný interval až 100 000km, v některých případech i víc.', 'SAE 5W-30', ' API CF-4', ' ACEA E7/E5/E4', ' MB-Approval 228.5', '5610.0', 55, 'L', 0, 0, 'SUD-60L-MOL.png', 'mol-dynamic-tornado-5w-30-55l', 'mol,dynamic,tornado,sae,5W,30,olej,oil,motor,levny,levne,kvalitni,synt', '', '2016-03-03 14:50:37', 3),
(40, 5, 8, 1, 'MOL Dynamic Tornado 5W-30', 'Motorový olej MOL Dynamic Tornado 5W-30 je kvalitní plně syntetický olej nejvyšší kvality pro nejnovější motory nákladních vozidel a užitkové techniky - ', 'Motorový olej MOL Dynamic Tornado 5W-30 je plně syntetický motorový olej nejvyšší kvality pro nejnovější motory nákladních vozidel a užitkové techniky. Motorový olej MOL Dynamic Tornado 5W-30  je ideálním mazivem pro flotilu moderních vysoko zatěžovaných naftových vozidel v nákladní dopravě. Je zvlášť vhodný pro kamióny a autobusy v dálkové dopravě, vybavené motory Euro III a Euro IV bez DPF. Je ho možno používat pro systém SCR a EGR.  Zásluhou speciálního, na míru užitého aditivačního systému je olej zvláště vhodný pro vozidla s nejmodernějšími motory DAF. Na základě originálních schválení výrobců motorů ve vybraných typech vozidel je výměnný interval až 100 000km, v některých případech i víc.', 'SAE 5W-30', ' API CF-4', ' ACEA E7/E5/E4', ' MB-Approval 228.5', '19502.0', 205, 'L', 0, 0, 'Sud_200L_MOL.png', 'mol-dynamic-tornado-5w-30-205l', 'mol,dynamic,tornado,sae,5W,30,olej,oil,motor,levny,levne,kvalitni,synt', '', '2016-03-03 14:50:37', 3),
(41, 5, 8, 1, 'MOL Dynamic Mistral 10W-40', 'Motorový olej MOL Dynamic Mistral 10W-40 je kvalitní plně syntetický olej typu low-saps  pro nejnovější motory nákladních vozidel a užitkové techniky s katalyzátory DPF, SCR, EGR.', 'Motorový olej MOL Dynamic Mistral 10W-40 je plně syntetický olej low-saps nejvyšší kvality pro nejnovější motory nákladních vozidel a užitkové techniky. Motorový olej MOL Dynamic Mistral 10W-40 je ideálním olejem pro flotilu moderních vysoko zatěžovaných naftových vozidel v nákladní doprave. Motorový olej MOL Dynamic Mistral 10W-40 je zvlášť vhodný pro kamióny a autobusy v dálkové dopravě, vybavené motory Euro IV a Euro V. Motorový olej MOL Dynamic Mistral 10W-40 je možno používat pro systém SCR, EGR a DPF. Motorový olej MOL Dynamic Mistral 10W-40 je zásluhou speciálního, na míru užitého aditivačního systému zvláště vhodný pro vozidla s nejmodernějšími motory MAN, MERCEDES, VOLVO a DAF. Na základě originálních schválení výrobců motorů ve vybraných typech vozidel je výměnný interval až 100 000 km, v některých případech i víc.', 'SAE 10W-40', ' ACEA E7/E6/E4', ' API CI-4', ' MB 228.51', '1050.0', 10, 'L', 0, 0, '', 'mol-dynamic-mistral-10w-40-10l', 'mol,dynamic,mistral,sae,10W,40,olej,oil,motor,levny,levne,kvalitni,synt', '', '2016-03-03 14:50:37', 3),
