(44, 5, 8, 1, 'MOL Dynamic Synt Diesel 10W-40', 'Motorový olej MOL Dynamic Synt Diesel 10W-40 je kvalitní plně syntetický olej typu UHPD pro motory nákladních vozidel a užitkové techniky s katalyzátory SCR, EGR.', 'Motorový olej MOL Dynamic Synt Diesel 10W-40 je plně syntetický motorový olej nejvyšší kvality pro motory nákladních vozidel a užitkové techniky. Motorový olej MOL Dynamic Synt Diesel 10W-40 je ideálním olejem pro flotilu moderních vysoko zatěžovaných naftových vozidel v nákladní dopravě. Motorový olej MOL Dynamic Synt Diesel 10W-40 je zvlášť vhodný pro kamióny a autobusy v dálkové dopravě, ve stavebnictví a zemědělství. Motorový olej MOL Dynamic Synt Diesel 10W-40 je určen pro motory Euro IV a Euro V se systémy SCR, EGR. Motorový olej MOL Dynamic Synt Diesel 10W-40 má na základě originálních schválení výrobců motorů možnost výměnných intervalů až 100 000 km, v některých případech i víc.', 'SAE 10W-40', ' API CI-4', ' ACEA E7/E5/E4', ' MB-Approval 228.5', '1040.0', 10, 'L', 0, 0, '', 'mol-dynamic-synt-diesel-10w-40-10l', 'mol,dynamic,synt diesel,sae,10W,40,olej,oil,motor,levny,levne,kvalitni,synt', '', '2016-03-03 14:50:37', 3),
