(47, 5, 8, 1, 'MOL Dynamic Transit 10W-40', 'Kvalitní částečně syntetický motorový olej pro nejnovější motory nákladních vozidel a užitkové techniky - MOL Dynamic Transit 10W-40', 'Částečně syntetický motorový olej nejvyšší kvality pro nejnovější motory nákladních vozidel a užitkové techniky. Olej je ideálním mazivem pro flotilu moderních vysoko zatěžovaných naftových vozidel v nákladní doprave. Je zvlášť vhodný pro kamióny a autobusy v dálkové dopravě, ve stavebnictví a zemědělství. Olej je určen pro motory Euro IV a Euro V. Olej je možno používat pro systém SCR, EGR.  Na základě originálních schválení výrobců motorů ve vybraných typech vozidel je výměnný interval až 60 000 km, v některých případech i víc.', 'SAE 10W-40 API CI-4/SL', ' ACEA E7/E5/E3', ' ACEA A3/B4 MB 229.1', ' Volvo VDS-3 MB 228.3', '500.0', 4, 'L', 0, 0, '', 'mol-dynamic-transit-10w-40-4l', 'mol,dynamic,transit,sae,10W,40,olej,oil,motor,levny,levne,kvalitni,synt,SCR, EGR', '', '2016-03-03 14:50:37', 3),
