(51, 5, 8, 1, 'MOL Dynamic Transit 15W-40', 'Kvalitní vysoce výkonný motorový olej pro nejnovější motory nákladních vozidel a užitkové techniky - MOL Dynamic Transit 15W-41', 'Vysoce výkonný motorový olej nejvyšší kvality pro nejnovější motory nákladních vozidel a užitkové techniky. Olej je ideálním mazivem pro flotilu moderních vysoko zatěžovaných naftových vozidel v nákladní doprave. Je zvlášť vhodný pro kamióny a autobusy v dálkové dopravě, ve stavebnictví a zemědělství. Olej je určen pro motory Euro IV a Euro V. Olej je možno používat pro systém SCR, EGR.  Na základě originálních schválení výrobců motorů ve vybraných typech vozidel je výměnný interval až 60 000 km, v některých případech i víc. ', 'SAE 15W-40', ' API CI-4/SL', ' ACEA E7/E5/E3', ' MB 228.3', '3245.0', 57, 'L', 0, 0, 'SUD-60L-MOL.png', 'mol-dynamic-transit-15w-40-57l', 'mol,dynamic,transit,sae,15W,40,olej,oil,motor,levny,levne,kvalitni,synt,SCR, EGR', '', '2016-03-03 14:50:37', 3),
(52, 5, 8, 1, 'MOL Dynamic Transit 15W-40', 'Kvalitní vysoce výkonný motorový olej pro nejnovější motory nákladních vozidel a užitkové techniky - MOL Dynamic Transit 15W-42', 'Vysoce výkonný motorový olej nejvyšší kvality pro nejnovější motory nákladních vozidel a užitkové techniky. Olej je ideálním mazivem pro flotilu moderních vysoko zatěžovaných naftových vozidel v nákladní doprave. Je zvlášť vhodný pro kamióny a autobusy v dálkové dopravě, ve stavebnictví a zemědělství. Olej je určen pro motory Euro IV a Euro V. Olej je možno používat pro systém SCR, EGR.  Na základě originálních schválení výrobců motorů ve vybraných typech vozidel je výměnný interval až 60 000 km, v některých případech i víc. ', 'SAE 15W-40', ' API CI-4/SL', ' ACEA E7/E5/E3', ' MB 228.3', '9960.0', 203, 'L', 0, 0, 'Sud_200L_MOL.png', 'mol-dynamic-transit-15w-40-203l', 'mol,dynamic,transit,sae,15W,40,olej,oil,motor,levny,levne,kvalitni,synt,SCR, EGR', '', '2016-03-03 14:50:37', 3),
(53, 5, 8, 1, 'MOL Dynamic Global Diesel 10W-30', 'Kvalitní plně syntetický motorový olej low-saps nové generace pro nejnovější motory nákladních vozidel a užitkové techniky motorizace EURO V/VI - MOL Dynamic Global Diesel 10W-30', 'MOL Dynamic Global Diesel 10W-30 je moderní vysoce výkonný low-saps motorový olej pro nejmodernější vznětové motory vozidel vyrobený ze syntetických základových olejů a moderního komplexního balíku aditiv. MOL Dynamic Global Diesel 10W-30 je určený pro použití v nejmodernějších automobilech, které jsou vybavené pokrokovými systémy pro snížení obsahu pevných částic (DPF) a oxidů dusíku ( EGR nebo SCR).', 'SAE 10W-30', ' ACEA E9', ' API CJ-4/SN', ' MAN M 3575', '14352.0', 208, 'L', 0, 0, 'Sud_200L_MOL.png', 'mol-dynamic-global-diesel-10w-30-208l', 'mol,dynamic,global,diesel,sae,10W,30,olej,oil,motor,levny,levne,kvalitni,syntetický,SCR,EGR,DPF', '', '2016-03-03 14:50:37', 3),
(54, 1, 8, 1, 'MOL Essence Diesel 5W-40', 'Motorový olej MOL Essence Diesel 5W-40 je kvalitní plně syntetický low saps olej určený pro osobní a dodávkové vozy nejen skupiny VW. Motorový olej MOL Essence Diesel 5W-40 je určen pro benzínové a dieselové motory s filtry pevných částic (DPF/TWC).', 'Motorový olej MOL Essence Diesel 5W-40 je vysoce kvalitní syntetický olej určen pro benzínové a dieselové motory osobních a dodávkových vozů nejen skupiny VW. Motorový olej MOL Essence Diesel 5W-40 je určen pro motory, které jsou osazeny filtrem pevných částic (DPF), nebo třícestným katalyzátorem (TWC). Motorový olej MOL Essence Diesel 5W-40 je dále vhodný pro motory koncernu VW s technololgií vstřikování PD - čerpadlo/tryska. Motorový olej MOL Dynamic Prima 5W-40 je také možno použít jako klasický motorový olej pro všechny přeplňované dieselové a nepřeplňované benzínové motory.', 'SAE 5W-40', ' API SM/CF', ' ACEA A3/B4/C3 ', 'VW 502 00/505 00/VW 505 01', '81.0', 1, 'L', 0, 0, '1L-DIESEL-5W-40.jpg', 'mol-essence-diesel-5w-40-1l', 'mol,essence,diesel,PD,sae,5W,40,olej,oil,motor,levny,levne,kvalitni,synt', '', '2016-03-03 14:50:37', 3),
