(66, 9, 8, 1, 'MOL Calton G3', 'Kvalitní vápennatý tuk s přísadou grafitu.', 'Kvalitní vápennatý tuk s přísadou grafitu. Je určen pro všeobecné použití a je odolný vůči vodě. Je vhodný pro použití na mazacích místech, kde je požadována kromě dolnosti vůči vodě také ochrana proti zadření. Je vhodný pro zařízení provozovaná v podmínkách vysokého tlaku v průmyslu a zemědělství. Výhodný pro mazání závitů šroubů, převodů o malých rozměrech, pružin, řětězů a kluzných desek trolejových patek. Grafitová přísada umožňuje částečnou elektrickou vodivost výrobku. ', 'NLGI 3', ' DIN 51502 - KF3C-30', ' ISO 6743-9  L-XCAHB 3', ' Rozsah pracovní teplot -20C až +70C', '3200.0', 50, 'KG', 0, 0, 'SUD-60L-MOL.png', 'mol-calton-g3-50kg', 'mol,dynamic,calton,alubia,liton,neoma,DIN,NLGI,ISO,plastické,mazivo,tuk,grafitové,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
(67, 9, 8, 1, 'MOL Calton G3', 'Kvalitní vápennatý tuk s přísadou grafitu.', 'Kvalitní vápennatý tuk s přísadou grafitu. Je určen pro všeobecné použití a je odolný vůči vodě. Je vhodný pro použití na mazacích místech, kde je požadována kromě dolnosti vůči vodě také ochrana proti zadření. Je vhodný pro zařízení provozovaná v podmínkách vysokého tlaku v průmyslu a zemědělství. Výhodný pro mazání závitů šroubů, převodů o malých rozměrech, pružin, řětězů a kluzných desek trolejových patek. Grafitová přísada umožňuje částečnou elektrickou vodivost výrobku. ', 'NLGI 3', ' DIN 51502 - KF3C-30', ' ISO 6743-9  L-XCAHB 3', ' Rozsah pracovní teplot -20C až +70C', '694.0', 8, 'KG', 0, 0, 'KBELÍK_MOL_TUK_8KG.png', 'mol-calton-g3-8kg', 'mol,dynamic,calton,alubia,liton,neoma,DIN,NLGI,ISO,plastické,mazivo,tuk,grafitové,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
(68, 9, 8, 1, 'MOL LITON 00', 'Vysoce výkonné plastické mazivo pro centrální mazací systémy užitkové techniky.', 'Plastické mazivo je vyrobeno speciálně na požadavky společnosti Willy Vogel. Plastické mazivo je vyrobeno na syntetickém základovém oleji a dále je zpevněno lithno-vápennatým mýdlem. Je určeno především pro centrální mazací systémy užitkové techniky a nákladních vozů.', 'NLGI 00', ' Willy Vogel', ' DIN 51502 KHC00F-40', ' ISO 6743-9', '6130.0', 50, 'KG', 0, 0, 'SUD-60L-MOL.png', 'mol-liton-00-50kg', 'mol,dynamic,calton,alubia,liton,neoma,DIN,NLGI,ISO,plastické,mazivo,tuk,grafitové,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
(69, 9, 8, 1, 'MOL LITON 00', 'Vysoce výkonné plastické mazivo pro centrální mazací systémy užitkové techniky.', 'Plastické mazivo je vyrobeno speciálně na požadavky společnosti Willy Vogel. Plastické mazivo je vyrobeno na syntetickém základovém oleji a dále je zpevněno lithno-vápennatým mýdlem. Je určeno především pro centrální mazací systémy užitkové techniky a nákladních vozů.', 'NLGI 00', ' Willy Vogel', ' DIN 51502 KHC00F-40', ' ISO 6743-9', '1194.0', 8, 'KG', 0, 0, 'KBELÍK_MOL_TUK_8KG.png', 'mol-liton-00-8kg', 'mol,dynamic,calton,alubia,liton,neoma,DIN,NLGI,ISO,plastické,mazivo,tuk,grafitové,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
(70, 9, 8, 1, 'MOL LITON 1EP', 'Vysoce výkonné plastické mazivo s přísadami EP/AW. Mazivo je určeno pro centrální mazací systémy užitkové techniky.', 'Plastické mazivo MOL Liton 1EP je vysoce výkonné mazivo vyrobené na bázi hluboce rafinovaného ropného oleje a lithného mýdla. MOL Liton 1EP je univerzálně použitelný v oblasti automobilové, zemědělství a v průmyslu. MOL Liton 1EP Je vhodný pro kluzná a valivá ložiska pracující pod velkou zatěží, pro ložiska výkonných ventilátorů a jiné vysoce zatížené plochy pracující v normálním rozsahu teplot. Chrání před korozí v neměnných vlhkých podmínkách. Je zvláště vhodný pro centrální mazací systémy.', 'NLGI 1', '  DIN 51502  KP1K-30', ' ISO 6743-9  L-XCCEB 1', ' DIN 51825  KP1K-30', '3800.0', 50, 'KG', 0, 0, 'SUD-60L-MOL.png', 'mol-liton-1ep-50kg', 'mol,dynamic,calton,alubia,liton,neoma,DIN,NLGI,ISO,plastické,mazivo,tuk,grafitové,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
