(72, 9, 8, 1, 'MOL LITON 2M', 'Vysoce výkonné plastické mazivo s přísadami EP/AW a pevno přísadou MoS2. Mazivo je určeno pro mazání vysoce zatížených míst užitkové techniky.', 'Plastické mazivo MOL Liton 2M je vysoce výkonné mazivo vyrobené na bázi hluboce rafinovaného ropného oleje a lithného mýdla. MOL Liton 2M je navíc doplněno o pevnou přísadou MoS2, která umožňuje inteligentní ochranu ložisek a čepů proti mezním tření. MOL Liton 2M je určen především pro vysoce až extrémně zatěžované části v automobilové technice, zemědělství a v průmyslu.  ', 'NLGI 2', '  DIN 51502  KPF2K-30', '  ISO 6743-9  L-XCCHB 20', ' Rozsah pracovní teplot -30C až +120C (krátkodobě +140C)', '95.0', 400, 'G', 0, 0, 'Kartuse_400g.png', 'mol-liton-2m-400g', 'mol,dynamic,calton,alubia,liton,neoma,DIN,NLGI,ISO,plastické,mazivo,tuk,grafitové,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
