(82, 9, 8, 1, 'MOL NEOMA K 3 S', 'Kvalitní komplexní vápennatý tuk.', 'MOL NEOMA K 3 S je komplexní vápennatý tuk. MOL NEOMA K 3 S je určen pro všeobecné použití a je odolný vůči vodě. MOL NEOMA K 3 S je vhodný pro použití na mazacích místech, kde je požadována kromě dolnosti vůči vodě i EP ochrana. Výhodný pro mazání valivých a kluzných uložení pracujících pod vysokým zatížením a v přítomnost vlhkosti.', 'NLGI 3', '  DIN 51502  K2/3K-30', '  ISO 6743-9  L-XCCHB 2/3', ' Rozsah pracovní teplot -30C až +120C (krátkodobě až +140C)', '670.0', 8, 'KG', 0, 0, 'KBELÍK_MOL_TUK_8KG.png', 'mol-neoma-k-3-s-8kg', 'mol,dynamic,calton,alubia,liton,neoma,DIN,NLGI,ISO,plastické,mazivo,tuk,grafitové,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
