(85, 9, 8, 1, 'MOL FAVORIT 2', 'Vysoce výkonné komplexní EP/AW plastické mazivo pro široké spektrum použití. ', 'Plastické mazivo MOL Favorit 2 je vysoce výkonné mazivo vyrobené na bázi hluboce rafinovaného ropného oleje a komplexního lithného mýdla. MOL Favorit 2 je výkonné plastické mazivo určeno pro vysoce namáhaná valivá a kluzná uložení v automobilové oblasti, zemědělství a v průmyslu. MOL Favorit je plastické mazivo s EP/AW přísadami, které zabezpečují vysokou přilnavost a ochranu. MOL Favorit 2 je určen především pro vysoké teplné zatížení valivého nebo kluzného uložení.', 'NLGI 2', '  DIN 51502 KP2N-30', '  ISO 6743-9  L-XCDEB 2', '  Rozsah pracovní teplot -30C až +140C (za pravidelného domazávání až +160C)', '109.0', 400, 'G', 0, 0, 'Kartuse_400g.png', 'mol-favorit-2-400g', 'mol,dynamic,calton,alubia,liton,neoma,DIN,NLGI,ISO,plastické,mazivo,tuk,grafitové,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
