(94, 5, 8, 1, 'MOL Dynamic Mistral 5W-30', 'Kvalitní plně syntetický motorový olej low-saps nové generace pro nejnovější motory nákladních vozidel a užitkové techniky motorizace EURO V/VI - MOL Dynamic Mistral 5W-30', 'MOL Dynamic Mistral 5W-30 je poslední generace vysoce výkonných olejů low-saps určené pro nejmodernější vznětové motory vozidel EURO V/VI. MOL Dynamic Mistral 5W-30 je vyrobený ze syntetických základových olejů a moderního komplexního balíku aditiv. MOL Dynamic Mistral 5W-30 je lehkoběžný motorový olej určený pro použití v nejmodernějších automobilech, které jsou vybavené pokrokovými systémy pro snížení obsahu pevných částic (DPF) a oxidů dusíku ( EGR nebo SCR).', 'SAE 5W-30', ' ACEA E9', ' API CJ-4/SN', ' MAN M 3677', '5720.0', 55, 'L', 0, 0, 'SUD-60L-MOL.png', 'mol-dynamic-mistral-5w-30-55l', 'mol,dynamic,mistral,sae,5W,30,olej,oil,motor,levny,levne,kvalitni,syntetický,SCR,EGR,DPF', '', '2016-03-03 14:50:37', 3),
