(100, 8, 8, 1, 'MOL Transfluid TO-4 10W', 'MOL Transfluid TO-4 10W je převodový olej vyvinutý převážně pro převodové systémy zemních strojů (terénní stroje, bagry, rypadla, nakladače) a do báňských zařízení. ', 'Převodový olej MOL Transfluid TO-4 10W je špičkový produkt vyrobený z hluboce rafinovaných minerálních základových olejů a komplexního balíku přísad. MOL Transfluid TO-4 10W splňuje specifikaci Caterpillar TO-4 a je doporučený do všech zařízení, kde je výrobcem předepsaný olej specifikace Caterpillar TO-4, SAE 10W. ', 'SAE 10W', ' Caterpillar TO-4', ' Komatsu KES 07.868.1', ' DANA Powershift Transmission ZF TE-ML 03C', '12180.0', 203, 'L', 0, 0, 'Sud_200L_MOL.png', 'mol-transfluid-to-4-10w-203l', 'omv,construct,mol,transfluid,SAE10W,cat,to-4,hydo,olej,oil,transmise,transmission,jcb,fluid,ep,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
