(102, 8, 8, 1, 'MOL Transfluid TO-4 30', 'MOL Transfluid TO-4 10W je převodový olej vyvinutý převážně pro převodové systémy zemních strojů (terénní stroje, bagry, rypadla, nakladače) a do báňských zařízení. ', 'Převodový olej MOL Transfluid TO-4 30 je špičkový produkt vyrobený z hluboce rafinovaných minerálních základových olejů a komplexního balíku přísad. MOL Transfluid TO-4 30 splňuje specifikaci Caterpillar TO-4 a je doporučený do všech zařízení, kde je výrobcem předepsaný olej specifikace MOL Transfluid TO-4 30. ', 'SAE 30', ' Caterpillar TO-4', ' Komatsu KES 07.868.1', ' DANA Powershift Transmission ZF TE-ML 03C', '12139.0', 199, 'L', 0, 0, 'Sud_200L_MOL.png', 'mol-transfluid-to-4-30-199l', 'omv,construct,mol,transfluid,SAE30,cat,to-4,hydo,olej,oil,transmise,transmission,jcb,fluid,ep,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
