(105, 7, 8, 1, 'MOL Farm NH Ultra', 'MOL Farm NH Ultra je olej s dlouhou životností určený na mazání převodovek, rozvodovek, koncových hřídelí, mokrých brzd, hydraulických okruhů zemědělských strojů a traktorů.', 'MOL Farm NH Ultra je olej s dlouhou životností určený na mazání převodovek, rozvodovek, koncových hřídelí, mokrých brzd, hydraulických okruhů zemědělských strojů a traktorů. MOL Farm NH Ultra je hydraulicko převodový olej pro stroje vyrobené hlavně firmami Case - New Holland Group (Case IH, New Holland, Steyr, McCormick, Fiatagri), Massey-Ferguson a John Deere).', 'SAE 80W', ' API GL-4', ' ZETOR', ' Ford ESN-M2C86-C', '3696.0', 56, 'L', 0, 0, 'SUD-60L-MOL.png', 'mol-farm-nh-ultra-56l', 'farm,nh,ultra,castrol,agritrans,plus,80w,shell,spirax,s4txm,mol,SAE80w,utto,john,deere,jdm,j20c,olej,oil,transmise,transmission,fluid,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
(106, 7, 8, 1, 'MOL Farm NH Ultra', 'MOL Farm NH Ultra je olej s dlouhou životností určený na mazání převodovek, rozvodovek, koncových hřídelí, mokrých brzd, hydraulických okruhů zemědělských strojů a traktorů.', 'MOL Farm NH Ultra je olej s dlouhou životností určený na mazání převodovek, rozvodovek, koncových hřídelí, mokrých brzd, hydraulických okruhů zemědělských strojů a traktorů. MOL Farm NH Ultra je hydraulicko převodový olej pro stroje vyrobené hlavně firmami Case - New Holland Group (Case IH, New Holland, Steyr, McCormick, Fiatagri), Massey-Ferguson a John Deere).', 'SAE 80W', ' API GL-4', ' ZETOR', ' Ford ESN-M2C86-C', '12383.0', 203, 'L', 0, 0, 'Sud_200L_MOL.png', 'mol-farm-nh-ultra-203l', 'farm,nh,ultra,castrol,agritrans,plus,80w,shell,spirax,s4txm,mol,SAE80w,utto,john,deere,jdm,j20c,olej,oil,transmise,transmission,fluid,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
(107, 7, 8, 1, 'MOL Farm STOU 10W-40', 'MOL Farm STOU 10W-40 je integrovaný mazací olej pro současné traktory a zemědělské stroje.', 'MOL Farm STOU 10W-40 je integrovaný mazací olej pro současné traktory a zemědělské stroje (FIAT, John Deere, IHC, Massey-Ferguson apod.) s vysokým výkonem, nepřeplňovanými a přeplňovanými motory vybavenými systémem mokrých brzd. Splňuje všechny požadavky kladené na oleje typu STOU (Super Tractor Oil Universal). MOL Farm STOU 10W-40 je částečně syntetický olej typu STOU (Super Tractor Oil Universal). Vyrábí se ze směsi syntetického hluboce rafinovaného minerálního základového oleje. Speciální reologické vlastnosti a komplexní balík aditiv jsou navrhnuté tak, aby olej splňoval nejvyšší požadavky nejmodernějších traktorů a zemědělských strojů. Splňuje požadavky kladené na motorové, převodové a hydraulické systémy traktorů pracujících v širokém rozsahu pracovních teplot. Olej je také vhodný pro použití v mokrých brzdách.', 'SAE 10W-40', ' ACEA E3', ' API CG-4', ' API GL-4', '3933.0', 57, 'L', 0, 0, 'SUD-60L-MOL.png', 'mol-farm-stou-10w-40-57l', 'farm,STOU,castrol,mp,plus,agritrans,plus,80w,shell,spirax,s4txm,mol,SAE10w-40,utto,john,deere,jdm,j20c,olej,oil,transmise,transmission,fluid,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
(108, 7, 8, 1, 'MOL Farm STOU 10W-40', 'MOL Farm STOU 10W-40 je integrovaný mazací olej pro současné traktory a zemědělské stroje.', 'MOL Farm STOU 10W-40 je integrovaný mazací olej pro současné traktory a zemědělské stroje (FIAT, John Deere, IHC, Massey-Ferguson apod.) s vysokým výkonem, nepřeplňovanými a přeplňovanými motory vybavenými systémem mokrých brzd. Splňuje všechny požadavky kladené na oleje typu STOU (Super Tractor Oil Universal). MOL Farm STOU 10W-40 je částečně syntetický olej typu STOU (Super Tractor Oil Universal). Vyrábí se ze směsi syntetického hluboce rafinovaného minerálního základového oleje. Speciální reologické vlastnosti a komplexní balík aditiv jsou navrhnuté tak, aby olej splňoval nejvyšší požadavky nejmodernějších traktorů a zemědělských strojů. Splňuje požadavky kladené na motorové, převodové a hydraulické systémy traktorů pracujících v širokém rozsahu pracovních teplot. Olej je také vhodný pro použití v mokrých brzdách.', 'SAE 10W-40', ' ACEA E3', ' API CG-4', ' API GL-4', '12710.0', 205, 'L', 0, 0, 'Sud_200L_MOL.png', 'mol-farm-stou-10w-40-205l', 'farm,STOU,castrol,mp,plus,agritrans,plus,80w,shell,spirax,s4txm,mol,SAE10w-40,utto,john,deere,jdm,j20c,olej,oil,transmise,transmission,fluid,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
(109, 15, 8, 1, 'MOL Hydro HME 46', 'Hydraulický olej MOL Hydro HME 46 je olej nové generace pro nejnovější hydraulické systémy.', 'Hydraulický olej MOL Hydro HME 46 je olej nové generace pro nejnovější hydraulické systémy. vhodný k použití pro veškerá hydrostatická zařízení bez ohledu na typ, kde je výrobcem zařízení požadován prvotřídní hydraulický olej s maximálni spolehlivostí a vynikající účinností. MOL Hydro HME 46 je prémiový hydraulický olej s vynikajícími protioděrovými vlastnostmi, poskytující nejvyččí výkonnostní úroveň. Vhodný pro širokou škálu průmyslových a mobilních hydraulických systémů, pracujících za ztížených provozních podmínek. MOL Hydro HME 46 se vyrábí z vybraných druhů minerálních olejů a vyváženého systému aditiv, obsahující antioxidanty, protioděrové , antikorozní a protipěnivostní přísady.', 'ISO VG 46', ' DIN 51524/II-HLP', ' Parker Hannifin (Denison) HF-0', ' Cincinnati Lamb P-70', '3050.0', 57, 'L', 0, 0, 'SUD-60L-MOL.png', 'mol-hydro-hme-46-57l', 'hydro,din,51524,part,2,část,II,hme,ISO,VG46,castrol,hyspin,aws,46,shell,tellus,s2,m46,mol,olej,oil,hydraulický,hydraulika,hydropohon,transmission,hydraulic,fluid,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
(110, 15, 8, 1, 'MOL Hydro HME 46', 'Hydraulický olej MOL Hydro HME 46 je olej nové generace pro nejnovější hydraulické systémy.', 'Hydraulický olej MOL Hydro HME 46 je olej nové generace pro nejnovější hydraulické systémy. vhodný k použití pro veškerá hydrostatická zařízení bez ohledu na typ, kde je výrobcem zařízení požadován prvotřídní hydraulický olej s maximálni spolehlivostí a vynikající účinností. MOL Hydro HME 46 je prémiový hydraulický olej s vynikajícími protioděrovými vlastnostmi, poskytující nejvyččí výkonnostní úroveň. Vhodný pro širokou škálu průmyslových a mobilních hydraulických systémů, pracujících za ztížených provozních podmínek. MOL Hydro HME 46 se vyrábí z vybraných druhů minerálních olejů a vyváženého systému aditiv, obsahující antioxidanty, protioděrové , antikorozní a protipěnivostní přísady.', 'ISO VG 46', ' DIN 51524/II-HLP', ' Parker Hannifin (Denison) HF-0', ' Cincinnati Lamb P-70', '9020.0', 205, 'L', 0, 0, 'Sud_200L_MOL.png', 'mol-hydro-hme-46-205l', 'hydro,din,51524,part,2,část,II,hme,ISO,VG46,castrol,hyspin,aws,46,shell,tellus,s2,m46,mol,olej,oil,hydraulický,hydraulika,hydropohon,transmission,hydraulic,fluid,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
(111, 15, 8, 1, 'MOL Hydro HV46', 'MOL Hydro HV 46 je vícerozsahový hydraulický olej, s nízkou závislostí své tekutosti na změně teploty.', 'MOL Hydro HV 46 je vícerozsahový hydraulický olej, s nízkou závislostí své tekutosti na změně teploty. MOL Hydro HV 46 může být použit při stálých vysokých teplotách (až do 100 °C s krátkými úseky nad 100 °C  a vysokém tlaku (až do 400 bar). MOL Hydro HV 46 je vícerozsahový hydraulický olej, který je vyráběn z vysoce rafinovaných základových olejů s vyváženým systémem přísad (antioxidanty, protioděrové, protipěnivostní a antikorozní přísady). Výrobek obsahuje pečlivě vybraný modifikátor viskozity poskytující vysokou hodnotu viskozitního indexu a tím umožňuje použití oleje v širokém rozsahu pracovních teplot.', 'ISO VG 46', ' DIN 51524/III-HVLP', ' Bosch-Rexroth RE 90220', ' ISO 11158 HV', '3306.0', 57, 'L', 0, 0, 'SUD-60L-MOL.png', 'mol-hydro-hv46-57l', 'hydro,din,51524,part,3,část,III,hv,ISO,VG46,castrol,hyspin,awh-m,46,shell,tellus,s2,v46,mol,olej,oil,hydraulický,hydraulika,hydropohon,transmission,hydraulic,fluid,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
(112, 15, 8, 1, 'MOL Hydro HV46', 'MOL Hydro HV 46 je vícerozsahový hydraulický olej, s nízkou závislostí své tekutosti na změně teploty.', 'MOL Hydro HV 46 je vícerozsahový hydraulický olej, s nízkou závislostí své tekutosti na změně teploty. MOL Hydro HV 46 může být použit při stálých vysokých teplotách (až do 100 °C s krátkými úseky nad 100 °C  a vysokém tlaku (až do 400 bar). MOL Hydro HV 46 je vícerozsahový hydraulický olej, který je vyráběn z vysoce rafinovaných základových olejů s vyváženým systémem přísad (antioxidanty, protioděrové, protipěnivostní a antikorozní přísady). Výrobek obsahuje pečlivě vybraný modifikátor viskozity poskytující vysokou hodnotu viskozitního indexu a tím umožňuje použití oleje v širokém rozsahu pracovních teplot.', 'ISO VG 46', ' DIN 51524/III-HVLP', ' Bosch-Rexroth RE 90220', ' ISO 11158 HV', '9108.0', 207, 'L', 0, 0, 'Sud_200L_MOL.png', 'mol-hydro-hv46-207l', 'hydro,din,51524,part,3,část,III,hv,ISO,VG46,castrol,hyspin,awh-m,46,shell,tellus,s2,v46,mol,olej,oil,hydraulický,hydraulika,hydropohon,transmission,hydraulic,fluid,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
(113, 1, 4, 1, 'SHELL HELIX ULTRA ECT 5W-30 (DOPRODEJ, PAK JIŽ 0W-30)', 'SHELL HELIX ULTRA ECT 5W-30  je plně syntetický, lehkobežný motorový olej nového složení pro benzínové a naftové motory osobních a lehkých užitkových vozidel. ', 'SHELL HELIX ULTRA ECT 5W-30 je plně syntetický, lehkobežný motorový olej nového složení pro benzínové a naftové motory osobních a lehkých užitkových vozidel. Motorový olej SHELL HELIX ULTRA ECT 5W-30 obsahuje speciální čistící aditiva, která zajištují maximální čistotu motoru a odstraňují i dlouhodobě usazené škodlivé nečistoty a úsady. Tento motorový olej je doporučen pro flexibilní/prodloužené výměnné intervaly.', 'SAE 5W-30', ' ACEA A3/B4', ' C2/C3', ' VW 504.00/507.00', '147.0', 1, 'L', 1, 1, 'Helix_UltraECT_5W30_1L.png', 'shell-helix-ultra-ect-5w-30-doprodej-pak-jiz-0w-30-1l', '', '', '2016-03-03 14:50:37', 3),
