(117, 1, 4, 1, 'SHELL HELIX ULTRA 5W-40', 'Shell Helix Ultra 5W-40 je plně syntetický, lehkoběžný motorový olej, využívající jedinečné syntetické základové složky Shell XHVI. Motorový olej Shell Helix Ultra 5W-40 nově obsahuje speciální čistící aditiva, která zajišťují maximální čistotu motoru a o', 'Shell Helix Ultra 5W-40 je plně syntetický, lehkoběžný motorový olej, využívající jedinečné syntetické základové složky Shell XHVI. Motorový olej Shell Helix Ultra 5W-40 nově obsahuje speciální čistící aditiva, která zajišťují maximální čistotu motoru a odstraňují i dlouhodobě usazené skodlivé nečistoty a úsady. Díky novému složení je zajištěna dlouhodobá oxidační stabilita oleje a tím prodloužená životnost motoru. Motorový olej rovněž minimalizuje hluk motoru a chrání ho i při extrémní zátěži dnešního provozu. ', 'SAE 5W-40', ' API SM/CF', ' ACEA A3/B4', ' MB 229.5/229.3/229.1', '116.0', 1, 'L', 0, 0, 'Helix_Ultra_5W-40_1L.png', 'shell-helix-ultra-5w-40-1l', '', '', '2016-03-03 14:50:37', 3),
