(123, 1, 4, 1, 'SHELL HELIX HX8 SYNTHETIC 5W-40', 'SHELL HELIX HX8 SYNTHETIC 5W-40 představuje plně syntetický vysoce výkonný motorový olej určený pro nejmodernější motory, kterým poskytuje výtečnou ochranu proti opotřebení svými vynikajícími čistícími účinky. ', 'SHELL HELIX HX8 SYNTHETIC 5W-40 představuje plně syntetický vysoce výkonný motorový olej určený pro nejmodernější motory, kterým poskytuje výtečnou ochranu proti opotřebení svými vynikajícími čistícími účinky. Je vhodný pro benzinové, naftové i plynové motory osobních vozidel zvláště pro ty, které mají víceventilové motory nebo katalyzátory. Zvýšení výkonu motoru a současné snížení spotřeby paliva je umožněno nízkou viskozitou oleje, kdy dochází k rychlému náběhu mazání i při studených startech.', 'SAE 5W-40', ' API SN/CF', ' VW 500.00/501.01/502.00/VW 503.01/505.00', ' MB 229.5/229.3/229.1', '121.0', 1, 'L', 0, 0, 'Helix_HX8Synthetic_5W-40_1L.png', 'shell-helix-hx8-synthetic-5w-40-1l', '', '', '2016-03-03 14:50:37', 3),
