(127, 1, 4, 1, 'SHELL HELIX HX6 10W-40', 'Shell Helix HX6 10W-40 je částečně syntetický motorový olej, pro benzínové, dieselové a plynové motory osobních a lehkých užitkových vozidel.', 'Shell Helix HX6 10W-40 je částečně syntetický motorový olej, pro benzínové, dieselové a plynové motory osobních a lehkých užitkových vozidel. Je vhodný pro atmosférické, přeplňované motory a motory s víceventilovou technologií. Použitím tohoto oleje je zaručena dokonalá ochrana motoru při studených startech, vysoká čistota a snížená spotřeba paliva. Zcela nové složení obsahuje speciální čistící aditiva, která zajišťují maximální čistotu motoru a odstraňují i dlohodobě usazené škodlivé nečistoty a usazeniny.', 'SAE 10W-40', ' ACEA A3/B4', ' API SL/CF', ' VW 502 00/505 00', '86.0', 1, 'L', 0, 0, 'Helix_HX6_10W40_1L.png', 'shell-helix-hx6-10w-40-1l', '', '', '2016-03-03 14:50:37', 3),
