(131, 1, 4, 1, 'SHELL HELIX HX7 PROFESSIONAL AV 5W-30 (HELIX DIESEL HX7 AV 5W-30)', 'Shell Helix Diesel HX7 AV 5W-30 je plně syntetický, lehkoběžný motorový olej, který zajišťuje dokonalou ochranu moderních dieselových motorů osobních automobilů. ', 'Shell Helix Diesel HX7 AV 5W-30 je plně syntetický, lehkoběžný motorový olej, který zajišťuje dokonalou ochranu moderních dieselových motorů osobních automobilů. Díky své nízké viskozitě a nízkému tření, zajištuje Shell Helix Diesel HX7 AV 5W-30 dokonalé mazání motoru i za nejnáročnějších provozních podmínek a umožňuje snížení spotřeby pohonných hmot. Při používání motorového oleje Shell Helix Diesel HX7 AV 5W-30 je Váš motor dokonale chráněn i při studených startech.', 'SAE 5W-30', ' API SL/CF', ' ACEA A3/B4', ' VW 505.00/505.01/502.00', '129.0', 1, 'L', 0, 0, 'Helix_HX7Professional_5W-30_AV_1L.png', 'shell-helix-hx7-professional-av-5w-30-helix-diesel-hx7-av-5w-30-1l', '', '', '2016-03-03 14:50:37', 3),
