(135, 1, 4, 1, 'SHELL HELIX ULTRA PROFESSIONAL AF 5W-30 (Helix HX7 Professional AF 5W30) ', 'SHELL HELIX Professional AF 5W-30 je motorový olej na syntetické bázi. Poskytuje úsporu paliva a maximální ochranu. Je oficiálně schválen pro specifikace Ford WSS-M2C913 A/B/C a pro Ford WSS-M2C913-D. SHELL HELIX Professional AF 5W-30 je vhodný pro většin', 'SHELL HELIX ULTRA PROFESSIONAL AF 5W-30 je motorový olej na syntetické bázi. Poskytuje úsporu paliva a maximální ochranu. Je oficiálně schválen pro specifikace Ford WSS-M2C913 A/B/C a Ford WSS-M2C913-D. Vhodný pro většinu moderních motorů Ford v Evropě. Je určený pro benzínové i naftové motory. Minimalizace vybrací, nižší hlučnosti motoru čisticí schopnost speciální technologie aktivního čištění lepší čisticí schopnost ve srovnání s minerálními oleji viskozitní vlastnosti ochrana motoru při studených startech díky rychlému zaolejování tepelná a oxidační stabilita lepší ochrana ve srovnání s jinými testovanými oleji na syntetické bázi stabilita ve střihu stablita ve střihu po celou dobu  provozu mezi výměnami.', 'SAE 5W-30', ' API SM/CF', ' ACEA A1/B1', ' ACEA A5/B5', '157.0', 1, 'L', 0, 0, 'Helix_HX7Proffesional_5W-30_AF_1L.png', 'shell-helix-ultra-professional-af-5w-30-helix-hx7-professional-af-5w30-1l', '', '', '2016-03-03 14:50:37', 3),
