(137, 1, 4, 1, 'SHELL HELIX HX3 15W-40', 'Shell Helix HX3 15W-40 je minerální motorový olej pro benzínové, naftové a plynové motory osobní vozidel.', 'Shell Helix HX3 15W-40 je minerální motorový olej pro benzínové, naftové a plynové motory osobní vozidel. Olej chrání motor před usazováním škodlivin a nabízí o více než 20% více ochrany než u jiné značky. ', 'SAE 15W-40', ' API SG/CD', ' API SG/CD', ' API SG/CD', '74.0', 1, 'L', 0, 0, 'Helix_HX3_15W40_1L.png', 'shell-helix-hx3-15w-40-1l', '', '', '2016-03-03 14:50:37', 3),
