(140, 5, 4, 1, 'SHELL RIMULA R4 X 15W-40 (RIMULA R3X)', 'Minerální motorový olej. Vhodný pro mazání atmosférických a přeplňovaných naftových motorů nákladních vozidel, stavební a zemědělské techniky.', 'Vysoce výkonný motorový olej pro velké naftové motory. Je vyroben z nejkvalitnějšího ropného olejového základu s vysokým viskozitním indexem a souboru vybraných aditiv. Shell RIMULA R4 X 15W40 se vyznačuje vysokou oxidační a termickou stabilitou a vynikajícími čistícími schopnostmi. Díky těmto vlastnostem zajišťuje olej RIMULA R4 X 15W40 vysokou čistotu motoru a tím i jeho delší životnost. Motorový olej Shell RIMULA R4 X 15W40 je schválen a doporučen nejvýznamnějšími výrobci automobilů. Je určen především pro použití v silně zatěžovaných dieselových motorech nákladních automobilů, zemědělské a stavební techniky, v četně motorů Euro 4/Euro 3. Je vhodný jak pro motory pracující při konstantně vysokých otáčkách, tak pro motory s provozním režimem start-stop či pracující v mimosilničním provozu.', 'ACEA E7/E5', ' API CI-4/CH-4/SL', ' Caterpillar ECF-1-A', ' Cummins CES 20077', '12700.0', 209, 'L', 0, 0, 'Sud-Shell-200L.png', 'shell-rimula-r4-x-15w-40-rimula-r3x-209l', '', '', '2016-03-03 14:50:37', 3),
(141, 5, 4, 1, 'SHELL RIMULA R4 L 15W-40', 'Shell Rimula R4 L 15W-40 je motorový olej třídy PHPDO (Premium High Performance Diesel Engine Oil), který byl speciálně vyvinut pro použití v nejvýkonnějších a nejzatěžovanějších naftových motorech.', 'Shell Shell RIMULA R4 L 15W-40 je špičkový motorový olej třídy PHPDO (Premium High Performance Diesel Engine Oil), který byl speciálně vyvinut pro použití v nejvýkonnějších a nejzatěžovanějších naftových motorech. Je doporučen pro atmosférické i přeplňované naftové motory v nákladních a užitkových vozech, včetně nejmodernějších motorů Euro 3 a Euro 4. Díky svému novému složení zajišťuje vynikající ochranu nejmodernějším nízkoemisním motorům evropských, amerických a japonských výrobců.První produkt svého druhu schválený podle normy ACEA E9 (nejnovější evropská výkonová specifikace motorových olejů pro nákladní vozy oficiálně zavedená v prosinci 2008).', 'SAE 15W-40', ' API CJ-4', ' CI-4+', ' CI-4', '335.0', 44, '4L X 4KS', 0, 0, 'Rimula_R4L_15W-40_20L.png', 'shell-rimula-r4-l-15w-40-4l-x-4ks', '', '', '2016-03-03 14:50:37', 3),
