(145, 5, 4, 1, 'SHELL RIMULA R5 E 10W-40', 'Syntetický motorový olej pro nákladní vozy s lepšími ochrannými vlastnostmi a výkonností než mají konvenční produkty třídy SAE 15W-40. Olej vhodný pro většinu motorů splňujících požadavky Euro 3 a mnoho motorů Euro 4.', 'Shell Rimula R5 E využívá vybrané syntetické základové oleje a přísady, které zaručí úsporu paliva a ochranu v širokém rozmezí tlaků a teplot, jež se vyskytují v moderních motorech, aby tak vyšel vstříc potřebám uživatelů vozových parků těžkých nákladních vozidel a autobusů. Kombinace základových olejů na bázi syntetické technologie a pokrokového systému přísad poskytuje vynikající ochranu i při nízkých teplotách. Lepší nízkoteplotní vlastnosti oleje pomáhají chránit motor při tzv. studených startech. Aplikace: Shell Rimula R5 E je schválen rozsáhlou řadou výrobců motorů pro použití téměř ve všech nejnovějších motorech. Je vynikající volbou pro uživatele vozových parků v místech s velkými teplotními rozdíly – jeden olej chrání bez ohledu na roční období. Navíc Shell Rimula R5 E nabízí potenciál pro snížení spotřeby paliva, čímž přímo přispívá ke snižování provozních nákladů. Vhodný pro Euro 2, 3 a některé motory Euro 4.', 'SAE 10W-40', ' API CI-4', ' CH-4', ' CG-4', '360.0', 44, '4L X 4KS', 0, 0, 'Rimula_R5E_10W-40_20L.png', 'shell-rimula-r5-e-10w-40-4l-x-4ks', '', '', '2016-03-03 14:50:37', 3),
