(148, 5, 4, 1, 'SHELL RIMULA R5 E 10W-40', 'Syntetický motorový olej pro nákladní vozy s lepšími ochrannými vlastnostmi a výkonností než mají konvenční produkty třídy SAE 15W-40. Olej vhodný pro většinu motorů splňujících požadavky Euro 3 a mnoho motorů Euro 4.', 'Shell Rimula R5 E využívá vybrané syntetické základové oleje a přísady, které zaručí úsporu paliva a ochranu v širokém rozmezí tlaků a teplot, jež se vyskytují v moderních motorech, aby tak vyšel vstříc potřebám uživatelů vozových parků těžkých nákladních vozidel a autobusů. Kombinace základových olejů na bázi syntetické technologie a pokrokového systému přísad poskytuje vynikající ochranu i při nízkých teplotách. Lepší nízkoteplotní vlastnosti oleje pomáhají chránit motor při tzv. studených startech. Aplikace: Shell Rimula R5 E je schválen rozsáhlou řadou výrobců motorů pro použití téměř ve všech nejnovějších motorech. Je vynikající volbou pro uživatele vozových parků v místech s velkými teplotními rozdíly – jeden olej chrání bez ohledu na roční období. Navíc Shell Rimula R5 E nabízí potenciál pro snížení spotřeby paliva, čímž přímo přispívá ke snižování provozních nákladů. Vhodný pro Euro 2, 3 a některé motory Euro 4.', 'SAE 10W-40', ' API CI-4', ' CH-4', ' CG-4', '13800.0', 209, 'L', 0, 0, 'Sud-Shell-200L.png', 'shell-rimula-r5-e-10w-40-209l', '', '', '2016-03-03 14:50:37', 3),
(149, 5, 4, 1, 'SHELL RIMULA R5 LE 10W-30', '"Shell Rimula R5 LE 10W-30 je motorový olej ""Low Saps"" určený především pro vozy VOLVO Euro 5 a Euro 6."', 'Shell Rimula R5 LE 10W-30 je syntetický motorový olej nové generace určený především pro motory VOLVO Euro 5 a Euro 6. Motorový olej Shell Rimula R5 LE 10W-30 svou formulací zaručuje maximální ochranu motoru a systémům dodatečné úpravy výfukových plynů SCR/EGR/DPF. Olej Shell Rimula R5 LE je formulován ve viskozitě 10W-30, což zaručuje výborné nizkoteplotní vlastnosti a lehkoběžnost v provozu.', 'SAE 10W-30', ' API CJ-4', ' ACEA E7/E9', ' VOLVO VDS-4', '1960.0', 20, 'L', 0, 0, 'Rimula_R5LE_10W-30_4L.png', 'shell-rimula-r5-le-10w-30-20l', '', '', '2016-03-03 14:50:37', 3);
