(150, 5, 4, 1, 'SHELL RIMULA R5 LE 10W-30', '"Shell Rimula R5 LE 10W-30 je motorový olej ""Low Saps"" určený především pro vozy VOLVO Euro 5 a Euro 6."', 'Shell Rimula R5 LE 10W-30 je syntetický motorový olej nové generace určený především pro motory VOLVO Euro 5 a Euro 6. Motorový olej Shell Rimula R5 LE 10W-30 svou formulací zaručuje maximální ochranu motoru a systémům dodatečné úpravy výfukových plynů SCR/EGR/DPF. Olej Shell Rimula R5 LE je formulován ve viskozitě 10W-30, což zaručuje výborné nizkoteplotní vlastnosti a lehkoběžnost v provozu.', 'SAE 10W-30', ' API CJ-4', ' ACEA E7/E9', ' VOLVO VDS-4', '17055.0', 209, 'L', 0, 0, 'Sud-Shell-200L.png', 'shell-rimula-r5-le-10w-30-209l', '', '', '2016-03-03 14:50:37', 3),
(151, 5, 4, 1, 'SHELL RIMULA R5 LM 10W-40', '"Shell Rimula R5 LM je syntetický motorový olej ""Low Saps"" pro nákladní vozidla."', 'Shell Rimula R5 LM je syntetický motorový olej pro nákladní vozidla.  Shell Rimula R5 LM  je olej typu „Low SAPS“ a byl prověřen v širokém spektru aplikací a byl schválen pro použití v motorech spalujících motorovou naftu nebo stlačený zemní plyn mnoha předními světovými výrobci včetně Mercedes-Benz a MAN. ', 'SAE 10W-40', ' ACEA E4/E6', ' MAN 3477', ' MB 228.51.', '16302.0', 209, 'L', 0, 0, 'Sud-Shell-200L.png', 'shell-rimula-r5-lm-10w-40-209l', '', '', '2016-03-03 14:50:37', 3),
(152, 5, 4, 1, 'SHELL RIMULA R6 LM 10W-40', 'Shell Rimula R6LM je plně syntetický motorový olej pro nákladní vozidla. Shell Rimula R6LM je olej typu „Low SAPS“ a byl prověřen v širokém spektru aplikací a byl schválen pro použití v motorech spalujících motorovou naftu nebo stlačený zemní plyn mnoha p', 'Shell Rimula R6 LM je plně syntetický motorový olej pro nákladní vozidla.  Shell Rimula R6 LM je olej typu „Low SAPS“ a byl prověřen v širokém spektru aplikací a byl schválen pro použití v motorech spalujících motorovou naftu nebo stlačený zemní plyn mnoha předními světovými výrobci včetně Mercedes-Benz, MAN, Volvo, Cummins a mnoha dalšími.  Shell Rimula R6LM má mimořádný rozsah specifikací a norem, který olej splňuje, z něho činí oblíbenou volbu provozovatelů smíšených vozových parků a veřejné dopravy po celé Evropě.', 'SAE 10W-40', ' ACEA E7', ' E6', ' E4', '456.0', 44, '4L X 4KS', 0, 0, 'Rimula_R6LM_10W-40_20L.png', 'shell-rimula-r6-lm-10w-40-4l-x-4ks', '', '', '2016-03-03 14:50:37', 3),
