(155, 5, 4, 1, 'SHELL RIMULA R6 LME 5W-30', '"Shell Rimula R6 LME 5W-30 je plně syntetický motorový olej ""Low Saps"" pro nákladní vozidla. "', '"Shell Rimula R6LME 5W-30 je plně syntetický motorový olej ""Low Saps"" pro nákladní vozidla EURO 4, EURO 5 a EURO 6. Shell Rimula R6LME 5W-30 je špičkový produkt vyráběný za použití nejnovějších syntetických technologií pro nejmodernější dopravní techniku. Olej jedinečně kombinuje schopnost účinně bránit opotřebení, potlačovat vznik a usazování úsad v motoru a přispívat ke snížené spotřebě paliva provozovatelů nejmodernějších motorů EURO 4, EURO 5 a EURO 6."', 'SAE 5W-30', ' ACEA E4', 'E6', 'E7', '2700.0', 20, 'L', 0, 0, 'Rimula_R6LME_5W-30_20L.png', 'shell-rimula-r6-lme-5w-30-20l', '', '', '2016-03-03 14:50:37', 3),
