(157, 5, 4, 1, 'SHELL RIMULA R6 M 10W-40', 'Shell Rimula R6 M 10W-40 je plně syntetický motorový olej pro nákladní vozidla zajišťující vynikající ochranu před opotřebením a potlačující tvorbu úsad i při prodloužených výměnných intervalech. ,', 'Shell Rimula R6 M 10W-40 je plně syntetický motorový olej pro nákladní vozidla zajišťující vynikající ochranu před opotřebením a potlačující tvorbu úsad i při prodloužených výměnných intervalech. Olej Shell Rimula R6 M 10W-40 nabízí dopravcům snížení nákladů na údržbu díky využití maximálních výměnných intervalů schválených řadou předních evropských výrobců vozů včetně Mercedes-Benz, MAN, Volvo a dalšími.', 'SAE 10W-40', ' ACEA E7', ' E4', ' API CF', '436.0', 44, '4L X 4KS', 0, 0, 'Rimula_R6M_10W-40_20L.png', 'shell-rimula-r6-m-10w-40-4l-x-4ks', '', '', '2016-03-03 14:50:37', 3),
