(161, 6, 4, 1, 'SHELL SPIRAX S1 G 80W-90', 'Speciální převodový olej formulovaný tak, aby splňoval požadavky automobilních převodovek, které vyžadují oleje se slabšími vysokotlakými vlastnostmi. P', 'Speciální převodový olej formulovaný tak, aby splňoval požadavky automobilních převodovek, které vyžadují oleje se slabšími vysokotlakými vlastnostmi. Proto je vhodný hlavně pro některé méně zatěžované manuální převodovky (např. v nákladních vozech a autobusech Volvo), šnekové převody atd.', 'API GL-3', ' Volvo 97305', ' Volvo 97305', ' Volvo 97305', '1696.0', 20, 'L', 0, 0, 'rimula-r6-lm-20l-web.png', 'shell-spirax-s1-g-80w-90-20l', '', '', '2016-03-03 14:50:37', 3),
