(176, 6, 4, 1, 'SHELL SPIRAX S3 AM 80W-90', 'Speciální převodový olej určený pro nápravové diferenciály a rozvodovky automobilů, pro vysoce zatížené koncové převody a rovněž pro synchronizované a nesynchronizované převodovky vozidel.', 'Shell Spirax S3 AM jsou ropné převodové oleje nové generace. Jsou formulovány ze speciálního základového oleje a nového typu přísad. Shell Spirax S3 AM jsou vysokotlaké oleje s obsahem speciálních EP aditiv a jsou určeny především pro nápravové diferenciály a rozvodovky automobilů, pro vysoce zatížené koncové převody a rovněž pro synchronizované a nesynchronizované převodovky vozidel. Díky své jedinečné formulaci umožňuje maximalizovat výměnné intervaly.     Zaručuje dokonalou ochranu převodů i při nejvyšším zatížení, spolehlivou funkci při všech provozních podmínkách, vysokou oxidační a střihovou stabilitu, prodloužené výměnné intervaly', 'API GL-5/GL-4/MT-1', ' MIL-PRF-2105E', ' MACK GO-J', ' MAN 3343 ML', '2343.0', 20, 'L', 0, 0, 'rimula-r6-lm-20l-web.png', 'shell-spirax-s3-am-80w-90-20l', '', '', '2016-03-03 14:50:37', 3),
