(178, 6, 4, 1, 'SHELL SPIRAX S3 AS 80W-140', 'Speciální hypoidní převodový olej určený pro silně zatěžované rozvodovky, nápravy a převodovky', 'Shell Spirax S3 AS 80W-140 jsou převodové oleje nové generace. Jsou formulovány ze speciálně rafinovaného minerálního základového oleje a nového typu přísad. Díky svému složení umožňují obzvláště snadný chod mazaných zařízení, čímž snižují energetické ztráty a přispívají k úsporám paliva. Shell Spirax S3 AS 80W-140 jsou vysokotlaké oleje s obsahem speciálních EP aditiv a jsou určeny především pro nápravové diferenciály a rozvodovky osobních a nákladních automobilů, pro vysoce zatížené koncové převody a rovněž pro nesynchronizované převodovky vozidel. Zvláště vhodné jsou tyto oleje pro systémy vybavené filtrací oleje. Díky své jedinečné formulaci umožňují maximalizovat výměnné intervaly. Zaručuje dokonalou ochranu převodů i při nejvyšším zatížení, nižší ztráty třením a tím nižší spotřebu paliva, spolehlivou funkci při všech provozních podmínkách, vysokou oxidační a střihovou stabilitu, prodloužené výměnné intervaly.', 'API GL-5/MT-1', ' Scania STO 1:0', ' ZF TE-ML 05A-07A-12A-16C-17B', ' RVI', '23735.0', 209, 'L', 0, 0, 'Sud-Shell-200L.png', 'shell-spirax-s3-as-80w-140-209l', '', '', '2016-03-03 14:50:37', 3),
