(184, 6, 4, 1, 'SHELL SPIRAX S3 G 80W', 'Vysoce výkonný minerální převodový olej určený především pro manuální synchronizované převodovky a pro středně zatížené nápravové diferenciály a rozvodovky.', 'Shell Spirax S3 G je vysoce výkonný převodový olej nové generace. Je formulován na základě speciálně rafinovaného minerálního základového oleje a nového typu přísad. Díky svému složení umožňuje obzvláště snadný chod mazaných zařízení, čímž snižuje energetické ztráty a přispívá k úsporám paliva. Shell Spirax S3 G je určen především pro manuální synchronizované převodovky a pro středně zatížené nápravové diferenciály a rozvodovky osobních i nákladních automobilů. Převodový oleje Shell Spirax S3 G se vyznačuje mimořádnou stabilitou a umožňuje prodloužit výměnné intervaly.', 'API GL-4', ' MB 235.5', ' MAN 341 Typ Z2', ' E2', '125.0', 1, 'L', 0, 0, '', 'shell-spirax-s3-g-80w-1l', '', '', '2016-03-03 14:50:37', 3),
