(189, 6, 4, 1, 'SHELL SPIRAX S4 ATF HDX', 'Plně syntetická kapalina typu Dextron III pro automatické převodovky zaručující vozidlům dlouhodobou ochranu i v nejtěžších podmínkách. ', 'Shell SPIRAX S4 ATF HDX je syntetická kapalina do automatických převodovek nejvyšší kvality. Je formulována tak, aby splňovala nejnovější specifikace jako např. General Motors Dexron III a zároveň je optimalizovaná pro nejnáročnější požadavky výrobců převodovek. Tato kapalina je vyráběna ze syntetického olejového základu Shell XHVI a vybraných aditiv, což umožňuje dosáhnout optimálního výkonu za všech podmínek. Hydraulická kapalina Shell SPIRAX S4 ATF HDX je doporučena speciálně pro nejmodernější automatické převodovky. Umožňuje maximálně prodloužit výměnné lhůty i za ztížených provozních podmínek. Je rovněž vhodná pro použití v automobilech jako hydraulická kapalina, kapalina do posilovačů řízení a pro řadu manuálních převodovek.', 'GM DEXRON III', ' Allison C-4', ' Ford Mercon', ' Voith 55.6335.30 & 55.6336.30 (ex G 607/1363)', '171.0', 1, 'L', 0, 0, '', 'shell-spirax-s4-atf-hdx-1l', '', '', '2016-03-03 14:50:37', 3),
