(192, 6, 4, 1, 'SHELL SPIRAX S4 G 75W-80', 'Speciální převodový olej vyvinutý především pro manuální převodové skříně s hypoidními soukolími, ve vozech Peugeot a Citroën.', 'Spirax S4 G 75W-80 je speciální převodový olej, zvláště vyvinutý pro manuální převodové skříně s hypoidními soukolími, ve vozech Peugeot a Citroën. Je určený pro použití v nejnáročnějších podmínkách rázového zatížení, přetížení atd. Díky své formulaci umožňuje snadné řazení za všech teplot, minimalizuje ztráty třením a poskytuje převodům maximální ochranu.', 'API GL-4+', ' PSA Standard B71 2315', ' PSA Standard B71 2315', ' PSA Standard B71 2315', '173.0', 1, 'L', 0, 0, '', 'shell-spirax-s4-g-75w-80-1l', '', '', '2016-03-03 14:50:37', 3),
(193, 6, 4, 1, 'SHELL SPIRAX S4 G 75W-90', 'Vícerozsahový, syntetický převodový olej na bázi syntetické základové složky Shell XHVI, speciálně vyvinutý pro manuální převodovky osobních vozidel a lehkých dodávkových vozidel koncernu VW. ', 'Vícerozsahový, syntetický převodový olej na bázi syntetické základové složky Shell XHVI, speciálně vyvinutý pro manuální převodovky osobních vozidel a lehkých dodávkových vozidel koncernu VW. Je rovněž vhodný do moderních synchronních a hypoidních převodovek se sníženým zapuštěním os, do koncových převodů s normálním zatížením. Díky své formulaci vyniká vysokou střihovou stabilitou.', 'API GL-4', ' VW 501.50', ' VW 501.50', ' VW 501.50', '194.0', 1, 'L', 0, 0, '', 'shell-spirax-s4-g-75w-90-1l', '', '', '2016-03-03 14:50:37', 3),
(194, 6, 4, 1, 'SHELL SPIRAX S4 G 75W-90', 'Vícerozsahový, syntetický převodový olej na bázi syntetické základové složky Shell XHVI, speciálně vyvinutý pro manuální převodovky osobních vozidel a lehkých dodávkových vozidel koncernu VW. ', 'Vícerozsahový, syntetický převodový olej na bázi syntetické základové složky Shell XHVI, speciálně vyvinutý pro manuální převodovky osobních vozidel a lehkých dodávkových vozidel koncernu VW. Je rovněž vhodný do moderních synchronních a hypoidních převodovek se sníženým zapuštěním os, do koncových převodů s normálním zatížením. Díky své formulaci vyniká vysokou střihovou stabilitou.', 'API GL-4', ' VW 501.50', ' VW 501.50', ' VW 501.50', '3479.0', 20, 'L', 0, 0, 'rimula-r6-lm-20l-web.png', 'shell-spirax-s4-g-75w-90-20l', '', '', '2016-03-03 14:50:37', 3),
(195, 6, 4, 1, 'SHELL SPIRAX S4 TX', 'Částečně syntetický univerzální celoroční olej třídy STOU (Super Tractor Oil Universal), který je speciálně určen pro zemědělskou techniku a lesní stroje.', 'Shell Spirax S4 TX je částečně syntetický univerzální celoroční olej třídy STOU (Super Tractor Oil Universal), který je speciálně určen pro zemědělskou techniku a lesní stroje. Je vhodný jako motorový olej pro přeplňované i atmosférické naftové a benzínové motory. Díky své univerzálnosti je rovněž doporučován jako převodový olej pro manuální převodovky, které mohou být řazeny i pod zatížením. Dále je tento olej vhodný do rozvodovek, převodovek vývodového hřídele, pro hydraulické systémy atd. Třecí charakteristika oleje je upravena tak, aby mohl být použit ve společných systémech ozubených převodů, hydraulických ovládacích a regulačních okruhů a mokrých brzd. Shell Spirax S4 TX vyniká vysokou oxidační stabilitou, výbornými studenými starty, protikorozní ochranou. Díky své univerzálnosti je optimálním mazivem pro majitele smíšeného vozového parku, a zároveň umožňuje maximálně snížit požadavky na skladové hospodářství. ', 'SAE 10W-40', ' API SF/CF-4', ' API GL-4/5 ', ' CCMC D-4', '2080.0', 20, 'L', 0, 0, 'rimula-r6-lm-20l-web.png', 'shell-spirax-s4-tx-20l', '', '', '2016-03-03 14:50:37', 3),
