(197, 6, 4, 1, 'SHELL SPIRAX S4 TXM', 'Minerální olej UTTO určený pro hydraulické systémy, převodovky, mokré brzdy a další aplikace v zemědělských strojích.', 'Shell Spirax S4 TXM je speciální hydraulická kapalina (UTTO), určená především pro aplikace v převodech, hydraulických systémech, mokrých brzdách a dalších systémech traktorů a mimosilničních mechanismů John Deere. Může být rovněž použita v dalších aplikacích jiných výrobců, kde je požadována kapalina této třídy.', 'API GL-4', ' Ford M2C 134 A-D', ' Ford New Holland FNHA-2-D 201.00', ' CASE New Holland  MAT 3525', '1668.0', 20, 'L', 0, 0, 'rimula-r6-lm-20l-web.png', 'shell-spirax-s4-txm-20l', '', '', '2016-03-03 14:50:37', 3),
