(199, 6, 4, 1, 'SHELL SPIRAX S6 AXME 75W-90', 'Převodový olej SHELL SPIRAX S6 AXME 75W-90 je plně syntetický hypoidní převodový olej určený pro nejmodernější a nejnáročnější mechanické převodovky, rozvodovky, diferenciály.', 'Převodový olej SHELL SPIRAX S6 AXME 75W-90 je plně syntetický hypoidní převodový olej určený pro nejmodernější a nejnáročnější mechanické převodovky, rozvodovky, diferenciály. Převodový olej  SHELL SPIRAX S6 AXME 75W-90 je určený pro vysoce zatěžované převodovky, rozvodovky a diferenciály s nejdelším výměnným intervalem. Převodový olej  SHELL SPIRAX S6 AXME 75W-90 je formulován nejnovějším balíkem aditiv, který překračuje požadavky OEM výrobců (MAN, VOLVO, DAF atd.).', 'SAE 75W-90', ' API GL-5', ' TM-1', ' MAN 342 Typ S1', '3280.0', 20, 'L', 0, 0, 'rimula-r6-lm-20l-web.png', 'shell-spirax-s6-axme-75w-90-20l', 'prevodovy,diferencial,rozvodovka,shell,spirax,S6,AXME,sae,75W,90,API,GL-5,TDL,olej,oil,motor,levny,levne,kvalitni', '', '2016-03-03 14:50:37', 3),
