(204, 6, 4, 1, 'SHELL SPIRAX S6 TXME 10W-30', 'Špičkový olej UTTO na syntetické bázi určený pro hydraulické systémy, převodovky, mokré brzdy a další aplikace v zemědělských strojích.', 'Shell SPIRAX S6 TXME je hydraulická kapalina (UTTO) nejnovější technologie navržená především pro aplikace v převodech, hydraulických systémech, mokrých brzdách a dalších systémech traktorů a mimosilničních mechanismů. Kombinuje syntetický základový olej Shell XHVI s nejmodernějšími technologiemi nejnovějších aditiv, je zvláště vhodný pro velká zatěžení a aplikace pracující trvale při vysokých teplotách.', 'API GL-4', ' Ford M2C 134D', ' Ford New Holland FNHA-2-D 201.00', ' John Deere JDM-J20C', '2731.0', 20, 'L', 0, 0, 'rimula-r6-lm-20l-web.png', 'shell-spirax-s6-txme-10w-30-20l', '', '', '2016-03-03 14:50:37', 3),
(205, 6, 4, 1, 'SHELL SPIRAX S6 TXME 10W-30', 'Špičkový olej UTTO na syntetické bázi určený pro hydraulické systémy, převodovky, mokré brzdy a další aplikace v zemědělských strojích.', 'Shell SPIRAX S6 TXME je hydraulická kapalina (UTTO) nejnovější technologie navržená především pro aplikace v převodech, hydraulických systémech, mokrých brzdách a dalších systémech traktorů a mimosilničních mechanismů. Kombinuje syntetický základový olej Shell XHVI s nejmodernějšími technologiemi nejnovějších aditiv, je zvláště vhodný pro velká zatěžení a aplikace pracující trvale při vysokých teplotách.', 'API GL-4', ' Ford M2C 134D', ' Ford New Holland FNHA-2-D 201.00', ' John Deere JDM-J20C', '25838.0', 209, 'L', 0, 0, 'Sud-Shell-200L.png', 'shell-spirax-s6-txme-10w-30-209l', '', '', '2016-03-03 14:50:37', 3),
(206, 15, 4, 1, 'SHELL TELLUS S2 M 100', 'Vysoce kvalitní hydraulický olej vyrobený na bázi patentované formulace Shell Tellus New Generation. ', 'Vysoce kvalitní hydraulický olej vyrobený na bázi patentované formulace Shell Tellus New Generation. Vyznačuje se vynikající oxidační, tepelnou a hydrolitickou stabilitou, filtrovatelností a protioděrovými vlastnostmi. Mimořádně vhodné jsou pro zařízení, která díky svému konstrukčnímu řešení a náročnosti pracovních podmínek vyžadují pracovní kapalinu se zvýšenou schopností ochrany proti opotřebení a/nebo schopností přenášet extrémní tlaky. Splňují požadavky na oleje třídy HLP dle DIN 51524 díl 2, ISO 11158, GM LS/2, AFNOR NF-E 48-603, Mannesman Rexroth RE 90 220-1, Swedish Standard SS 15 54 34 AM. Jsou doporučovány předními výrobci hydraulických prvků i systémů.', 'ISO VG 100', ' CINCINNATI P-68 (ISO 32)', ' CINCINNATI P-70 (ISO 46)', ' CINCINNATI P-69 (ISO 68)', '1725.0', 20, 'L', 0, 0, 'rimula-r6-lm-20l-web.png', 'shell-tellus-s2-m-100-20l', '', '', '2016-03-03 14:50:37', 3),
