(215, 15, 4, 1, 'SHELL TELLUS S2 M 68', 'Vysoce kvalitní hydraulický olej vyrobený na bázi patentované formulace Shell Tellus New Generation. ', 'Vysoce kvalitní hydraulický olej vyrobený na bázi patentované formulace Shell Tellus New Generation. Vyznačuje se vynikající oxidační, tepelnou a hydrolitickou stabilitou, filtrovatelností a protioděrovými vlastnostmi. Mimořádně vhodné jsou pro zařízení, která díky svému konstrukčnímu řešení a náročnosti pracovních podmínek vyžadují pracovní kapalinu se zvýšenou schopností ochrany proti opotřebení a/nebo schopností přenášet extrémní tlaky. Splňují požadavky na oleje třídy HLP dle DIN 51524 díl 2, ISO 11158, GM LS/2, AFNOR NF-E 48-603, Mannesman Rexroth RE 90 220-1, Swedish Standard SS 15 54 34 AM. Jsou doporučovány předními výrobci hydraulických prvků i systémů.', 'ISO VG 68', ' CINCINNATI P-68 (ISO 32)', ' CINCINNATI P-70 (ISO 46)', ' CINCINNATI P-69 (ISO 68)', '12018.0', 209, 'L', 0, 0, 'Sud-Shell-200L.png', 'shell-tellus-s2-m-68-209l', '', '', '2016-03-03 14:50:37', 3),
(216, 15, 4, 1, 'SHELL TELLUS S2 MA 46', 'Shell Tellus S2 MA jsou vysoce kvalitní hydraulické kapaliny založené na bázi vysoce rafinovaných minerálních základových oleju doplnených souborem prísad bez obsahu zinku. ', 'Shell Tellus S2 MA jsou vysoce kvalitní hydraulické kapaliny založené na bázi vysoce rafinovaných minerálních základových oleju doplnených souborem prísad bez obsahu zinku. Mají dobrou viskozitneteplotní závislost a vynikající mechanickou a oxidacní stabilitu. Vyznacují se výbornými ochrannými schopnostmi proti opotrebení a poskytují spolehlivou ochranu proti rzi a korozi. az-auto. Splnují nebo prekracují požadavky stanovené normou DIN 51 524 díl 2 pro hydraulické oleje HLP-D. Oleje rady Shell Tellus S2 MA obsahují ve své formulaci speciální detergentní (cistící) prísady, které zabranují zalepování a potlacují tvorbu úsad v hydraulickém okruhu. Úcinne pusobí i v prípade, kdy dojde k pruniku syntetických chladících emulzí do olejové náplne. Navíc, polární prísady zlepšují trecí charakteristiku oleje, který tak zajištuje hladší, mnohem presnejší a méne hlucný chod strojního zarízení.', 'ISO VG 46', 'ISO VG 46', 'ISO VG 46', 'ISO VG 46', '1409.0', 20, 'L', 0, 0, 'rimula-r6-lm-20l-web.png', 'shell-tellus-s2-ma-46-20l', '', '', '2016-03-03 14:50:37', 3),
