(218, 15, 4, 1, 'SHELL TELLUS S2 V100', 'Vysoce kvalitní hydraulický olej vyrobený na bázi patentované formulace Shell Tellus New Generation. Vyznačuje se vynikající oxidační, tepelnou a hydrolitickou stabilitou, filtrovatelností, protioděrovými vlastnostmi a mimořádně příznivou viskozitně-teplo', 'Vysoce kvalitní hydraulický olej vyrobený na bázi patentované formulace Shell Tellus New Generation. Vyznačuje se vynikající oxidační, tepelnou a hydrolitickou stabilitou, filtrovatelností, protioděrovými vlastnostmi a mimořádně příznivou viskozitně-teplotní závislostí. Jsou určeny zejména pro použití v hydraulicky ovládaných a kontrolních systémech vystavených celoročně extrémním změnám okolních teplot. Odpovídají požadavkům na hydraulické kapaliny třídy HVLP podle DIN 51524 část 3 a ISO-L-HV dle ISO 6743-4. Jsou doporučovány předními výrobci hydraulických prvků i systémů.', 'ISO VG 100', ' CINCINNATI P-68 (ISO 32)', ' CINCINNATI P-70 (ISO 46)', ' CINCINNATI P-69 (ISO 68)', '14721.0', 209, 'L', 0, 0, 'Sud-Shell-200L.png', 'shell-tellus-s2-v100-209l', '', '', '2016-03-03 14:50:37', 3),
