(237, 3, 4, 1, 'SHELL ADVANCE 2 VSX', 'Shell Advance 2T VSX je částečně syntetický vysoce výkonný motorový olej pro 2-taktní motocyklové motory.', 'Shell Advance VSX 2 je částečně syntetický motorový olej. Tento produkt byl vyvinut pro špičkovou ochranu moderních vysoce zatěžovaných dvoudobých motocyklových motorů. Přídavek speciálních aditiv zajišťuje oleji vyšší výkon oproti klasickým dvoutaktním motorovým olejům.', 'JASO FD', ' API TC', ' ISO-L-EGD.', ' ISO-L-EGD.', '120.0', 1, 'L', 0, 0, 'Adnvace_2_VSX_1L.png', 'shell-advance-2-vsx-1l', '', '', '2016-03-03 14:50:37', 3),
(238, 9, 4, 1, 'SHELL GADUS S2 V220 2', 'Plastické mazivo Shell GADUS S2 V220 2 je víceúčelové vysokotlaké plastické mazivo s EP/AW přísadami.', 'Plastické mazivo Shell GADUS S2 V220 2 je víceúčelové vysokotlaké plastické mazivo, které je formulováno na základě hluboce rafinovaného minerálního oleje a lithného mýdla. Plastické mazivo Shell GADUS S2 V220 2 obsahuje EP/AW aditiva, která tomuto mazivu propůjčují vynikající užitné vlastnosti v řadě automobilních aplikací. Plastické mazivo Shell GADUS S2 V220 2 je doporučeno do ložisek kol, pro mazání podvozků, vodních pump, řídících a převodových jednotek, čepů, ložisek generátorů a dalších aplikací.', '', '', '', '', '2142.0', 18, 'KG', 0, 0, 'Gadus_S2V220_2_18kg.png', 'shell-gadus-s2-v220-2-18kg', 'shell,retinax,hd2,gadus,s2,v220,2,DIN,NLGI,ISO,plastické,mazivo,tuk,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
