(240, 9, 4, 1, 'SHELL GADUS S2 V220 AC 2', 'Plastické mazivo SHELL GADUS S2 V220 AC 2 je vysoce kvalitní víceúčelové plastické mazivo pro mazání zatížených valivých i kluzných ložisek, které jsou vystaveny vlhkosti a působení vody.', 'Plastické mazivo SHELL GADUS S2 V220 AC 2 je vysoce kvalitní víceúčelové plastické mazivo pro mazání zatížených valivých i kluzných ložisek. Plastické mazivo SHELL GADUS S2 V220 AC 2 je formulováno na základovém oleji s vysokou viskozitou a zpevněno lithno-vápenatým mýdlem. Tato formulace zaručuje plastickému mazivu SHELL GADUS S2 V220 AC 2 vysokou odolnost proti působení vlhkosti a vody.  Plastické mazivo SHELL GADUS S2 V220 AC 2 je především vhodné pro ložiska, která pracují v podmínkách rázového zatížení a silných vibrací.', '', '', '', '', '81.0', 12400, '12X400G', 0, 0, 'Gadus_S2V220_AC2_400g.png', 'shell-gadus-s2-v220-ac-2-12x400g', 'shell,retinax,hd2,gadus,s2,v220,2,DIN,NLGI,ISO,plastické,mazivo,tuk,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
