(243, 9, 4, 1, 'SHELL GADUS S2 V220 AD 2', 'Plastické mazivo SHELL GADUS S2 V220 AD 2 je vysoce kvalitní víceúčelové plastické mazivo s přísadou MoS2.', 'Plastické mazivo SHELL GADUS S2 V220 AD 2 je vysoce kvalitní víceúčelové plastické mazivo pro mazání uložení, kde hrozí zadírání. Plastické mazivo SHELL GADUS S2 V220 AD 2 je formulováno na základovém oleji s vysokou viskozitou, zpevněno lithno-vápenatým mýdlem a doplněno pevnou přísadou MoS2. Plastické mazivo SHELL GADUS S2 V220 AD 2 je především vhodné pro extémně zatěžované homokinetické klouby, čepy, podvozky automobilů, kardany a další mazací místa pracují v podmínkách rázového zatížení a silných vibrací.', '', '', '', '', '125.0', 12400, '12X400G', 0, 0, 'Gadus_S2V220_AD2_400g.png', 'shell-gadus-s2-v220-ad-2-12x400g', 'shell,retinax,hdx,gadus,s2,v220,2,ad2,DIN,NLGI,ISO,plastické,mazivo,tuk,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
