(246, 9, 4, 1, 'SHELL GADUS S3 V 220 C2', 'Plastické mazivo SHELL GADUS S3 V 220 C2 je litné-komplexní mazivo, které je určeno pro všechny typy vysoce zatěžovaných uložení.', 'Plastické mazivo SHELL GADUS S3 V220 C 2 je špičkové víceúčelové plastické mazivo, které je vyráběno z minerálního olejového základu s vysokým viskozitním indexem a lithného komplexního mýdla. Plastické mazivo SHELL GADUS S3 V220 C 2 má vynikající vysokotlaké (EP/AW) a vysokoteplotní vlastnosti, přičemž neobsahuje žádné olovnaté sloučeniny. Plastické mazivo SHELL GADUS S3 V220 C 2 je odolné vůči působení vody a vytváří mazací film s vysokou únosností. Díky svému složení je mimořádně mechanicky stabilní a vyznačuje se nízkou odlučivostí oleje. Plastické mazivo SHELL GADUS S3 V220 C 2 je doporučeno zejména pro mazání ložisek kol, vodních čerpadel, alternátorů, kulových kloubů, podvozku.', '', '', '', '', '110.0', 12400, '12X400G', 0, 0, 'Gadus_S3V220_C2_400g.png', 'shell-gadus-s3-v-220-c2-12x400g', 'shell,retinax,hdx,gadus,s3,v220,c2,DIN,NLGI,ISO,plastické,mazivo,tuk,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
(247, 9, 4, 1, 'SHELL GADUS S3 V 220 C2', 'Plastické mazivo SHELL GADUS S3 V 220 C2 je litné-komplexní mazivo, které je určeno pro všechny typy vysoce zatěžovaných uložení.', 'Plastické mazivo SHELL GADUS S3 V220 C 2 je špičkové víceúčelové plastické mazivo, které je vyráběno z minerálního olejového základu s vysokým viskozitním indexem a lithného komplexního mýdla. Plastické mazivo SHELL GADUS S3 V220 C 2 má vynikající vysokotlaké (EP/AW) a vysokoteplotní vlastnosti, přičemž neobsahuje žádné olovnaté sloučeniny. Plastické mazivo SHELL GADUS S3 V220 C 2 je odolné vůči působení vody a vytváří mazací film s vysokou únosností. Díky svému složení je mimořádně mechanicky stabilní a vyznačuje se nízkou odlučivostí oleje. Plastické mazivo SHELL GADUS S3 V220 C 2 je doporučeno zejména pro mazání ložisek kol, vodních čerpadel, alternátorů, kulových kloubů, podvozku.', '', '', '', '', '2610.0', 18, 'KG', 0, 0, 'Gadus_S2V220_2_18kg.png', 'shell-gadus-s3-v-220-c2-18kg', 'shell,retinax,hdx,gadus,s3,v220,c2,DIN,NLGI,ISO,plastické,mazivo,tuk,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
