(249, 9, 4, 1, 'SHELL GADUS S4 V45AC 00/000 (Retinax CSZ)', 'Plastické mazivo SHELL GADUS S4 V45AC 00/000 je litno-vápenaté mazivo určené pro centrální mazací systémy nákladních vozů a užitkové techniky.', 'SHELL  GADUS S4 V45AC 00/000 je vysoce výkonné, polotekuté bezolovnaté plastické mazivo zpevněné litno-vápenatým mýdlem, odolné vůči extrémně vysokým tlakům. SHELL  GADUS S4 V45AC 00/000 je zvláště vyvinuté pro centrální mazací systémy nákladních vozidel a užitkové techniky.', '', '', '', '', '2750.0', 18, 'KG', 0, 0, 'Gadus_S2V220_2_18kg.png', 'shell-gadus-s4-v45ac-00-000-retinax-csz-18kg', 'shell,retinax,csz,gadus,s4,v45,ac,00,000,DIN,NLGI,ISO,plastické,mazivo,tuk,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3);
INSERT INTO `rk_polozka` (`id`, `kategorie_id`, `vyrobce_id`, `dostupnost_id`, `nazev`, `popis_kratky`, `popis_dlouhy`, `specifikace_sae`, `specifikace_api`, `specifikace_acea`, `specifikace_vyrobce`, `cena_bez_dph`, `baleni_pocet`, `baleni_mj`, `page_main`, `page_akce`, `img`, `alias`, `keywords`, `schvaleno_oem`, `_rm_updated_date`, `_rm_updated_by`) VALUES
(250, 14, 4, 1, 'SHELL OMALA S2 G 68', 'SHELL OMALA S2 G 68 je vysoce kvalitní řada minerálních převodových olejů, která je určena pro vysoce zatěžované převodovky průmyslových strojů.', 'Oleje Shell OMALA S2 G 68 patří podle DIN 51 517/III do skupiny mazacích olejů CLP. Shell OMALA S2 G 68 svou formulací normu CLP překračuje. Řada olejů Shell OMALA S2 G 68 obsahují velmi účinné přísady, které zabraňují nadměrnému opotřebení zubů, tzv. mikropittingu. Shell OMALA S2 G 68 dále překračuje požadavky na oleje třídy DIN 51 517/III-CKD podle normy ISO 12925-1. Oleje Shell OMALA S2 G jsou doporučeny pro mazání průmyslových převodových systémů, zejména těch, které vyžadují oleje s EP vlastnostmi. Jsou rovněž vhodné pro mazání valivých a kluzných ložisek a jako mazací oleje pro oběhové systémy strojů a zařízení. ', 'ISO VG 68', ' DIN 51 517 - III CLP', ' ISO 12925-1 CKD', ' AGMA EP 9005-EO2', '1900.0', 20, 'L', 0, 0, 'Shell_Omala.png', 'shell-omala-s2-g-68-20l', 'shell,omala,s2,g,68,g68,DIN,CLP,CKD,NLGI,ISO,plastické,mazivo,tuk,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
