(259, 14, 4, 1, 'SHELL OMALA S2 G 460', 'SHELL OMALA S2 G 460 je vysoce kvalitní řada minerálních převodových olejů, která je určena pro vysoce zatěžované převodovky průmyslových strojů.', 'Oleje Shell OMALA S2 G 460 patří podle DIN 51 517/III do skupiny mazacích olejů CLP. Shell OMALA S2 G 460 svou formulací normu CLP překračuje. Řada olejů Shell OMALA S2 G 460 obsahují velmi účinné přísady, které zabraňují nadměrnému opotřebení zubů, tzv. mikropittingu. Shell OMALA S2 G 460 dále překračuje požadavky na oleje třídy DIN 51 517/III-CKD podle normy ISO 12925-1. Oleje Shell OMALA S2 G 460 jsou doporučeny pro mazání průmyslových převodových systémů, zejména těch, které vyžadují oleje s EP vlastnostmi. Jsou rovněž vhodné pro mazání valivých a kluzných ložisek a jako mazací oleje pro oběhové systémy strojů a zařízení. ', 'ISO VG 460', ' DIN 51 517 - III CLP', ' ISO 12925-1 CKD', ' AGMA EP 9005-EO2', '15157.0', 209, 'L', 0, 0, 'Sud-Shell-200L.png', 'shell-omala-s2-g-460-209l', 'shell,omala,s2,g,320,g320,DIN,CLP,CKD,NLGI,ISO,plastické,mazivo,tuk,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
(260, 14, 4, 1, 'SHELL OMALA S4 GX 150', 'SHELL OMALA S4 GX 150 je vysoce kvalitní plně syntetický PAO převodový olej, který je určen pro vysoce zatěžované převodovky průmyslových strojů.', 'SHELL OMALA S4 GX 150 je průmyslový převodové olej formulováný na plně syntetickém základovým oleji typu PAO a doplněn speciálně vybranými aditivy. Shell OMALA S4 GX 150 poskytuje výrazně lepší mazací vlastnosti než běžné převodové oleje na bázi ropných olejů. Tyto oleje jsou klasifikovány jako maziva třídy CLP dle DIN 51 517 část 3 a jako oleje CKT podle ISO 12925-1. Shell OMALA S4 GX 150 je určena především pro uzavřené převodové systémy (včetně šnekových), které pracují za nepříznivých provozních podmínek (rázové zatížení, vysoká teplota nebo široký rozsah provozních teplot). Shell OMALA S4 GX 150 je zvláště doporučena pro centrální a oběhové mazací systémy, pro mazání valivých a kluzných ložisek a pro mazání vysoce zatížených kluzných ploch a kloubů.', 'ISO VG 150', ' DIN 51517-III CLP', ' ISO 12925-1 TYPE CKD', '  SIEMENS MD', '4100.0', 20, 'L', 0, 0, 'Shell_Omala.png', 'shell-omala-s4-gx-150-20l', 'shell,omala,s4,gX,150,gx150,DIN,CLP,CKT,NLGI,ISO,plastické,mazivo,tuk,mazání,levny,levně,kvalitni,centrální,EP,AW,ložiskový,kluzná,valivá,ložiska.', '', '2016-03-03 14:50:37', 3),
