(304, 3, 3, 1, 'CASTROL Power 1 4T 20W-50 (Act>evo 4T)', 'Kvalitni motorový olej nejnovější generace vyvinutý pro čtyřdobý motory motocyklů - CASTROL Act>evo 4T 20W-50  ', 'Castrol Act>evo 4T 20W-50 je motorový olej nejnovější generace vyvinutý pro čtyřdobý motory motocyklů. Jeho unikátní formulace s APM (Aktivní ochranné molekuly) poskytuje nepřetržitou ochrannou vrstvu a tím dosahuje až o 70 % nižšího opotřebení součástek v porovnání s referenčním olejem specifikace JASO MA-2 při testování dle standardního testu opotřebení ASTM.', 'SAE 20W-50', ' API SJ', ' JASO MA-2', ' JASO MA-2', '155.0', 1, 'L', 0, 0, '', 'castrol-power-1-4t-20w-50-act-evo-4t-1l', 'castrol,sae,20W,50,olej,oil,motor,levny,levne,kvalitni,moto,motocykl,Act>evo,act,', '', '2016-03-03 14:50:37', 3),
(305, 3, 3, 1, 'CASTROL Power 1 Scooter 5W-40 (Act Evo>Scooter 5W-40)', 'Kvalitni syntetický motorový olej pro čtyřdobé motory skútrů s plynulým řazením - CASTROL Act>evo  X-tra Scooter 4T 5W-40', 'Castrol Act>evo Scooter 4T 5W-40 se Scootek Technology a unikátními APM (Aktivní ochranné molekuly) je nejnovější syntetický motorový olej pro čtyřdobé motory skútrů s plynulým řazením. Je navržen tak, aby minimalizoval míru vnitřního tření a poskytoval tak vyšší účinnost motoru a stejně tak i chránil proti tvorbě vysokoteplotních úsad. ', 'SAE 5W-40', ' API SL', ' JASO MB', ' JASO MB', '223.0', 1, 'L', 0, 0, '', 'castrol-power-1-scooter-5w-40-act-evo-scooter-5w-40-1l', 'castrol,sae,5W,40,olej,oil,motor,levny,levne,kvalitni,moto,motocykl,Act>evo,act,', '', '2016-03-03 14:50:37', 3),
(306, 3, 3, 1, 'CASTROL OUTBOARD 2T ', 'Castrol Outboard 2T je vysoce účinné minerální mazivo určené pro dvoudobé motory pro motorové čluny chlazené vodou.', 'Castrol Outboard 2T je vysoce účinné minerální mazivo určené pro dvoudobé motory pro motorové čluny chlazené vodou. Kombinace speciálně vybraných bází společně s nejmodernějšími přídavnými látkami vytváří vysoce kvalitní produkt pro dvoutaktové motory motorových člunů, včetně motorů japonských výrobců, které požadují mazivo specifikace NMMA TC-W 2 nebo NMMA TC-W 3. Mazivo se beze zbytku smísí s palivem. Obsahuje přídavné látky, které byly zvolené pro svůj nízký obsah popelových částic, což zaručuje výjimečnou čistotu a snižuje tendenci tvorby usazenin ve svíčkách.', 'NMMA TC-W3 RL92014E', 'NMMA TC-W3 RL92014E', 'NMMA TC-W3 RL92014E', 'NMMA TC-W3 RL92014E', '144.0', 1, 'L', 0, 0, '', 'castrol-outboard-2t-1l', 'castrol,olej,oil,motor,levny,levne,kvalitni,moto,motocykl,Act>evo,act,', '', '2016-03-03 14:50:37', 3),
(307, 3, 3, 1, 'CASTROL Power 1 Racing 2T ', 'Kvalitni syntetický motorový olej nové generace pro dvoudobé motory - CASTROL Power 1 Racing 2T ', 'Castrol Power1 Racing 2T je syntetický motorový olej nové generace pro dvoudobé motory. Byl speciálně vyvinutý pro vysoce výkonné závodní dvoudobé motory. Je vhodný jak pro motory mazané směsí oleje a benzínu (až do poměru 1:50 – dle doporučení výrobce), tak i pro motory mazané systémem vstřikování oleje (autolube).', 'API TC+', ' JASO FD', ' ISO EGD', ' ISO EGD', '215.0', 1, 'L', 0, 0, '', 'castrol-power-1-racing-2t-1l', 'castrol,olej,oil,motor,levny,levne,kvalitni,moto,motocykl,power 1,racing,2t,', '', '2016-03-03 14:50:37', 3),
(308, 2, 3, 1, 'CASTROL Syntrans Transaxle 75W-90', 'Kvalitni syntetický převodvý olej s vylepšenými vysokotlakými přísadami (EP) v porovnání s konvenčními převodovými oleji GL-4 - CASTROL Syntrans Transaxle 75W-90', 'Syntetický převodvý olej s vylepšenými vysokotlakými přísadami (EP) v porovnání s konvenčními převodovými oleji GL-4. Zároveň zabezpečuje výbornou kompatibilitu se synchrony, je schválen podle normy VW 501.50. Užívá se v manuálních převodovkách a nápravách s normou GL-4.', 'VW 501.50', 'VW 501.50', 'VW 501.50', 'VW 501.50', '266.0', 1, 'L', 0, 0, 'Castrol-Syntrans-Multivehicle-75W-90-1L.png', 'castrol-syntrans-transaxle-75w-90-1l', 'castrol,sae,75w,90,olej,oil,motor,levny,levne,kvalitni,moto,trans,prevod,synt', '', '2016-03-03 14:50:37', 3),
