(328, 2, 3, 1, 'CASTROL LHM Plus', 'Kvalitni minerální kapalina speciálně navržena pro hydraulický systém vozů Citroën se zelenými nádržkami - CASTROL LHM Plus', 'Je speciálně navržen pro použití v posilovacích hydraulických systémech, ve kterých je začleněno čerpadlo pohánějící například posilovač brzd, hydropneumatický systém odpružení nebo posilovač řízení. Castrol LHM Plus je minerální kapalina speciálně navržena pro hydraulický systém vozů Citroën se zelenými nádržkami.', 'VW G 052 529', ' Ford WSS-M2C936-A', ' ISO 7308', ' Citroën a Peugeot PSA B71 2710', '150.0', 1, 'L', 0, 0, 'Castrol-LHM-1L.png', 'castrol-lhm-plus-1l', 'castrol,olej,oil,motor,levny,levne,kvalitni,moto,prevod,synt,lhm,plus,citroen,', '', '2016-03-03 14:50:37', 3),
(329, 5, 3, 1, 'CASTROL VECTON FUEL SAVER E6/E9 5W-30', 'CASTROL VECTON FUEL SAVER E6/E9 5W-30 je syntetický low-saps motorový olej pro motory EURO VI a EURO V. ', 'CASTROL VECTON FUEL SAVER E6/E9 5W-30 je formulován dle nejnovější technologie olejů pro motory EURO VI. Obsahuje unikátní Low-Spas a Low Friction technologii vyvinutou inženýry společnosti Castrol pro zvýšení úspory pohonných hmot Vašeho vozidla. CASTROL VECTON FUEL SAVER E6/E9 5W-30 vám také zajistí, že váš motor zůstane v nejlepší kondici a je plně chráněný po celou dobu, dokonce i po uplynutí maximální lhůty pro výměnu oleje. Jeho hlavní využití je v nejnovějších evropských nákladních automobilech, ale lze ho použít i ve starších nákladních automobilech a autobusech. CASTROL VECTON FUEL SAVER E6/E9 5W-30 je určen pro katalyzátory EGR/SCR/DPF.', 'SAE 5W-30', ' API CJ-4', ' ACEA E6/ E7/E9', ' MAN M 3477/3677', '2620.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-vecton-fuel-saver-e6-e9-5w-30-20l', 'castrol,sae,5w,30,olej,oil,motor,levny,levne,kvalitni,moto,synt,elixion,low,saps', '', '2016-03-03 14:50:37', 3),
