(331, 5, 3, 1, 'CASTROL VECTON FUEL SAVER E7 5W-30', 'CASTROL VECTON FUEL SAVER E7 5W-30 je kvalitni syntetický motorový olej doporučovaný k použití ve většině evropských užitkových vozidel.', 'CASTROL VECTON FUEL SAVER E7 5W-30 je syntetický motorový olej doporučovaný k použití ve většině evropských užitkových vozidel. CASTROL VECTON FUEL SAVER E7 5W-30 umožňuje extrémně dlouhé intervaly výměny olejů, zvyšuje úsporu pohonných hmot a je schválený většinou evropských výrobců užitkových vozidel.', 'SAE 5W-30', ' ACEA E4/E5/E7', ' Cummins CES 20072', ' 20077', '1050.0', 5, 'L', 0, 0, '', 'castrol-vecton-fuel-saver-e7-5w-30-5l', 'castrol,sae,5w,30,olej,oil,motor,levny,levne,kvalitni,moto,synt,enduron plus,', '', '2016-03-03 14:50:37', 3),
