(334, 5, 3, 1, 'CASTROL VECTON LONG DRAIN 10W-40 LS (ENDURON LOW-SAPS 10W-40)', 'CASTROL VECTON LONG DRAIN 10W-40 LS je Low-Saps olej poskytující maximální intervaly výměn a maximální ochranu nejmodernějším evropským vznětovým motorům těžkých užitkových vozidel. CASTROL VECTON LONG DRAIN 10W-40 LS je určen pro motory s filtry DPF/SCR/', 'CASTROL VECTON LONG DRAIN 10W-40 LS je motorový olej pro těžká užitková vozidla vyvinutý tak, aby umožnil majitelům vozových parků provozovat jejich vozidla s maximálními intervaly výměn oleje. Jeho primární použití je v nejnovějších motorech Euro V/EURO IV evropských nákladních automobilů a autobusů, zvláště v těch, které vyžadují olej „Low SAPS“. CASTROL VECTON LONG DRAIN 10W-40 LS lze ho použít také v ostatních nákladních automobilech a autobusech a v terénních vozidlech a zařízeních, která vyžadují tento výkon.', 'SAE 10W-40', ' ACEA E6/E7', ' API CI-4', ' Deutz DQC IV-10LA', '675.0', 5, 'L', 0, 0, '', 'castrol-vecton-long-drain-10w-40-ls-enduron-low-saps-10w-40-5l', 'castrol,sae,10w,40,olej,oil,motor,levny,levne,kvalitni,moto,synt,enduron,low,saps', '', '2016-03-03 14:50:37', 3),
