(337, 5, 3, 1, 'CASTROL Enduron Global 10W-40', 'Olej typu Low SAPS pro nejnovější evropské a americké nízkoemisní motory', 'Castrol Enduron Global 10W-40 je motorový olej pro vznětové motory nákladních automobilů navržený tak, aby splňoval nové globální požadavky na snížení emisí a prodloužení výměnných intervalů. Castrol Enduron Global 10W-40 je olej typu Low SAPS*, který splňuje požadavky nejnovějších specifikací evropských i amerických výrobců motorů.', 'SAE 10W-40', ' ACEA E9', ' API CJ-4', ' CAT ECF-3', '17472.0', 208, 'L', 0, 0, 'Sud-Castrol-200L.png', 'castrol-enduron-global-10w-40-208l', '', '', '2016-03-03 14:50:37', 3),
(338, 5, 3, 1, 'CASTROL VECTON LONG DRAIN 10W-40 (CASTROL ENDURON 10W-40)', 'CASTROL VECTON LONG DRAIN 10W-40 (CASTROL ENDURON 10W-40) maximální výměnné intervaly a ochrana motorů těžkých užitkových vozidel', 'CASTROL VECTON LONG DRAIN 10W-40 (CASTROL ENDURON 10W-40) je motorový olej pro těžká užitková vozidla vyvinutý tak, aby umožnil majitelům vozových parků provozovat jejich vozidla s maximálními intervaly výměn oleje. Primárně se používá do motorů nákladních automobilů a autobusů splňujících emisní limity Euro 3 a Euro 2. Lze ho použít také v terénních vozidlech a zařízeních, která vyžadují tento výkon.', 'SAE 10W-40', ' ACEA E4/E5/E7', ' API CF', ' MAN M 3277', '555.0', 5, 'L', 0, 0, 'Castrol-Enduron-10W-40-5L.png', 'castrol-vecton-long-drain-10w-40-castrol-enduron-10w-40-5l', '', '', '2016-03-03 14:50:37', 3),
