(341, 5, 3, 1, 'CASTROL VECTON 10W-40 (CASTROL TECTION 10W-40)', 'CASTROL VECTON 10W-40 (CASTROL TECTION 10W-40) je univerzální polosyntetický motorový olej pro smíšený vozový park.', 'CASTROL VECTON 10W-40 (CASTROL TECTION 10W-40) je motorový olej určený k poskytování excelentní ochrany vozových parků, které obsahují vozidla různých výrobců. Jeho primární použití je v motorech splňující normy Euro 3 a nižší, v evropských a amerických nákladních automobilech. CASTROL VECTON 10W-40 (CASTROL TECTION 10W-40) je univerzální produkt, který lze používat v nákladních automobilech, autobusech, stavebních strojích, v terénních vozidlech a zařízeních a také v zemědělské technice.', 'SAE 10W-40', ' ACEA E3/E5/E7', ' API CH-4', ' Cummins CES 20076', '1740.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-vecton-10w-40-castrol-tection-10w-40-20l', '', '', '2016-03-03 14:50:37', 3),
