(346, 6, 3, 1, 'CASTROL Syntrans Z Longlife 75W-80', 'Plně syntetický převodový olej pro manuální a automatizované převodovky nákladních vozidel', 'Castrol Syntrans Z Longlife 75W-80 je syntetický převodový olej viskozitní třídy SAE 75W-80, který byl speciálně navržen pro převodovky ZF tak, aby splňoval požadavky na prodloužené výměnné intervaly (500 000 km). Je schválen pro použití ve všech manuálních a automatizovaných manuálních převodovkách ZF nákladních automobilů. Může být použit i tam, kde výrobce požaduje převodový olej specifikace API GL-4 a zejména je vhodný pro aplikace, které pracují za vyšších teplot a zatížení.', 'SAE 75W-80', ' API GL-4', ' MAN 341 Z5', ' MB Approval 235.41', '4600.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-syntrans-z-longlife-75w-80-20l', '', '', '2016-03-03 14:50:37', 3),
