(348, 6, 3, 1, 'CASTROL Transmax Z', 'Kapalina pro automatické i manuální převodovky', 'Castrol Transmax Z je vysoce kvalitní syntetický převodový olej. Je doporučen pro použití v automatických a poloautomatických převodovkách, které jsou používány v autobusech. Stejně tak je Castrol Transmax Z vhodný i do manuálních převodovek. Své uplatnění najde ve vozových parcích, kde se vyskytují různé typy převodovek například Voith, Renk, ZF, Allison a Mercedes-Benz, a vedle toho je vhodný i v jednotkách Leyland Pneumocyclic a Hydracyclic. Nabízí prodloužený interval výměny (120 000 km) v převodovkách ZF Ecomat, MB AT a Voith AT.', 'MAN 339 Typ Z3', ' MAN 339 Typ V2', ' MB-Approval 236.81', ' Voith H55.6335.3x', '4340.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-transmax-z-20l', '', '', '2016-03-03 14:50:37', 3),
