(364, 7, 3, 1, 'CASTROL Agri MP Plus 10W-40', 'Univerzální traktorový olej (STOU)', 'Olej Castrol Agri MP Plus je vysoce výkonný olej určený pro použití do motorů, převodovek, hydraulických systémů a mokrých brzd traktorů i zemědělských strojů.Tento olej zaručuje vysokou výkonnost a ochranu pro motor, převodovku, mokré brzdy, hydraulický systém a přední nápravy.', 'SAE 10W-40', 'ACEA E2', 'API CF-4/SF', 'API GL-4', '1647.0', 20, 'L', 0, 0, 'Desert.jpg', 'castrol-agri-mp-plus-10w-40-20l', '', '', '2016-03-03 14:50:37', 3),
