(366, 7, 3, 1, 'CASTROL Agri Trans Plus 80W', 'Univerzální traktorový převodový olej (UTTO)', 'Castrol Agri Trans Plus je univerzální traktorový převodový olej do převodovek traktorů, hydraulických systémů a mokrých brzd. Nová kombinace aditiv zlepšuje vlastnosti systémů mokrých brzd a zamezuje vibracím. Castrol Agri Trans Plus může být použit tam, kde je požadována specifikace Case MS1209, MAT 3505 a MAT 3525. Tento produkt není určen pro doplňování nebo míchání s originálními kapalinami splňující specifikace', 'SAE 10W-30/80W', ' API GL-4', ' Massey Fergusson CMS M1145', ' JDM J-20C', '1660.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-agri-trans-plus-80w-20l', '', '', '2016-03-03 14:50:37', 3),
(367, 7, 3, 1, 'CASTROL Agri Trans Plus 80W', 'Univerzální traktorový převodový olej (UTTO)', 'Castrol Agri Trans Plus je univerzální traktorový převodový olej do převodovek traktorů, hydraulických systémů a mokrých brzd. Nová kombinace aditiv zlepšuje vlastnosti systémů mokrých brzd a zamezuje vibracím. Castrol Agri Trans Plus může být použit tam, kde je požadována specifikace Case MS1209, MAT 3505 a MAT 3525. Tento produkt není určen pro doplňování nebo míchání s originálními kapalinami splňující specifikace', 'SAE 10W-30/80W', ' API GL-4', ' Massey Fergusson CMS M1145', ' JDM J-20C', '4740.0', 60, 'L', 0, 0, 'Sud-Castrol-60L.png', 'castrol-agri-trans-plus-80w-60l', '', '', '2016-03-03 14:50:37', 3),
(368, 7, 3, 1, 'CASTROL Agri Trans Plus 80W', 'Univerzální traktorový převodový olej (UTTO)', 'Castrol Agri Trans Plus je univerzální traktorový převodový olej do převodovek traktorů, hydraulických systémů a mokrých brzd. Nová kombinace aditiv zlepšuje vlastnosti systémů mokrých brzd a zamezuje vibracím. Castrol Agri Trans Plus může být použit tam, kde je požadována specifikace Case MS1209, MAT 3505 a MAT 3525. Tento produkt není určen pro doplňování nebo míchání s originálními kapalinami splňující specifikace', 'SAE 10W-30/80W', ' API GL-4', ' Massey Fergusson CMS M1145', ' JDM J-20C', '15808.0', 208, 'L', 0, 0, 'Sud-Castrol-200L.png', 'castrol-agri-trans-plus-80w-208l', '', '', '2016-03-03 14:50:37', 3),
(369, 7, 3, 1, 'CASTROL Agri Power Ultra 10W-40', 'Vysoce výkonný motorový olej', 'Maximální výkonnost a ochrana pro zemědělské a silniční vozidla, kterou zajišťuje pokročilá aditivační technologie a vynikající základový olej. Jeho úspora paliva, ve srovnání s minerálními oleji, poskytuje efektivní úsporu paliva a umožňuje prodloužení výměnného intervalu při zajištění vynikající čistoty motoru.', 'SAE 10W-40', ' ACEA A3/B3/B4/E5/E7', ' API CI-4/SL', ' CAT ECF-2', '1890.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-agri-power-ultra-10w-40-20l', '', '', '2016-03-03 14:50:37', 3),
(370, 7, 3, 1, 'CASTROL Agri Power Ultra 10W-40', 'Vysoce výkonný motorový olej', 'Maximální výkonnost a ochrana pro zemědělské a silniční vozidla, kterou zajišťuje pokročilá aditivační technologie a vynikající základový olej. Jeho úspora paliva, ve srovnání s minerálními oleji, poskytuje efektivní úsporu paliva a umožňuje prodloužení výměnného intervalu při zajištění vynikající čistoty motoru.', 'SAE 10W-40', ' ACEA A3/B3/B4/E5/E7', ' API CI-4/SL', ' CAT ECF-2', '16224.0', 208, 'L', 0, 0, 'Sud-Castrol-200L.png', 'castrol-agri-power-ultra-10w-40-208l', '', '', '2016-03-03 14:50:37', 3),
(371, 15, 3, 1, 'CASTROL Hyspin AWS 46', 'Vysoce výkonné hydraulické oleje s protiotěrovou přísadou', 'Castrol Hyspin AWS je řada hydraulických olejů na bázi vysoce rafinovaného minerálního oleje obsahující protiotěrové přísady s nízkým obsahem zinku. Castrol Hyspin AWS jsou speciálně formulovány k tomu, aby poskytovaly vynikající protiotěrové vlastnosti a byly velmi termicky stabilní. Za tímto účelem je použit základový olej s velmi vysokou kvalitou a moderní speciální aditivační technologie s nízkým obsahem zinku.', 'ISO VG 46', ' DIN 51524/ČÁST II-HLP', ' Denison HF-O ', ' Denison HF-O ', '1558.0', 17, 'KG', 0, 0, '', 'castrol-hyspin-aws-46-17kg', '', '', '2016-03-03 14:50:37', 3);
INSERT INTO `rk_polozka` (`id`, `kategorie_id`, `vyrobce_id`, `dostupnost_id`, `nazev`, `popis_kratky`, `popis_dlouhy`, `specifikace_sae`, `specifikace_api`, `specifikace_acea`, `specifikace_vyrobce`, `cena_bez_dph`, `baleni_pocet`, `baleni_mj`, `page_main`, `page_akce`, `img`, `alias`, `keywords`, `schvaleno_oem`, `_rm_updated_date`, `_rm_updated_by`) VALUES
(372, 15, 3, 1, 'CASTROL Hyspin AWS 46', 'Vysoce výkonné hydraulické oleje s protiotěrovou přísadou', 'Castrol Hyspin AWS je řada hydraulických olejů na bázi vysoce rafinovaného minerálního oleje obsahující protiotěrové přísady s nízkým obsahem zinku. Castrol Hyspin AWS jsou speciálně formulovány k tomu, aby poskytovaly vynikající protiotěrové vlastnosti a byly velmi termicky stabilní. Za tímto účelem je použit základový olej s velmi vysokou kvalitou a moderní speciální aditivační technologie s nízkým obsahem zinku.', 'ISO VG 46', ' DIN 51524/ČÁST II-HLP', ' Denison HF-O ', ' Denison HF-O ', '13520.0', 208, 'L', 0, 0, 'Sud-Castrol-200L.png', 'castrol-hyspin-aws-46-208l', '', '', '2016-03-03 14:50:37', 3),
(373, 15, 3, 1, 'CASTROL Hyspin AWH-M 46', 'Vysoce výkonné  hydraulické oleje s vysokým viskozitním indexem', 'Castrol Hyspin AWH-M je řada střihově stabilních hydraulických olejů s vysokým viskozitním indexem. Castrol Hyspin AWH-M obsahují aditivy, které poskytují olejům střihovou stabilitu a zajišťují olejům vysokou viskozitně-teplotní ( VI ) charakteristiku a prodlouženou životnost. U této řady hydraulických olejů je využita stejná aditivační technologie jako u řady hydraulických olejů Castrol Hyspin AWS řady, což v praxi znamená, že se oleje řady Castrol Hyspin AWH-M také vyznačují vynikajícími protikorozními a protiotěrovými vlastnostmi, stejně tak termickou a oxidační stabilitou.', 'ISO VG 46', ' DIN 51524/ČÁST III-HVLP', ' Denison HF-O ', ' Denison HF-O ', '1960.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-hyspin-awh-m-46-20l', '', '', '2016-03-03 14:50:37', 3),
(374, 15, 3, 1, 'CASTROL Hyspin AWH-M 46', 'Vysoce výkonné  hydraulické oleje s vysokým viskozitním indexem', 'Castrol Hyspin AWH-M je řada střihově stabilních hydraulických olejů s vysokým viskozitním indexem. Castrol Hyspin AWH-M obsahují aditivy, které poskytují olejům střihovou stabilitu a zajišťují olejům vysokou viskozitně-teplotní ( VI ) charakteristiku a prodlouženou životnost. U této řady hydraulických olejů je využita stejná aditivační technologie jako u řady hydraulických olejů Castrol Hyspin AWS řady, což v praxi znamená, že se oleje řady Castrol Hyspin AWH-M také vyznačují vynikajícími protikorozními a protiotěrovými vlastnostmi, stejně tak termickou a oxidační stabilitou.', 'ISO VG 46', ' DIN 51524/ČÁST III-HVLP', ' Denison HF-O ', ' Denison HF-O ', '13800.0', 208, 'L', 0, 0, 'Sud-Castrol-200L.png', 'castrol-hyspin-awh-m-46-208l', '', '', '2016-03-03 14:50:37', 3),
(375, 15, 3, 1, 'CASTROL Hyspin HVI 46', 'Vysoce výkonné hydraulické oleje s ochranou proti opotřebení a vysokým viskozitním indexem bez obsahu zinku', 'Hyspin® HVI jsou hydraulické oleje s vysokým viskozitním indexem s pečlivě zvoleným bezpopelným aditivačním systémem bez obsahu zinku odpovídající nejvyšším výkonnostním požadavkům. Hyspin® HVI jsou oleje určené pro vysoce namáhané hydraulické systémy s požadavkem na vysokou ochranu proti opotřebení a jemnou filtraci. Navíc vykazují hydraulické oleje Hyspin® HVI excelentní ochranu proti korozi a mimořádnou termickou a oxidační stabilitu. Oleje Hyspin® HVI mají výbornou hydrolytickou stabilitu a rychle odlučují vodu.', 'ISO VG 32', ' DIN 51524/část III-HVLP', ' Cincinnati Lamb (Milacron) P 68-69-70', ' Denison (Parker Hannafin) HF-0', '2100.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-hyspin-hvi-46-20l', '', '', '2016-03-03 14:50:37', 3),
(376, 15, 3, 1, 'CASTROL Hyspin HVI 46', 'Vysoce výkonné hydraulické oleje s ochranou proti opotřebení a vysokým viskozitním indexem bez obsahu zinku', 'Hyspin® HVI jsou hydraulické oleje s vysokým viskozitním indexem s pečlivě zvoleným bezpopelným aditivačním systémem bez obsahu zinku odpovídající nejvyšším výkonnostním požadavkům. Hyspin® HVI jsou oleje určené pro vysoce namáhané hydraulické systémy s požadavkem na vysokou ochranu proti opotřebení a jemnou filtraci. Navíc vykazují hydraulické oleje Hyspin® HVI excelentní ochranu proti korozi a mimořádnou termickou a oxidační stabilitu. Oleje Hyspin® HVI mají výbornou hydrolytickou stabilitu a rychle odlučují vodu.', 'ISO VG 32', ' DIN 51524/část III-HVLP', ' Cincinnati Lamb (Milacron) P 68-69-70', ' Denison (Parker Hannafin) HF-0', '14400.0', 208, 'L', 0, 0, 'Sud-Castrol-200L.png', 'castrol-hyspin-hvi-46-208l', '', '', '2016-03-03 14:50:37', 3),
(377, 15, 3, 1, 'CASTROL Carelube SE S 46', 'Vysoce výkonné ekologicky odbouratelné hydraulické kapaliny na syntetické esterové bázi', 'Castrol Carelube® SES je řada hydraulických kapalin na bázi nasycených syntetických esterů a syntetických uhlovodíků. Produkty Castrol Carelube® SES jsou snadno biologicky odbouratelné a díky vybraným aditivům mají dobrou oxidační stabilitu, protikorozní schopnosti a ochranu proti opotřebení a jsou také kompatibilní s materiály pro skladovací zařízení obsahujícími olovo. Formulace na bázi syntetického esteru dává kapalinám Castrol Carelube® SES mimořádně vysoký viskozitní index a neobyčejně nízký bod tuhnutí.', 'ISO VG 46', ' HEES kapaliny dle VDMA 24568/24569', ' HEES kapaliny dle VDMA 24568/24569', ' HEES kapaliny dle VDMA 24568/24569', '3060.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-carelube-se-s-46-20l', '', '', '2016-03-03 14:50:37', 3),
(378, 15, 3, 1, 'CASTROL Carelube SE S 46', 'Vysoce výkonné ekologicky odbouratelné hydraulické kapaliny na syntetické esterové bázi', 'Castrol Carelube® SES je řada hydraulických kapalin na bázi nasycených syntetických esterů a syntetických uhlovodíků. Produkty Castrol Carelube® SES jsou snadno biologicky odbouratelné a díky vybraným aditivům mají dobrou oxidační stabilitu, protikorozní schopnosti a ochranu proti opotřebení a jsou také kompatibilní s materiály pro skladovací zařízení obsahujícími olovo. Formulace na bázi syntetického esteru dává kapalinám Castrol Carelube® SES mimořádně vysoký viskozitní index a neobyčejně nízký bod tuhnutí.', 'ISO VG 46', ' HEES kapaliny dle VDMA 24568/24569', ' HEES kapaliny dle VDMA 24568/24569', ' HEES kapaliny dle VDMA 24568/24569', '29328.0', 208, 'L', 0, 0, 'Sud-Castrol-200L.png', 'castrol-carelube-se-s-46-208l', '', '', '2016-03-03 14:50:37', 3),
(379, 9, 3, 1, 'CASTROL LMX (High Temperature Grease)', 'Vysoce výkonné víceúčelové plastické mazivo na bázi mýdla Li-komplex', 'Castrol LMX je vysoce kvalitní plastické mazivo špičkové třídy vhodné pro univerzální použití. Castrol LMX obsahuje účinné látky, které zvyšují jeho schopnost odolávat tlakovému zatížení, stárnutí a zabezpečují antikorozní ochranu. Castrol LMX zaručuje bezpečné a dlouhodobé mazání i při extrémně náročných provozních podmínkách. Castrol LMX může být použit pro mazání strojů a agregátů, a to i při vysokém teplotním a mechanickém zatížení a při dlouhých intervalech výměn. Mazivo je určeno pro mazání valivých a kluzných ložisek pracujících při teplotách od -30 do +150°C.', 'MB-Approval 265.1', ' MAN 284 Li-H2', ' NLGI 2', ' NLGI 2', '138.0', 400, 'G', 0, 0, '', 'castrol-lmx-high-temperature-grease-400g', '', '', '2016-03-03 14:50:37', 3),
(380, 9, 3, 1, 'CASTROL LM', 'Vysoce výkonné plastické mazivo s dlouhodobým účinkem', 'Plastické mazivo Castrol LM je vytvořeno na základě špičkového lithiumvápenatého mýdla. Obsahuje další účinné látky, které zvyšují jeho schopnost odolávat tlakovému zatížení, stárnutí a zabezpečují antikorozní ochranu. Castrol LM zaručuje bezpečné a dlouhodobé mazání i při extrémně náročných provozních podmínkách. Castrol LM nepodléhá změnám při hnětení, je teplotně stálý a odolný vůči vodě. Castrol LM má vláčnou, hladkou strukturu. Castrol LM může být použit všude tam, kde se uplatňují i konvenční lithiová, sodíková a vápenatá plastická maziva. ', 'MB-Approval 267', ' NLGI 2', ' MAN 283 Li-P 2', ' MAN 283 Li-P 2', '111.0', 400, 'G', 0, 0, '', 'castrol-lm-400g', '', '', '2016-03-03 14:50:37', 3),
(381, 1, 3, 1, 'CASTROL MAGNATEC 5W-30 C2', 'CASTROL MAGNATEC 5W-30 C2 je kvalitni syntetický motorový olej s technologií inteligentních molekul zajišťující silnější mazací film. ', 'CASTROL MAGNATEC 5W-30 C2 je kvalitni syntetický motorový olej s technologií inteligentních molekul zajišťující silnější mazací film. CASTROL MAGNATEC 5W-30 C2 je moderní motorový olej se sníženým obsahem sulfátových olejů, fosforu a síry. CASTROL MAGNATEC 5W-30 C2 je speciálně vyvinut pro vozy koncernu PEUGEOT a CITROEN.', 'SAE 5W-30', ' ACEA C2', ' FIAT 9.55535-S1', ' PSA  B71 2290', '178.0', 1, 'L', 0, 0, '', 'castrol-magnatec-5w-30-c2-1l', '', '', '2016-03-03 14:50:37', 3),
(382, 1, 3, 1, 'CASTROL MAGNATEC 5W-30 C2', 'CASTROL MAGNATEC 5W-30 C2 je kvalitni syntetický motorový olej s technologií inteligentních molekul zajišťující silnější mazací film. ', 'CASTROL MAGNATEC 5W-30 C2 je kvalitni syntetický motorový olej s technologií inteligentních molekul zajišťující silnější mazací film. CASTROL MAGNATEC 5W-30 C2 je moderní motorový olej se sníženým obsahem sulfátových olejů, fosforu a síry. CASTROL MAGNATEC 5W-30 C2 je speciálně vyvinut pro vozy koncernu PEUGEOT a CITROEN.', 'SAE 5W-30', ' ACEA C2', ' FIAT 9.55535-S1', ' PSA  B71 2290', '688.0', 4, 'L', 0, 0, '', 'castrol-magnatec-5w-30-c2-4l', '', '', '2016-03-03 14:50:37', 3),
(383, 6, 3, 1, 'CASTROL Syntrans AT 75W-90', 'Plně syntetický převodový olej pro manuální převodovky zvláště Mercedes Benz ACTROS.', 'Plně syntetický převodový olej pro manuální převodovky zvláště Mercedes Benz ACTROS. Olej má dobré synchronizační vlastnosti, tzn. pohodlné a snadné řazení zejména u převodovek MB ACTROS. Castrol Syntrans AT 75W-90 má dále také velmi dobré nízkoteplotní vlastnosti – hladší řazení při nízkých teplotách, zvýšení výkonu díky sníženým třecím ztrátám, zvýšená ochrana proti opotřebení i při nízkých teplotách.', 'SAE 75W-90', ' API GL-4', ' MB 235.11', ' MB 235.11', '5500.0', 20, 'L', 0, 0, 'Enduron-WEB.png', 'castrol-syntrans-at-75w-90-20l', '', '', '2016-03-03 14:50:37', 3),
(384, 1, 3, 1, 'CASTROL MAGNATEC 5W-30 C2', 'CASTROL MAGNATEC 5W-30 C2 je kvalitni syntetický motorový olej s technologií inteligentních molekul zajišťující silnější mazací film. ', 'CASTROL MAGNATEC 5W-30 C2 je kvalitni syntetický motorový olej s technologií inteligentních molekul zajišťující silnější mazací film. CASTROL MAGNATEC 5W-30 C2 je moderní motorový olej se sníženým obsahem sulfátových olejů, fosforu a síry. CASTROL MAGNATEC 5W-30 C2 je speciálně vyvinut pro vozy koncernu PEUGEOT a CITROEN.', 'SAE 5W-30', ' ACEA C2', ' FIAT 9.55535-S1', ' PSA  B71 2290', '9306.0', 60, 'L', 0, 0, '', 'castrol-magnatec-5w-30-c2-60l', '', '', '2016-03-03 14:50:37', 3),
(385, 1, 6, 1, 'MOGUL 5W-30 EXTREME LF III', 'Motorový olej pro benzínové i naftové motory koncernu VW, včetně přeplňovaných a s prodlouženým intervalem výměny oleje.', 'Je určen k mazání moderních benzinových a naftových motorů (včetně přeplňovaných, s přímým vstřikováním) osobních automobilů a lehkých užitkových vozidel s nejvyššími požadavky na výkonnost oleje, provozovaných celoročně. Je speciálně vhodný k univerzálnímu použití pro benzínové i naftové motory koncernu VW, včetně přeplňovaných a s prodlouženým intervalem výměny oleje, kromě motorů R5-, V10 TDI, kde je předepsán olej VW 506.01. Vel-mi efektivní je jeho aplikace v motorech, pracujících při velmi nízkých teplotách a tam, kde se žádá významná úspora paliva. Je vhodný rovněž pro motory, používající jako paliva LPG a pro motory s katalyzátorem výfukových plynů, včetně filtrů pevných částic. ', 'SAE 5W-30', ' VW 504.00/507.00', ' ACEA C3', ' API SM/CF', '200.0', 1, 'L', 0, 0, '', 'mogul-5w-30-extreme-lf-iii-1l', '', '', '2016-03-03 14:50:37', 3),
