(393, 1, 6, 1, 'MOGUL 5W-40 EXTREME ', 'Plně syntetický motorový olej pro osobní a lehká užitková vozidla.', 'Je určen k mazání moderních benzinových a naftových (i přeplňovaných) motorů osobních automobilů a lehkých užitkových vozidel s nejvyššími požadavky na výkonnost oleje provozovaných celoročně. Je zvláště doporučován pro motory sportovních a soutěžních vozidel a jeho použití je vhodné vždy při sportovním stylu jízdy. Velmi efektivní je jeho aplikace v motorech pracujících při extrémně nízkých teplotách a tam, kde se žádá úspora paliva. Je vhodný rovněž pro motory používající jako paliva LPG a pro motory s katalyzátorem výfukových plynů. ', 'SAE 5W-40', ' API SM/CF/EC', ' MB 229.3', ' ACEA A3', '166.0', 1, 'L', 0, 0, '', 'mogul-5w-40-extreme-1l', '', '', '2016-03-03 14:50:37', 3),
