(405, 1, 6, 1, 'MOGUL 10W-40 EXTREME', 'Polosyntetický motorový olej pro osobní a lehká užitková vozidla.', 'Je určen zejména k mazání moderních benzinových a naftových motorů (i přeplňovaných) osobních automobilů a lehkých užitkových vozidel s nejvyššími požadavky na výkonnost oleje, provozovaných celoročně. Velmi efektivní je jeho aplikace v motorech pracujících za nízkých teplot, usnadňuje studené starty. Je vhodný pro široký sortiment motorů, rovněž pro motory používající jako paliva LPG a pro motory s katalyzátorem výfukových plynů. Používá se s úspěchem i pro čtyřdobé motory moderních motocyklů. ', 'SAE 10W-40', ' API SL/CF', ' ACEA A3/B4', ' VW 501.01/505.00', '111.0', 1, 'L', 0, 0, '', 'mogul-10w-40-extreme-1l', '', '', '2016-03-03 14:50:37', 3),
