(413, 5, 6, 1, 'MOGUL OPTIMAL 10W-40', 'Vysoce výkonný polosyntetický motorový olej SHPD pro smíšený vozový park.', '"Je určen k celoročnímu mazání moderních, vysoce namáhaných benzinových a naftových (i přeplňovaných) motorů nákladních i osobních automobilů, vyžadujících olej této výkonnostní třídy. Umožňuje splnění přísných emisních limitů, je vhodný pro motory s katalyzátory výfukových plynů a je zárukou dosažení mimořádně dlouhých výměnných lhůt. Velmi efektivní je jeho aplikace v motorech, pracujících za velmi nízkých teplot a tam, kde se žádá úspora paliva. Je to univerzální olej vhodný zejména pro vozový park složený z vozidel různého určení, vybavených různými typy motorů (tzv. ""mixed fleet"" - smíšený vozový park)."', 'SAE 10W-40', ' API CI-4', ' MB 228.3', ' VOLVO VDS-3', '87.0', 1, 'L', 0, 0, '', 'mogul-optimal-10w-40-1l', '', '', '2016-03-03 14:50:37', 3),
