(418, 5, 6, 1, 'MOGUL DIESEL DTT PLUS 10W-40', 'Vysoce výkonný motorový olej UHPD pro užitkovou techniku. Je určen pro motory EURO III/EURO IV/EURO V bez filtru pevných části DPF.', 'Je určen zejména k celoročnímu mazání extrémně namáhaných naftových motorů nákladních automobilů, autobusů, lokomotiv, lodí, mobilních těžkých strojů ve stavebnictví, lesnictví, zemědělství, aj. Umožňuje splnění přísných emisních limitů a je zárukou dosažení extrémně dlouhých výměnných lhůt. ', 'SAE 10W-40', ' ACEA E4/E7', ' API CI-4', ' Renault RXD/RLD-2', '785.0', 10, 'L', 0, 0, '', 'mogul-diesel-dtt-plus-10w-40-10l', '', '', '2016-03-03 14:50:37', 3),
