(421, 5, 6, 1, 'MOGUL DIESEL L-SAPS 10W-40 M', 'Vysoce výkonný motorový olej low-saps pro užitkovou techniku. Je určen pro motory EURO IV/EURO V s i bez filtru pevných části DPF.', 'Je určen zejména k celoročnímu mazání extrémně namáhaných naftových motorů nákladních automobilů a autobusů, které vyžadují tzv. Low SAPS oleje (nízký obsah sulfátového popele, fosforu a síry). Je velmi vhodný též pro motory vybavené zařízením pro úpravu výfukových plynu EGR a filtrem pevných částic. Umožňuje splnění přísných emisních limitů EURO IV, EURO V a je zárukou dosažení dlouhých výměnných lhůt a úspory paliva.  ', 'SAE 10W-40', ' ACEA E6/E7/E4', ' MB-Approval 228.51', ' MAN M 3477/M3277 (CRT)', '733.0', 10, 'L', 0, 0, '', 'mogul-diesel-l-saps-10w-40-m-10l', '', '', '2016-03-03 14:50:37', 3),
