(430, 5, 6, 1, 'MOGUL DIESEL ULTRA 5W-30', 'Vysoce výkonný motorový olej SUHPD pro užitkovou techniku. Je určen pro motory EURO IV/EURO V bez filtru pevných části DPF.', 'Je určen zejména k celoročnímu mazání extrémně namáhaných naftových motorů nákladních automobilů, autobusů, mobilních těžkých strojů ve stavebnictví, lesnictví, zemědělství, aj. Velmi efektivní je jeho aplikace v motorech, pracujících při extrémně nízkých teplotách a tam, kde se žádá úspora paliva. Umožňuje splnění přísných emisních limitů a je zárukou dosažení extrémně dlouhých výměnných lhůt (až 100 000 km podle typu vozidla a typu údržby). Účinně zabraňuje oleštění válců Bore-polishing.', 'SAE 5W-30', ' API CI-4', ' ACEA E4/E7', ' VOLVO VDS-3', '1170.0', 10, 'L', 0, 0, '', 'mogul-diesel-ultra-5w-30-10l', '', '', '2016-03-03 14:50:37', 3),
