(433, 5, 6, 1, 'MOGUL DIESEL DTT EXTRA 15W-40', 'Vysoce výkonný motorový olej SHPD především pro užitkovou techniku. Olej je především určen pro dieselové motory pracující v extrémním zatížení. Olej je určen pro motory EURO V/EURO IV bez filtru pevných částic.', 'Je určen zejména k celoročnímu mazání vysoce namáhaných naftových motorů nákladních automobilů, autobusů, lokomotiv, lodí, mobilních těžkých strojů ve stavebnictví, lesnictví, zemědělství, aj. Zvláště vhodný je k mazání motorů, pracujících ve výjimečně náročných režimech (obtížné terény apod.). Umožňuje splnění přísných emisních limitů a je zárukou dosažení velmi dlouhých výměnných lhůt.', 'SAE 15W-40', ' API CI-4/SL', ' ACEA E7/E5', ' Cummins CES 20076/7/8', '262.0', 4, 'L', 0, 0, '', 'mogul-diesel-dtt-extra-15w-40-4l', '', '', '2016-03-03 14:50:37', 3),
