(499, 6, 6, 1, 'MOGUL TRANS 80W-90', 'Vícestupňový převodový olej určen k mazání širokého spektra mechanických převodů (rozvodovek a převodovek s ručním či jiným řazením) moderních osobních, dodávkových a nákladních automobilů, stavebních strojů, zemědělské a jiné techniky.', 'Je určen k mazání širokého spektra mechanických převodů (rozvodovek a převodovek s ručním či jiným řazením) moderních osobních, dodávkových a nákladních automobilů, stavebních strojů, zemědělské a jiné techniky. Je vhodný pro celoroční používání, výhodná je jeho aplikace za nízkých teplot, ale i za teplot běžných nebo zvýšených, kdy je zárukou spolehlivé funkce převodovek. Použití v průmyslových aplikacích (např. namáhané průmyslové převodovky, pracující za nízkých teplot) je možné. ', 'SAE 80W-90', ' API GL-4', ' ZF TE-ML 02A a 08A', ' MIL-L-2105', '92.0', 1, 'L', 0, 0, '', 'mogul-trans-80w-90-1l', '', '', '2016-03-03 14:50:37', 3),
