(503, 6, 6, 1, 'MOGUL TRANS 80W-90 PLUS', 'Převodový olej pro univerzální použití u manuálních synchronizovaných i nesynchronizovaných převodovek s ručním či jiným řazením, pro vysoce zatížené rozvodovky včetně hypoidních převodů náprav zejména dodávkových a nákladních automobilů, autobusů a jiné ', 'Převodový olej pro univerzální použití u manuálních synchronizovaných i nesynchronizovaných převodovek s ručním či jiným řazením, pro vysoce zatížené rozvodovky včetně hypoidních převodů náprav zejména dodávkových a nákladních automobilů, autobusů a jiné mobilní techniky s požadavkem na prodloužené intervaly výměny oleje. Je vhodný pro celoroční používání, výhodnáje jeho aplikace za nízkých teplot – dobrá tekutost za nízkých teplot a stabilní viskozita při běžných a zvýšených teplotách. ', 'SAE 80W-90', ' API GL-4/GL-5/MT-1', ' MAN 3343M', ' ZF TE-ML 02B', '940.0', 10, 'L', 0, 0, '', 'mogul-trans-80w-90-plus-10l', '', '', '2016-03-03 14:50:37', 3),
