(506, 6, 6, 1, 'MOGUL TRANS 85W-140', 'Je určen k mazání širokého spektra mechanických převodů (rozvodovek a převodovek s ručním či jiným řazením) moderních osobních, dodávkových a nákladních automobilů, stavebních strojů, zemědělské a jiné techniky. ', 'Je určen k mazání širokého spektra mechanických převodů (rozvodovek a převodovek s ručním či jiným řazením) moderních osobních, dodávkových a nákladních automobilů, stavebních strojů, zemědělské a jiné techniky. Je vhodný pro celoroční používání, výhodná je možnost jeho aplikace ve velmi širokém rozsahu provozních teplot, kdy je zárukou spolehlivé funkce převodovek. Použití v průmyslových aplikacích (např. namáhané průmyslové převodovky, pracující za vysokých teplot) je možné. ', 'SAE 85W-140', ' API GL-4', ' MIL-L-2105', ' MIL-L-2105', '669.0', 10, 'L', 0, 0, '', 'mogul-trans-85w-140-10l', '', '', '2016-03-03 14:50:37', 3),
