(509, 6, 6, 1, 'MOGUL TRANS 80H', 'Převodový olej, který je určen k mazání extrémně zatížených převodových ústrojí moderních automobilů a ostatní mobilní techniky, je vhodný pro vybrané typy převodů (zejména hypoidní, šnekové apod.)', 'Je určen k mazání extrémně zatížených převodových ústrojí moderních automobilů a ostatní mobilní techniky, je vhodný pro vybrané typy převodů (zejména hypoidní, šnekové apod.) a pro mimořádně těžké provozní podmínky. Je celoročně použitelný, výhodná je jeho aplikace za nízkých teplot, kdy je zárukou spolehlivé funkce převodovek. Používá se i v průmyslových aplikacích (např. extrémně namáhané průmyslové převodovky, zejména pracují-li za nízkých teplot). ', 'SAE 80W', ' API GL-5', ' VOLVO', ' TATRA TDS 80/32', '853.0', 10, 'L', 0, 0, '', 'mogul-trans-80h-10l', '', '', '2016-03-03 14:50:37', 3),
