(512, 6, 6, 1, 'MOGUL TRANS 90H', 'Je určen k mazání extrémně zatížených převodových ústrojí moderních automobilů a ostatní mobilní techniky, je vhodný pro vybrané typy převodů (zejména hypoidní, šnekové apod.) a pro mimořádně těžké provozní podmínky. ', 'Je určen k mazání extrémně zatížených převodových ústrojí moderních automobilů a ostatní mobilní techniky, je vhodný pro vybrané typy převodů (zejména hypoidní, šnekové apod.) a pro mimořádně těžké provozní podmínky. Je celoročně použitelný, výhodná je jeho aplikace za zvýšených teplot, kdy je zárukou spolehlivé funkce převodovek. Používá se i v průmyslových aplikacích (např. extrémně namáhané průmyslové převodovky, pracující za normálních, event. zvýšených teplot). ', 'SAE 90', ' API GL-5', ' VOLVO', ' MAN 342 typ M-1', '103.0', 1, 'L', 0, 0, 'Mogul-TRANS-90H-1L.png', 'mogul-trans-90h-1l', '', '', '2016-03-03 14:50:37', 3),
