(525, 6, 6, 1, 'MOGUL TRANS ATF DIII', 'Speciální převodový olej červené barvy, který je určen pro automatické převodovky (ATF) osobních a nákladních automobilů, autobusů a řady dalších mobilních strojů (stavební, lesní aj.), vyžadujících olej této specifikace.', 'Jako pracovní kapalina v automatických převodovkách (ATF) osobních a nákladních automobilů, autobusů a řady dalších mobilních strojů (stavební, lesní aj.), vyžadujících olej této specifikace. Je vhodný i pro některé další aplikace - používá se např. jako hydraulická kapalina posilovačů řízení, některých hydrostatických mechanismů ve stavebnictví, zemědělství apod., kde je použití kapaliny tohoto typu doporučeno. Výjimečně se používá i v některých aplikacích průmyslových - jako speciální hydraulický olej. ', 'GM DEXRON III G', ' Allison C-4', ' Ford Mercon', ' CATERPILLAR TO-2', '125.0', 1, 'L', 0, 0, '', 'mogul-trans-atf-diii-1l', '', '', '2016-03-03 14:50:37', 3),
