(532, 5, 6, 1, 'MOGUL M7ADSIII 15W-40', 'MOGUL M7ADSIII 15W-40/TRYSK SUPER 15W-40 je celoroční vícerozsahový motorový olej je určený pro vysoce přeplňované vznětové motory s vysokým tepelným zatížením a vysokými teplotami pístní skupiny. ', 'Motorový olej MOGUL M7ADSIII 15W-40/TRYSK SUPER 15W-40 je celoroční vícerozsahový olej určený pro vysoce přeplňované vznětové motory s vysokým tepelným zatížením a vysokými teplotami pístní skupiny. MOGUL M7ADSIII 15W-40/TRYSK SUPER 15W-40 vhodný i pro mazání moderních zážehových a vznětových motorů osobních a lehkých nákladních vozidel a splňuje výkonové a viskozitní požadavky výrobců spalovacích motorů. MOGUL M7ADSIII 15W-40/TRYSK SUPER 15W-40 je vhodný i pro motory vybavené katalyzátorem spalování výfukových plynů. Jeho nízkoteplotní vlastnosti umožňují jeho celoroční použití s výjimkou velmi nízkých teplot (pod -20 °C). ', 'SAE 15W-40', ' API SG/CF-4', ' MB 227.1', ' MB 227.1', '73.0', 1, 'L', 0, 0, '', 'mogul-m7adsiii-15w-40-1l', '', '', '2016-03-03 14:50:37', 3),
