(540, 7, 6, 1, 'MOGUL TRAKTOL STOU 10W-30', 'Univerzální traktorový olej STOU 10W-30.', 'Olej Mogul Traktol STOU 10W-30 je vysoce výkonný olej určený pro použití do motorů, převodovek, hydraulických systémů a mokrých brzd traktorů i zemědělských strojů. Mogul Traktol STOU 10W-30 poskytuje vynikající mazací vlastnosti ve vznětových přeplňovaných i nepřeplňovaných motorech zemědělských a stavebních strojů i ve všech ostatních výše uváděných oblastech použití. Viskozitní třída SAE 10W-30 zajišťuje vynikající mazací vlastnosti při studených startech a zároveň také dokonalou ochranu proti otěru při vysokých provozních teplotách. Olej Mogul Traktol STOU 10W-30 je špičkové mazivo, které umožňuje nejdelší intervaly výměny oleje. Olej Mogul Traktol STOU 10W-30 snižuje náklady díky redukci počtu skladovaných produktů, snižováním opotřebení a díky redukci rizika záměn.', 'SAE 10W-30', ' ACEA E2', ' API CF-4/SF', ' API GL-4', '4140.0', 50, 'KG', 0, 0, '', 'mogul-traktol-stou-10w-30-50kg', '', '', '2016-03-03 14:50:37', 3),
