(542, 7, 6, 1, 'MOGUL TRAKTOL UTTO 10W-30', 'Univerzální traktorový olej UTTO 10W-30.', 'MOGUL TRAKTOL UTTO 10W-30j e určen k celoročnímu mazání přenosových jednotek moderních, vysoce výkonných traktorů, vyžadujících speciální oleje, případně dalších zemědělských, lesnických, stavebních event. jiných strojů. Je vhodný jako jednotný mazací olej sloužící současně k mazání mecha-nických převodů (řazených ručně i pod zatížením – „power shift“), hydrostatických soustav a tzv. „mokrých“ brzd.', 'SAE 10W-30', ' 80W', ' API GL-4', ' ZETOR', '3657.0', 50, 'KG', 0, 0, '', 'mogul-traktol-utto-10w-30-50kg', '', '', '2016-03-03 14:50:37', 3),
