(552, 1, 2, 1, 'LUKOIL GENESIS SPECIAL C2 5W-30 (OMV BIXXOL SPECIAL C2 5W-30)', 'LUKOIL GENESIS SPECIAL C2 5W-30 (OMV BIXXOL SPECIAL C2 5W-30) je syntetický motorový olej pro vysokovýkonné motory s nízkým obsahem popela, speciálně vyvinutý pro nejmodernější benzinové a dieselové motory vozů PEUGEOT, CITROËN, HONDA a TOYOTA s filtry čá', 'LUKOIL GENESIS SPECIAL C2 5W-30 (OMV BIXXOL SPECIAL C2 5W-30) je syntetický motorový olej pro vysokovýkonné motory s nízkým obsahem popela, speciálně vyvinutý pro nejmodernější benzinové a dieselové motory vozů PEUGEOT, CITROËN, HONDA a TOYOTA s filtry částic. Nejnovější technologie midSAPS chrání životní prostředí i filtr částic na základě nízkého obsahu síranového popela, fosforu a síry. Vhodné rovněž pro motory s předpisem ACEA A5/B5.', 'SAE 5W-30', ' ACEA C2', ' API SN/CF', ' FIAT 9.55535-S1', '150.0', 114, '1L X 14KS', 0, 0, 'OMV-BiXXOL-special-C2-1L.png', 'lukoil-genesis-special-c2-5w-30-omv-bixxol-special-c2-5w-30-1l-x-14ks', 'OMV, bixxol,special,C2,sae,5W,30,olej,oil,motor,levny,levne,kvalitni,synt, peugeot,citroen, mid,saps,midsaps', '', '2016-03-03 14:50:37', 3),
