(566, 5, 2, 1, 'LUKOIL AVANTGARDE ULTRA PLUS 10W-40 (OMV ECO-TRUCK EXTRA 10W-40)', 'LUKOIL AVANTGARDE ULTRA PLUS 10W-40 (OMV ECO-TRUCK EXTRA 10W-40) je lehkoběžný motorový olej SHPD (Super High Performance Diesel) na syntetické bázi pro smíšený vozový park. ', 'LUKOIL AVANTGARDE ULTRA PLUS 10W-40 (OMV ECO-TRUCK EXTRA 10W-40) je lehkoběžný motorový olej SHPD (Super High Performance Diesel) na syntetické bázi pro smíšený vozový park. Mimořádný důraz kladený na nízké emise motorů užitkových vozidel činí tento olej ideálním pro vozidla s prodlouženými výměnnými intervaly. Je vhodný i pro osobní vozidla s benzinovými a dieselovými motory.', 'SAE 10W-40', ' ACEA A3/B4/ E3/E5/E7', ' API CI-4/SL', ' CATERPILLAR ECF-2', '1624.0', 20, 'L', 0, 0, '', 'lukoil-avantgarde-ultra-plus-10w-40-omv-eco-truck-extra-10w-40-20l', '', '', '2016-03-03 14:50:37', 3),
