(569, 5, 2, 1, 'LUKOIL AVANTGARDE PROFESIONAL 5W-30 LS (OMV TRUCK BLUE ET 5W-30)', 'OMV super truck SAE 5W-30 je syntetický motorový olej SUHPD (Super Ultra High Performance Diesel motoroil) nejnovější generace.', 'OMV super truck SAE 5W-30 je syntetický motorový olej SUHPD (Super Ultra High Performance Dieselmotoroil) nejnovější generace. Tento progresivní špičkový produkt byl vyroben na základě požadavků zákazníků speciálně pro moderní dieselové motory (také SCR) s nízkými emisemi a maximálními výměnnými intervaly oleje. Vyniká výraznými lehkoběžnými vlastnostmi a redukuje spotřebu nafty ve vysokovýkonných dieselových motorech užitkových vozidel až o 4 %. Vysoké požadavky kladené na chování oleje při nízkých a vysokých teplotách zaručují dlouhodobé používání i v extrémních klimatických pásmech a mnoha zeměpisných šířkách.', 'SAE 5W-30', ' ACEA E4/E7', ' API CI-4', ' CUMMINS CES 20076', '5985.0', 57, 'L', 0, 0, '', 'lukoil-avantgarde-profesional-5w-30-ls-omv-truck-blue-et-5w-30-57l', '', '', '2016-03-03 14:50:37', 3),
(570, 5, 2, 1, 'LUKOIL AVANTGARDE PROFESIONAL 5W-30 LS (OMV TRUCK BLUE ET 5W-30)', 'OMV super truck SAE 5W-30 je syntetický motorový olej SUHPD (Super Ultra High Performance Diesel motoroil) nejnovější generace.', 'OMV super truck SAE 5W-30 je syntetický motorový olej SUHPD (Super Ultra High Performance Dieselmotoroil) nejnovější generace. Tento progresivní špičkový produkt byl vyroben na základě požadavků zákazníků speciálně pro moderní dieselové motory (také SCR) s nízkými emisemi a maximálními výměnnými intervaly oleje. Vyniká výraznými lehkoběžnými vlastnostmi a redukuje spotřebu nafty ve vysokovýkonných dieselových motorech užitkových vozidel až o 4 %. Vysoké požadavky kladené na chování oleje při nízkých a vysokých teplotách zaručují dlouhodobé používání i v extrémních klimatických pásmech a mnoha zeměpisných šířkách.', 'SAE 5W-30', ' ACEA E4/E7', ' API CI-4', ' CUMMINS CES 20076', '18245.0', 205, 'L', 0, 0, '', 'lukoil-avantgarde-profesional-5w-30-ls-omv-truck-blue-et-5w-30-205l', '', '', '2016-03-03 14:50:37', 3),
(571, 5, 2, 1, 'LUKOIL AVANTGARDE PROFESIONAL 10W-40 (OMV SUPER TRUCK 10W-40)', 'OMV super truck SAE 10W-40 je syntetický motorový olej UHPD (Ultra-High-Performance Diesel motor oil) pro univerzální použití.', 'OMV super truck SAE 10W-40 je syntetický motorový olej UHPD (Ultra-High-Performance Diesel motor oil) pro univerzální použití. Umožňuje extrémně dlouhé intervaly výměny oleje a nízkou spotřebu oleje, má vynikající lehkoběžné vlastnosti, jeho použitím je možno dosáhnout velmi hospodárné spotřeby nafty a má vynikající vlastnosti při tzv. studeném startu i v případě velmi nízkých venkovních teplot.', 'SAE 10W-40', ' ACEA E4/E7', ' API CI-4', ' CUMMINS CES 20077/78', '3694.0', 57, 'L', 0, 0, '', 'lukoil-avantgarde-profesional-10w-40-omv-super-truck-10w-40-57l', '', '', '2016-03-03 14:50:37', 3),
