(573, 5, 2, 1, 'LUKOIL AVANTGARDE PROFESIONAL 10W-40 LS (OMV TRUCK BLUE ET 10W-40)', 'LUKOIL AVANTGARDE PROFESIONAL 10W-40 LS (OMV SUPER TRUCK 10W-40) jsou progresivní motorové oleje pro užitková vozidla s extrémně nízkým obsahem popela umožňující splnění velmi přísných budoucích emisních limitů. ', 'LUKOIL AVANTGARDE PROFESIONAL 10W-40 LS (OMV SUPER TRUCK 10W-40) jsou progresivní motorové oleje pro užitková vozidla s extrémně nízkým obsahem popela umožňující splnění velmi přísných budoucích emisních limitů. Inovativní syntetická formulace těchto olejů byla vyvinuta speciálně pro užitková vozidla se systémem SCR a filtry částic splňující limity EURO 4 a EURO 5.', 'SAE 10W-40', ' ACEA E4/E6/E7', ' ACEA E9 pro SAE 10W-40', ' API CI-4', '1976.0', 20, 'L', 0, 0, '', 'lukoil-avantgarde-profesional-10w-40-ls-omv-truck-blue-et-10w-40-20l', '', '', '2016-03-03 14:50:37', 3),
