(576, 5, 2, 1, 'LUKOIL AVANTGARDE ULTRA 15W-40 (OMV TRUCK LD 15W-40)', 'LUKOIL AVANTGARDE ULTRA 15W-40 (OMV TRUCK LD 15W-40) jsou motorové oleje SHPD (Super High Performance Diesel) určené zejména pro dieselové motory užitkových vozidel. ', 'LUKOIL AVANTGARDE ULTRA 15W-40 (OMV TRUCK LD 15W-40) jsou motorové oleje SHPD (Super High Performance Diesel) určené zejména pro dieselové motory užitkových vozidel.  Jsou vhodné rovněž pro všechny stavební a zemědělské stroje, pokud jejich specifikace odpovídá předpisům výrobců. Vysoká kvalita zaručuje maximální spolehlivost při prodloužených výměnných intervalech v dálkové nákladní dopravě, autobusech a také v osobních vozidlech.', 'SAE 15W-40', ' ACEA E3/E5/E7/ B3/B4/A3', ' ALLISON C4', ' API CI-4/SJ', '1480.0', 20, 'L', 0, 0, '', 'lukoil-avantgarde-ultra-15w-40-omv-truck-ld-15w-40-20l', '', '', '2016-03-03 14:50:37', 3),
