(579, 2, 2, 1, 'LUKOIL TRANSMISSION UNI S 75W-90 (OMV UNIGEAR S 75W-90)', 'LUKOIL TRANSMISSION UNI S 75W-90 (OMV UNIGEAR S 75W-90) jsou syntetické převodové oleje TDL pro univerzální použití. ', 'LUKOIL TRANSMISSION UNI S 75W-90 se jako univerzální převodový olej skvěle hodí pro mnoho synchronizovaných a nesynchronizovaných mechanických převodovek, hypoidní a planetové převody zadních náprav atd. za všech provozních podmínek. Na základě excelentních vlastností za nízkých teplot a nepatrné závislosti viskozity na teplotě snižuje odpory při řazení a spotřebu paliva. Na základě dobré snášenlivosti s materiály může být používán v převodovkách s předepsanou specifikací API GL-1 až GL-5. Možnost, použít OMV unigear S SAE 75W-90 současně v mechanických převodovkách a rozvodovkách, nabízí velice efektivní skladování a snižuje nebezpečí záměny.', 'SAE 75W-90', ' API GL-4/GL-5', ' API MT-1', ' MAN 3343 Typ S', '7695.0', 57, 'L', 0, 0, '', 'lukoil-transmission-uni-s-75w-90-omv-unigear-s-75w-90-57l', '', '', '2016-03-03 14:50:37', 3),
