(584, 2, 2, 1, 'LUKOIL TRANSMISSION UNI S 75W-140 (OMV UNIGEAR 75W-140)', 'LUKOIL TRANSMISSION UNI S 75W-140 (OMV UNIGEAR 75W-140) jsou syntetické převodové oleje TDL pro použití v extrémně namáhaných rozvodkovkách a diferenciálech. ', 'LUKOIL TRANSMISSION UNI S 75W-140 (OMV UNIGEAR 75W-140) se jako univerzální převodový olej skvěle hodí pro hypoidní převody zadních náprav, planetové převody atd. za všech provozních podmínek. Na základě dobré snášenlivosti s materiály může být OMV unigear nasazen v převodovkách s předepsanou třídou API GL-5, MT-1. LUKOIL TRANSMISSION UNI S 75W-140 je určen především pro vysoce zatěžované rozvodovky a diferenciály.', 'SAE 75W-140', ' API GL-5', ' API MT-1', ' EATON', '8835.0', 57, 'L', 0, 0, '', 'lukoil-transmission-uni-s-75w-140-omv-unigear-75w-140-57l', '', '', '2016-03-03 14:50:37', 3),
