(586, 1, 9, 1, 'MOBIL 1 ESP FORMULA 5W-30', 'Plně syntetický motorový olej nejnovější generace, který je určen pro nejnovější motory s prodlouženým výměnným intervalem.', 'Motorový olej Mobil 1 ESP Formula 5W-30 je moderní syntetický olej poskytující motoru ochranu proti opotřebení s vynikající čisticí schopností a zlepšením výkonu. Prodlužuje životnost a snižuje emise vznětových a zážehových motorů. Převyšuje náročné požadavky automobilových výrobců, kladené na ochranu při větší úspoře paliva. Potlačuje zanášení katalyzátorů zážehových motorů, snižuje tvorbu úsad, čímž zvyšuje životnost motorů. Motorový olej Mobil 1 ESP Formula 5W-30 je určen zvláště pro vysoce výkonné zážehové a vznětové motory nejnovějších osobních automobilů.', 'SAE 5W-30', ' API SM/CF', ' ACEA A3/B3/B4/C2/C3', ' BMW LL01/04', '224.0', 1, 'L', 0, 0, '', 'mobil-1-esp-formula-5w-30-1l', '', '', '2016-03-03 14:50:37', 3),
