(595, 1, 9, 1, 'MOBIL 1 NEW LIFE 0W-40  ', 'Syntetický motorový olej pro všechny typy moderních automobilů, především pro vysoce výkoná auta a přeplňované motory.Mobil 1 New Life 0W-40 je odborně zdokonalený o jedinečnou kombinaci vysoce výkonných přísad včetně systému SuperSyn na snížení opotřeben', 'Syntetický motorový olej pro všechny typy moderních automobilů, především pro vysoce výkoná auta a přeplňované motory.Mobil 1 New Life 0W-40 je odborně zdokonalený o jedinečnou kombinaci vysoce výkonných přísad včetně systému SuperSyn na snížení opotřebení. Umožňuje rychlejší ochranu při startování motoru, snížení tvorby úsad, snížení spotřeby paliva a vynikající ochranu motoru při vysokých a nízkých teplotách.Některí výrobci nejvýkonnejších vozidel, např. Mercedes Benz AMG, Porsche.', 'SAE 0W-40', ' API SM/SL/SJ/CF/EC', ' ACEA A3/B3/B4', ' VW 502.00/VW 505.00 VW 503.01', '247.0', 1, 'L', 0, 0, '', 'mobil-1-new-life-0w-40-1l', '', '', '2016-03-03 14:50:37', 3),
