(602, 1, 9, 1, 'MOBIL 1 FUEL ECONOMY FORMULA 0W-30', 'Plně syntetický motorový olej nejvyšší kvality, který poskytuje motoru  čisticí schopnost, ochranu proti opotřebení a zároveň zlepšuje využití paliva.', 'Plně syntetický motorový olej nejvyšší kvality, který poskytuje motoru  čisticí schopnost, ochranu proti opotřebení a zároveň zlepšuje využití paliva. Mobil 1 0W-30, Enhanced Fuel Economy Formula překračuje požadavky nejnovějších oborových norem pro náplně moderních zážehových i vznětových automobilových motorů.', 'SAE 0W-30', ' API SJ/CF/SL EC', ' ACEA A1/A5/B1/B5', ' ILSAC GF-3', '31616.0', 208, 'L', 0, 0, '', 'mobil-1-fuel-economy-formula-0w-30-208l', '', '', '2016-03-03 14:50:37', 3),
(603, 1, 9, 1, 'MOBIL 1 PEAK LIFE 5W-50', 'Motorový olej Mobil 1 Peak Life (Rally Formula) 5W-50 představuje syntetický motorový olej nejvyšší výkonnostní třídy, poskytující motorům maximální ochranu proti opotřebení.', 'Motorový olej Mobil 1 Peak Life (Rally Formula) 5W-50 představuje syntetický motorový olej nejvyšší výkonnostní třídy, poskytující motorům maximální ochranu proti opotřebení. Překračuje nároky výrobců zážehových a vznětových s technologií vícebodového vstřikování. Je vhodný pro vysoké rychlosti nejen v provozu, ale i při závodech. Vysoká viskozita oleje spojená s protioděrovou technologií Superdyn brání tvorbě úsad, snižuje emise a nabízí mimořádnou mazací schopnost a ochranu při každém způsobu provozu.', 'SAE 5W-50', ' API SJ/CF/SL', ' ACEA A3/B3/B4', ' VW 505.00', '235.0', 1, 'L', 0, 0, '', 'mobil-1-peak-life-5w-50-1l', '', '', '2016-03-03 14:50:37', 3),
