(605, 1, 9, 1, 'MOBIL SUPER 3000 FORMULA V 5W-30', 'Mobil Super 3000 Formula V 5W-30 je plně syntetický, motorový olej nejvyšší kvality. ', 'Mobil Super 3000 Formula V 5W-30 je plně syntetický, motorový olej nejvyšší kvality. Jedná se o moderní, vysoce výkonný nízkopopelnatý produkt, který je vytvořen pro to, aby byl schopen efektivně mazat systémy redukující emise v benzínových i naftových motorech a aby prodloužil životnost těchto systémů – filtrů pevných částic a katalytických konvertorů.', 'SAE 5W-30', ' ACEA C2/C3', ' A3/B3/B4 ', ' VW 504.00/507.00', '171.0', 1, 'L', 1, 1, 'Super_3000_FormulaV_5W-30_1L.png', 'mobil-super-3000-formula-v-5w-30-1l', '', '', '2016-03-03 14:50:37', 3);
