(608, 1, 9, 1, 'MOBIL SUPER 3000 FORMULA LD 0W-30', 'Mobil Super 3000 Formula LD 0W-30 je vysoce výkonný plně syntetický olej pro zážehové a lehké vznětové motory navržený tak, aby splňoval náročné požadavky skupiny VW-Audi na prodloužení intervalů výměn a významně přispíval k úsporám paliva a k čistotě mot', 'Mobil Super 3000 Formula LD 0W-30 je vysoce výkonný plně syntetický olej pro zážehové a lehké vznětové motory navržený tak, aby splňoval náročné požadavky skupiny VW-Audi na prodloužení intervalů výměn a významně přispíval k úsporám paliva a k čistotě motoru.', 'SAE 0W-30', ' VW 503.00 /506.00/506.01', ' VW 503.00 /506.00/506.01', ' VW 503.00 /506.00/506.01', '225.0', 1, 'L', 0, 0, '', 'mobil-super-3000-formula-ld-0w-30-1l', '', '', '2016-03-03 14:50:37', 3),
(609, 1, 9, 1, 'MOBIL SUPER 3000 XE 5W-30', 'Mobil Super 3000 XE 5W-30 je moderní vysoce výkonný syntetický olej s nízkým obsahem popela.', 'Mobil Super 3000 XE 5W-30 je moderní vysoce výkonný syntetický olej s nízkým obsahem popela. Je navržen tak, aby motoru poskytoval vynikající čistící schopnosti, ochranu proti opotřebení, zlepšoval jeho výkon a především prodlužoval životnost a účinnost systémů pro snížení emisí jak u zážehových tak i vznětových motorů.', 'SAE 5W-30', ' API SJ/CF ACEA A3/B3', ' VW 505.01', ' Ford M2C917-A', '173.0', 1, 'L', 0, 0, '', 'mobil-super-3000-xe-5w-30-1l', '', '', '2016-03-03 14:50:37', 3),
