(614, 1, 9, 1, 'MOBIL SUPER 3000 X1 5W-40', 'Motorový olej Mobil Super 3000 X1 5W-40  je vyroben z vysoce kvalitních syntetických základových složek v kombinaci s komplexem aditiv, díky kterým splňuje nejnovější požadavky většiny předních výrobců automobilů.', 'Motorový olej Mobil Super 3000 X1 5W-40  je vyroben z vysoce kvalitních syntetických základových složek v kombinaci s komplexem aditiv, díky kterým splňuje nejnovější požadavky většiny předních výrobců automobilů. Mimořádná ochrana proti opotřebení, aktivní čisticí schopnosti, nízká spotřeba oleje, dobré vlastnosti při nízkých i vysokých teplotách a prodloužené intervaly výměny - to jsou vlastnosti, které olej Mobil Super 3000 X1 5W-40 řadí mezi přední syntetické motorové oleje na trhu. ', 'SAE 5W-40', ' API SJ/CF/SL/EC', ' ACEA A3/B3/B4', ' VW 502.00/505.00', '156.0', 1, 'L', 0, 0, '', 'mobil-super-3000-x1-5w-40-1l', '', '', '2016-03-03 14:50:37', 3),
