(619, 1, 9, 1, 'MOBIL SUPER 2000 X1 10W-40', 'Motorový olej Mobil Super 2000 X1 10W-40 je moderní polosyntetický olej, který je vyvinut k zajištění špičkové ochrany a výkonu motoru.', 'Motorový olej Mobil Super 2000 X1 10W-40 je koncipován tak, aby poskytoval motorům spolehlivou ochranu. Olej Mobil Super 2000 je doporučen pro motory, které jsou příležitostně vystavovány náročným jízdním podmínkám. Motorový olej Mobil Super 2000 X1 10W-40 je určen pro osobní (benzín/diesel) a dodávkové vozy.', 'SAE 10W-40', ' API SJ/CF/SL', ' ACEA A2/B2/A3/B3', ' VW 505.00', '114.0', 1, 'L', 0, 0, '', 'mobil-super-2000-x1-10w-40-1l', '', '', '2016-03-03 14:50:37', 3),
