(623, 1, 9, 1, 'MOBIL SUPER 2000 X1 10W-40', 'Motorový olej Mobil Super 2000 X1 10W-40 je moderní polosyntetický olej, který je vyvinut k zajištění špičkové ochrany a výkonu motoru.', 'Motorový olej Mobil Super 2000 X1 10W-40 je koncipován tak, aby poskytoval motorům spolehlivou ochranu. Olej Mobil Super 2000 je doporučen pro motory, které jsou příležitostně vystavovány náročným jízdním podmínkám. Motorový olej Mobil Super 2000 X1 10W-40 je určen pro osobní (benzín/diesel) a dodávkové vozy.', 'SAE 10W-40', ' API SJ/CF/SL', ' ACEA A2/B2/A3/B3', ' VW 505.00', '14144.0', 208, 'L', 0, 0, '', 'mobil-super-2000-x1-10w-40-208l', '', '', '2016-03-03 14:50:37', 3),
(624, 1, 9, 1, 'MOBIL SUPER 3000 FE FORMULA 5W-30', 'Motorový olej MOBIL SUPER 3000 FE 5W-30 je nový plně syntetický olej, který je vyroben podle nejnovějších technologií a je určen především pro vozy značky Ford požadující normu A1/B1. ', 'Motorový olej MOBIL SUPER 3000 FE 5W-30 je nový plně syntetický olej, který je vyroben podle nejnovějších technologií a je určen především pro vozy značky Ford požadující normu A1/B1. Zajišťuje vynikající ochranu motoru a jeho vysoce čistící schopnosti, zajistí kvalitní mazání bez vzniku usazenin po celou dobu životnosti. Motorový olej MOBIL SUPER 3000 FE 5W-30 je vhodný pro městský provoz a časté startování za studena. Motorový olej MOBIL SUPER 3000 FE 5W-30 nahrazuje produkt MOBIL SUPER FE 5W-30. Splňuje specifikace: API SL/SJ CF, ACEA A5/B5 a normy výrobce: Ford WSS M2C 913-A/913-B', 'SAE 5W-30', ' API SL', ' ACEA A1/B1', ' Ford WSS M2C 913-A/913-B/913-C', '141.0', 1, 'L', 0, 0, '', 'mobil-super-3000-fe-formula-5w-30-1l', '', '', '2016-03-03 14:50:37', 3),
