(628, 1, 9, 1, 'MOBIL SUPER M 15W-40', 'Mobil Super M 15W/40 je motorový olej vysoké kvality odpovídající náročným požadavkům moderních benzinových i vznětových motorů osobních vozidel. ', 'Mobil Super M 15W/40 je motorový olej vysoké kvality odpovídající náročným požadavkům moderních benzinových i vznětových motorů osobních vozidel. Obsahuje přísady na zlepšení viskozního indexu, který zabezpečuje stálost viskozity. Další antikorozní a protioděrové přísady zaručují vynikající mazání motoru i za nejnáročnějších podmínek provozu. Prodlužuje životnost motoru a snižuje spotřebu paliva i provozních nákladů. Splňuje specifikace: MB - Approval 229.1, VW 505.00 ', 'SAE 15W-40', ' API SJ/CF/SL', ' ACEA A2/B2/A3/B3', ' VW 505.00', '108.0', 1, 'L', 0, 0, '', 'mobil-super-m-15w-40-1l', '', '', '2016-03-03 14:50:37', 3),
