(632, 5, 9, 1, 'MOBIL DELVAC 1 5W-40', 'Mobil Delvac 1 5W-40 je syntetický vysoce výkonný olej pro vznětové motory, který zajišťuje nepřekonatelné mazání a lepší úspornost paliva.', 'Mobil Delvac 1 5W-40 je syntetický vysoce výkonný olej pro vznětové motory, který zajišťuje nepřekonatelné mazání a lepší úspornost paliva, delší interval výměny oleje a delší životnost moderních vznětových motorů pracujících v náročných podmínkách. Nejmodernější technologie, která se za tímto produktem skrývá, zajišťuje výjimečný výkon u moderních vysoce výkonných nízkoemisních motorů. Mobil Delvac 1 5W-40 se doporučuje k použití v mnoha oblastech těžkého provozu jako je nákladní doprava, důlní průmysl, stavebnictví a zemědělství.', 'SAE 5W-40', ' API CI-4 PLUS/CI-4/CH-4/SL/SJ', ' ACEA E7/E4', ' Cummins CES 20078/20077/20076/20075', '735.0', 4, 'L', 0, 0, '', 'mobil-delvac-1-5w-40-4l', '', '', '2016-03-03 14:50:37', 3),
