(636, 5, 9, 1, 'MOBIL DELVAC 1 LE 5W-30', 'Mobil Delvac 1 LE 5W-30 je plně syntetický vysoce výkonný olej pro vznětové motory, který pomáhá prodlužovat životnost motoru a systému snižování emisí spolu s možností prodloužení servisního intervalu a úspory paliva u moderních vznětových motorů.', 'Mobil Delvac 1 LE 5W-30 je plně syntetický vysoce výkonný olej pro vznětové motory, který pomáhá prodlužovat životnost motoru a systému snižování emisí spolu s možností prodloužení servisního intervalu a úspory paliva u moderních vznětových motorů, včetně těch, které jsou vybaveny filtrem pevných částic (DPF). Mobil Delvac 1 LE 5W-30 využívá technologii „state-of-the-art“ pro dosažení vynikajícího výkonu v moderních nízkoemisních motorů. Mobil Delvac 1 LE 5W-30 je doporučen pro použití v širokém rozsahu vysoce zatížených aplikací a provozních podmínek, které se vyskytují při nákladní přepravě, těžbě, stavebnictví či zemědělství. ', 'ACEA E7/E6/E4', ' RVI RXD', ' RLD', ' RLD-2', '3120.0', 20, 'L', 0, 0, '', 'mobil-delvac-1-le-5w-30-20l', '', '', '2016-03-03 14:50:37', 3),
