(638, 5, 9, 1, 'MOBIL DELVAC XHP LE 10W-40', 'Mobil Delvac XHP LE 10W-40 je vysoce výkonný olej určený pro mazání moderních nízkoemisních vznětových motorů, používaných u vozidel pro náročný silniční provoz. ', 'Mobil Delvac XHP LE 10W-40 je vysoce výkonný olej určený pro mazání moderních nízkoemisních vznětových motorů, používaných u vozidel pro náročný silniční provoz. Byl vyvinut tak, aby napomáhal prodloužit životnost a udržovat účinnost systémů omezujících emise u automobilů poháněných vznětovými motory, jako jsou částicové filtry DPF (Diesel Particulate Filter). Tento systém (DPF) je používán některými výrobci nákladních automobilů pro dodržení požadavků na omezení emisí podle současné normy Euro IV a normy Euro V.', 'ACEA E7/E6/E4', ' API CI-4', ' JASO DH-2', ' DAF Extended Drain', '518.0', 4, 'L', 0, 0, '', 'mobil-delvac-xhp-le-10w-40-4l', '', '', '2016-03-03 14:50:37', 3),
