(642, 5, 9, 1, 'MOBIL DELVAC XHP EXTRA 10W-40', 'Mobil Delvac XHP Extra 10W-40 je syntetický vysoce výkonný naftový motorový olej, vyvinut aby poskytoval vynikající mazání moderních, vysoce výkonných motorů. ', 'Mobil Delvac XHP Extra 10W-40 je syntetický vysoce výkonný naftový motorový olej, vyvinut aby poskytoval vynikající mazání moderních, vysoce výkonných motorů. Tento motorový olej je sklouben použitím vysoce výkonných základových olejů, které zaručují vynikající tekutost při nízkých teplotách, vysokou teplotní stabilizaci, kontrolou a zlepšení spotřeby paliva. Vlastnosti těchto základových olejů se zvyšují použitím pokročilých aditiv, která poskytují vysokou úroveň ochrany všech částí motoru. Mobil Delvac XHP Extra 10W-40 je navržen tak, aby dodržel dlouhé intervaly výměny oleje v moderních dieselových motorech.', 'ACEA E7/E4', ' MAN 3277', ' MB 228.5', ' MB 235.27', '480.0', 4, 'L', 0, 0, '', 'mobil-delvac-xhp-extra-10w-40-4l', '', '', '2016-03-03 14:50:37', 3),
