(646, 5, 9, 1, 'MOBIL DELVAC MX EXTRA 10W-40', 'Mobil Delvac MX Extra 10W-40 je polosyntetický motorový olej, který zajišťuje vynikající mazání dnešních vznětových a zážehových motorů působících v náročných aplikacích. ', 'Mobil Delvac MX Extra 10W-40 je polosyntetický motorový olej, který zajišťuje vynikající mazání dnešních vznětových a zážehových motorů působících v náročných aplikacích. Mobil Delvac MX Extra 10W-40 byl vyvinut za účelem udržet motory čisté a podpořit jejich dlouhou životnost. V důsledku toho je tento výrobek ExxonMobil doporučován pro evropské, japonské a americké motory. Mobil Delvac MX Extra 10W-40 je navržen se směsí vyspělých aditiv, které poskytují již pevný základ tohoto produktu za účelem zvýšit odolnost vůči oxidaci, tvorbou sazí a opotřebení, doplněný výbornou ochranou pístních kroužků se sníženou tvorbou kalů, která přispívá k dlouhé životnosti motoru. ', 'API CI-4/CH-4/CG-4/CF/SL/SJ', ' ACEA E7/E5/E3/B4/B3/A2', ' Cummins CES DDC 7SE270', ' Mack EO-M PLUS', '1755.0', 20, 'L', 0, 0, '', 'mobil-delvac-mx-extra-10w-40-20l', '', '', '2016-03-03 14:50:37', 3),
