(649, 5, 9, 1, 'MOBIL DELVAC MX 15W-40', 'Mobil Delvac MX 15W-40 je vysoce výkonný olej pro vznětové motory, který zajišťuje vynikající mazání moderním motorům pracujícím v náročných aplikacích, a který podporuje jejich delší životnost.', 'Mobil Delvac MX 15W-40 je vysoce výkonný olej pro vznětové motory, který zajišťuje vynikající mazání moderním motorům pracujícím v náročných aplikacích, a který podporuje jejich delší životnost. Díky tomu tento produkt splňuje nebo převyšuje technické podmínky kladené prakticky všemi významnými evropskými a americkými výrobci motorů. Velmi vysoký výkon tohoto produktu byl v praxi prokázán v široké škále průmyslových odvětví.', 'API CI-4/CG-4/CF-4/CF/SL/SJ', ' ACEA E7/E5/E3/B4/B3/A2', ' LISON C-4', ' CAT ECF-1', '398.0', 4, 'L', 0, 0, '', 'mobil-delvac-mx-15w-40-4l', '', '', '2016-03-03 14:50:37', 3),
