(653, 2, 9, 1, 'MOBIL ATF 320', 'MOBIL ATF 320 je vysoce výkonná kapalina pro automatické převodovky pro vetšinu osobních automobilů a komerčních automatických převodovek. ', 'MOBIL ATF 320 je vysoce výkonná kapalina pro automatické převodovky převyšující nejnovější revidované specifikace Ford Mercon a General Motors Dexron III.Je doporučen pro vetšinu osobních automobilů a komerčních automatických převodovek. Dále je vhodný pro posilovače řízení, hydraulické aplikace a některé manuální převodovky, kde je předepsána kapalina pro automatické převodovky.Odpovídající třecí vlastnosti umožňující klidné převodové operace v širokém rozsahu pracovních podmínek. Ochrana proti degradaci při vysokých pracovních teplotách a prodloužený servisní interval. Čerpatelnost, tekutost a oběh i za nízkých teplot zajištující dobrou výkonnost při studených startech. Kompatibilita se všemi konvenčními těsnícími materiály používanými v převodových jednotkách.', 'Mercon M931220', ' ZF TE-ML 04D/17C', ' Dexron III', ' Allison C-4', '144.0', 1, 'L', 0, 0, '', 'mobil-atf-320-1l', 'mobil,atf,320,motor,levny,levne,kvalitni,gm dexron', '', '2016-03-03 14:50:37', 3),
(654, 2, 9, 1, 'MOBIL ATF 320', 'MOBIL ATF 320 je vysoce výkonná kapalina pro automatické převodovky pro vetšinu osobních automobilů a komerčních automatických převodovek. ', 'MOBIL ATF 320 je vysoce výkonná kapalina pro automatické převodovky převyšující nejnovější revidované specifikace Ford Mercon a General Motors Dexron III.Je doporučen pro vetšinu osobních automobilů a komerčních automatických převodovek. Dále je vhodný pro posilovače řízení, hydraulické aplikace a některé manuální převodovky, kde je předepsána kapalina pro automatické převodovky.Odpovídající třecí vlastnosti umožňující klidné převodové operace v širokém rozsahu pracovních podmínek. Ochrana proti degradaci při vysokých pracovních teplotách a prodloužený servisní interval. Čerpatelnost, tekutost a oběh i za nízkých teplot zajištující dobrou výkonnost při studených startech. Kompatibilita se všemi konvenčními těsnícími materiály používanými v převodových jednotkách.', 'Mercon M931220', ' ZF TE-ML 04D/17C', ' Dexron III', ' Allison C-4', '2300.0', 20, 'L', 0, 0, '', 'mobil-atf-320-20l', 'mobil,atf,320,motor,levny,levne,kvalitni,gm dexron', '', '2016-03-03 14:50:37', 3),
(655, 2, 9, 1, 'MOBIL ATF 220', 'MOBIL ATF 220 je vysoce kvalitní kapalina do automatických převodovek starších vozidel podle specifikace Dexron II D. ', 'MOBIL ATF 220 je vysoce kvalitní kapalina do automatických převodovek starších vozidel podle specifikace Dexron II D. V určitých aplikacích se používá jako hydraulický olej. Je doporučen pro většinu osobních automobilů a komerčních automatických převodovek. Dále je vhodný pro posilovače řízení, hydraulické aplikace a některé manuální převodovky, kde je předepsána kapalina pro automatické převodovky. Je vyroben z vysoce kvalitních základových olejů a speciální kombinace aditiv zlepšující viskozitní index. Kromě toho obsahuje také antioxidanty a protipěnící přísady a modifikátory tření, které zlepšují třecí charakteristiky a poskytují převodovce dobrou ochranu proti opotřebení.', 'GM Dexron II D', ' Caterpillar TO-2', ' Voith', ' Allison C-4', '128.0', 1, 'L', 0, 0, '', 'mobil-atf-220-1l', 'mobil,atf,220,motor,levny,levne,kvalitni,gm dexron', '', '2016-03-03 14:50:37', 3),
(656, 2, 9, 1, 'MOBIL ATF 220', 'MOBIL ATF 220 je vysoce kvalitní kapalina do automatických převodovek starších vozidel podle specifikace Dexron II D. ', 'MOBIL ATF 220 je vysoce kvalitní kapalina do automatických převodovek starších vozidel podle specifikace Dexron II D. V určitých aplikacích se používá jako hydraulický olej. Je doporučen pro většinu osobních automobilů a komerčních automatických převodovek. Dále je vhodný pro posilovače řízení, hydraulické aplikace a některé manuální převodovky, kde je předepsána kapalina pro automatické převodovky. Je vyroben z vysoce kvalitních základových olejů a speciální kombinace aditiv zlepšující viskozitní index. Kromě toho obsahuje také antioxidanty a protipěnící přísady a modifikátory tření, které zlepšují třecí charakteristiky a poskytují převodovce dobrou ochranu proti opotřebení.', 'GM Dexron II D', ' Caterpillar TO-2', ' Voith', ' Allison C-4', '475.0', 4, 'L', 0, 0, '', 'mobil-atf-220-4l', 'mobil,atf,220,motor,levny,levne,kvalitni,gm dexron', '', '2016-03-03 14:50:37', 3),
