INSERT INTO `rk_polozka` (`id`, `kategorie_id`, `vyrobce_id`, `dostupnost_id`, `nazev`, `popis_kratky`, `popis_dlouhy`, `specifikace_sae`, `specifikace_api`, `specifikace_acea`, `specifikace_vyrobce`, `cena_bez_dph`, `baleni_pocet`, `baleni_mj`, `page_main`, `page_akce`, `img`, `alias`, `keywords`, `schvaleno_oem`, `_rm_updated_date`, `_rm_updated_by`) VALUES
(658, 2, 9, 1, 'MOBIL ATF 134', 'MOBIL ATF 134 je vysoce výkonná kapalina pro automatické převodovky formulovaná na bázi výběrových HVI základových olejů a doporučená pro použití v automatických převodovkách Mercedes.', 'MOBIL ATF 134 je kapalina, která je vyrobena z nejmodernějšího systému aditiv v kombinaci s pečlivě vybraným složením HVI základových olejů, tak aby zajišťovala vynikající teplotní stabilitu a odolnost proti opotřebení spolu s velmi dobrými nízkoteplotními vlastnostmi. Klíčové vlastnosti a výhody této kapaliny zahrnují: Mimořádná čerpatelnost a tekutost při nízkých teplotách, Výborné protiotěrové vlastnosti, Formulována tak, aby odpovídala nejnovějším požadavkům na třecí vlastnosti, Vynikající ochrana proti degradaci při vysokých provozních teplotách, Poskytuje vynikající výkon při studených startech, Zlepšuje ochranu proti otěru a prodlužuje tak životnost převodovky, Poskytuje hladký chod převodovky během celého servisního intervalu, Přispívá k prodlouženému servisnímu intervalu.', 'MB 236.14', 'MB 236.14', 'MB 236.14', 'MB 236.14', '3288.0', 20, 'L', 0, 0, '', 'mobil-atf-134-20l', 'mobil,atf,134,motor,levny,levne,kvalitni,gm dexron', '', '2016-03-03 14:50:37', 3),
(659, 2, 9, 1, 'MOBIL LHM', 'MOBIL LHM  je speciálně navržen pro použití v posilovacích hydraulických systémech,ve kterých je začleněno čerpadlo pohánějící například posilovač brzd, hydropneumatický systém odpružení nebo posilovač řízení. ', 'MOBIL LHM  je speciálně navržen pro použití v posilovacích hydraulických systémech,ve kterých je začleněno čerpadlo pohánějící například posilovač brzd, hydropneumatický systém odpružení nebo posilovač řízení. MOBIL LHM je minerální kapalina speciálně navržena pro hydraulický systém vozů Citroën se zelenými nádržkami.', 'Hydraulická kapalina pro hydr. Systém Citroen', ' Volvo', ' Volvo', ' Volvo', '156.0', 1, 'L', 0, 0, '', 'mobil-lhm-1l', 'mobil,lhm,motor,levny,levne,kvalitni,gm dexron, hydraulika, ', '', '2016-03-03 14:50:37', 3),
(660, 2, 9, 1, 'MOBIL ATF LT 71141', 'MOBIL ATF LT 71141 je částečně syntetická vysoce výkonná ATF kapalina s přísadami „Longdrain-Performance“ pro nasazení v automatických převodovkách vozidel. ', 'MOBIL ATF LT 71141 je částečně syntetická vysoce výkonná ATF kapalina s přísadami „Longdrain-Performance“ pro nasazení v automatických převodovkách vozidel. Olej MOBIL ATF LT 71141 : Vybrané základové oleje ve spojení s novou moderní technologií aditivace propůjčují této převodové kapalině výjimečnou výkonnost, zvláště s ohledem na prodloužené intervaly výměn plánované v budoucnosti. Vyvážené třecí vlastnosti kapaliny ATF LT 71141 pokrývají požadavky řazených spojek v automatických převodovkách stejně jako v řízených měničích a spojkách (GWK). Produkt má potenciál DEXRON III.', 'MB 236.11', ' VW TL 521 62', ' Voith G607', ' G1363', '188.0', 1, 'L', 0, 0, '', 'mobil-atf-lt-71141-1l', 'mobil,atf,lt,lt71141,motor,levny,levne,kvalitni,gm dexron', '', '2016-03-03 14:50:37', 3),
(661, 2, 9, 1, 'MOBIL ATF LT 71141', 'MOBIL ATF LT 71141 je částečně syntetická vysoce výkonná ATF kapalina s přísadami „Longdrain-Performance“ pro nasazení v automatických převodovkách vozidel. ', 'MOBIL ATF LT 71141 je částečně syntetická vysoce výkonná ATF kapalina s přísadami „Longdrain-Performance“ pro nasazení v automatických převodovkách vozidel. Olej MOBIL ATF LT 71141 : Vybrané základové oleje ve spojení s novou moderní technologií aditivace propůjčují této převodové kapalině výjimečnou výkonnost, zvláště s ohledem na prodloužené intervaly výměn plánované v budoucnosti. Vyvážené třecí vlastnosti kapaliny ATF LT 71141 pokrývají požadavky řazených spojek v automatických převodovkách stejně jako v řízených měničích a spojkách (GWK). Produkt má potenciál DEXRON III.', 'MB 236.11', ' VW TL 521 62', ' Voith G607', ' G1363', '3375.0', 20, 'L', 0, 0, '', 'mobil-atf-lt-71141-20l', 'mobil,atf,lt,lt71141,motor,levny,levne,kvalitni,gm dexron', '', '2016-03-03 14:50:37', 3),
(662, 3, 9, 1, 'MOBIL 1 RACING 4T 15W-50', 'MOBIL 1 Racing 4T 15W50 umožňuje dosažení vysokého výkonu, kterým se vyznačují moderní vysoce výkonné motocykly. Olej uchovává čtyřdobé motory v čistotě a chrání je i v nejnáročnějších provozních podmínkách.', 'MOBIL 1 Racing 4T 15W-50 je formulován z vysoce kvalitních syntetických základových složek a komplexu vysoce kvalitních aditiv, které poskytují motoru mimořádné čisticí schopnosti, ochranu proti opotřebení při vysokých teplotách a účinnou antikorozní ochranu. Díky velice nízkému trakčnímu součiniteli, který vyplývá z povahy syntetických olejů, se při použití oleje Mobil 1 Racing 4T dosahuje nejvyššího možného výkonu. Vysoká kvalita tohoto oleje umožňuje jeho celoroční použití v náročných podmínkách na silnici i na závodních tratích.', 'API SJ/CF', ' JASO MA', ' JASO MA', ' JASO MA', '260.0', 1, 'L', 0, 0, '', 'mobil-1-racing-4t-15w-50-1l', '', '', '2016-03-03 14:50:37', 3),
(663, 6, 9, 1, 'MOBILUBE 1 SHC 75W-90 ', 'MOBILUBE 1 SHC 75W-90 představuje převodový olej nejvyšší kvality vyrobený ze syntetických základových olejů a nejmodernější technologie systému aditiv.', 'MOBILUBE 1 SHC 75W-90 představuje převodový olej nejvyšší kvality vyrobený ze syntetických základových olejů a nejmodernější technologie systému aditiv. Tento olej je určen pro vysoce namáhané mechanické převodovky a zadní nápravy, jejichž provoz vyžaduje převodové oleje s poměrně vysokou viskozitou, vynikajícím přípustným zatížením a velkým rozsahem teplotních podmínek a tam, kde se předpokládá působení extrémních tlaků a rázového zatížení. Má vyšší tepelnou a oxidační stabilitu, vyšší přirozený viskozitní index, výjimečně nízký bod tuhnutí a lepší tekutost při nízkých teplotách. Moderní technologie stojící za výrobkem. Nabízí mimořádné viskozitní a teplotní vlastnosti nezbytné pro aplikace provozované ve velkém rozsahu teplot, optimalizovanou ochranu proti tepelné degradaci a oxidaci, ochranu proti opotřebení a korozi, střihovou stabilitu, delší provozuschopnost a lepší využití paliva.', 'API GL-5/GL-4/MT-1', ' Daewoo Avia Gearbox', ' Praga 6 PS 51', ' MAN 3343 SL', '237.0', 1, 'L', 0, 0, '', 'mobilube-1-shc-75w-90-1l', '', '', '2016-03-03 14:50:37', 3),
