(667, 6, 9, 1, 'MOBIL DELVAC SYNTHETIC GEAR OIL 75W-140', 'MOBIL DELVAC SYNTHETIC GEAR OIL 75W-140 je syntetický produkt vyrobený nejnovější technologií, s abnormálně vysokým indexem viskozity a dlouhou životností v namáhaných hypoidních převodových skříních.', 'MOBIL DELVAC SYNTHETIC GEAR OIL 75W-140 je syntetický produkt vyrobený nejnovější technologií, s abnormálně vysokým indexem viskozity a dlouhou životností v namáhaných hypoidních převodových skříních.', 'API GL-5', ' Scania STO 1:0', ' Scania STO 1:0', ' Scania STO 1:0', '6000.0', 20, 'L', 0, 0, '', 'mobil-delvac-synthetic-gear-oil-75w-140-20l', '', '', '2016-03-03 14:50:37', 3),
(668, 6, 9, 1, 'MOBIL DELVAC SYNTHETIC GEAR OIL 75W-140', 'MOBIL DELVAC SYNTHETIC GEAR OIL 75W-140 je syntetický produkt vyrobený nejnovější technologií, s abnormálně vysokým indexem viskozity a dlouhou životností v namáhaných hypoidních převodových skříních.', 'MOBIL DELVAC SYNTHETIC GEAR OIL 75W-140 je syntetický produkt vyrobený nejnovější technologií, s abnormálně vysokým indexem viskozity a dlouhou životností v namáhaných hypoidních převodových skříních.', 'API GL-5', ' Scania STO 1:0', ' Scania STO 1:0', ' Scania STO 1:0', '59800.0', 208, 'L', 0, 0, '', 'mobil-delvac-synthetic-gear-oil-75w-140-208l', '', '', '2016-03-03 14:50:37', 3),
(669, 6, 9, 1, 'MOBILUBE Syn LS 75W-90', 'MOBILUBE Syn LS 75W-90 je plně syntetický olej pro př evody s omezeným prokluzem (Limited Slip) vyrobený ze syntetických základových olejů a moderního komplexu aditiv. ', 'MOBILUBE Syn LS 75W-90 je plně syntetický olej pro př evody s omezeným prokluzem (Limited Slip) vyrobený ze syntetických základových olejů a moderního komplexu aditiv. Tento olej je navrhnut pro lehce až vysoce zatížená hnací ústrojí, kde přináší vynikající přenos zatížení v nápravách a rozvodovkách u kterých se př edpokládají extrémní tlaky a rázové namáhání. Zajišťuje optimální tepelnou a oxidač ní stabilitu, má vysoký viskozitní index, mimořádně nízký bod tuhnutí a dobrou tekutost za nízkých teplot. Je vhodný jako servisní náplň v mnoha LS typech hypoidních diferenciálů .', 'API GL-5', ' LIMITED SLIP', ' LIMITED SLIP', ' LIMITED SLIP', '5750.0', 20, 'L', 0, 0, '', 'mobilube-syn-ls-75w-90-20l', '', '', '2016-03-03 14:50:37', 3),
(670, 6, 9, 1, 'MOBILUBE Syn LS 75W-90', 'MOBILUBE Syn LS 75W-90 je plně syntetický olej pro př evody s omezeným prokluzem (Limited Slip) vyrobený ze syntetických základových olejů a moderního komplexu aditiv. ', 'MOBILUBE Syn LS 75W-90 je plně syntetický olej pro př evody s omezeným prokluzem (Limited Slip) vyrobený ze syntetických základových olejů a moderního komplexu aditiv. Tento olej je navrhnut pro lehce až vysoce zatížená hnací ústrojí, kde přináší vynikající přenos zatížení v nápravách a rozvodovkách u kterých se př edpokládají extrémní tlaky a rázové namáhání. Zajišťuje optimální tepelnou a oxidač ní stabilitu, má vysoký viskozitní index, mimořádně nízký bod tuhnutí a dobrou tekutost za nízkých teplot. Je vhodný jako servisní náplň v mnoha LS typech hypoidních diferenciálů .', 'API GL-5', ' LIMITED SLIP', ' LIMITED SLIP', ' LIMITED SLIP', '54600.0', 208, 'L', 0, 0, '', 'mobilube-syn-ls-75w-90-208l', '', '', '2016-03-03 14:50:37', 3),
(671, 6, 9, 1, 'MOBIL DELVAC XHP Transmission oil 75W-80 (Mobilube XHP 75W-80) ', 'MOBIL DELVAC XHP Transmission oil 75W-80 (Mobilube XHP 75W-80) je  moderní  vysoce výkonný olej na  čátečně  syntetické bázi, určený pro nejnovější silně namáhané mechanické převodovky, používané u komerčních i osobních vozidel evropských výrobců a provoz', 'MOBIL DELVAC XHP Transmission oil 75W-80 (Mobilube XHP 75W-80) je  moderní  vysoce výkonný olej na  čátečně  syntetické bázi, určený pro nejnovější silně namáhané mechanické převodovky, používané u komerčních i osobních vozidel evropských výrobců a provozovaných zejména v dálničním provozu. Olej je vyroben z vybraných základových olejů a progresivní kombinace aditiv, která zvyšuje účinnost při přenosu síly, přesnost řazení, tekutost za nízkých teplot a  zabezpečuje zachování potřebné viskozity při vysoké teplotě.', 'API GL-3/GL-4', ' MAN Z4/E3', ' ZF TE ML 02D', ' ZF TE ML 02D', '2975.0', 20, 'L', 0, 0, '', 'mobil-delvac-xhp-transmission-oil-75w-80-mobilube-xhp-75w-80-20l', '', '', '2016-03-03 14:50:37', 3),
