(673, 6, 9, 1, 'MOBILUBE S 80W-90 ', 'MOBILUBE S 80W-90 je mimořádně kvalitní převodový olej pro hnací ústrojí, který zajišťuje optimální mazání moderních, vysoce namáhaných mechanických součástek používaných u silničních komerčních vozidel a automobilů. ', 'MOBILUBE S 80W-90 je mimořádně kvalitní převodový olej pro hnací ústrojí, který zajišťuje optimální mazání moderních, vysoce namáhaných mechanických součástek používaných u silničních komerčních vozidel a automobilů. Tento olej je vyroben ze špičkových základových olejů v kombinaci s moderním komplexem aditiv, které zajišťují vynikající výkonnost řazení, dobrou tekutost a zachování viskozity při nízkých teplotách. Mobilube S 80W-90 dosahuje výkonnosti tříd API GL-4/5. Použití Vysoce namáhaná hnací ústrojí automobilů, kde se vyžaduje výkonnost třídy API GL-4/GL-5 -  silniční lehká a těžká nákladní vozidla, autobusy, dodávková vozidla a automobily. ', 'API GL-4/GL-5/MT-1', ' Mack GO-J', ' MAN 3343 ML', ' MAN 341/342', '2150.0', 20, 'L', 0, 0, '', 'mobilube-s-80w-90-20l', '', '', '2016-03-03 14:50:37', 3),
