(689, 6, 9, 1, 'MOBILUBE HD-N 80W-140', 'MOBILUBE HD-N 80W-140 je vysoce výkonný víceúčelový převodový olej vyrobený z vybraných základových olejů a moderního komplexu aditiv. ', 'MOBILUBE HD-N 80W-140 je vysoce výkonný víceúčelový převodový olej vyrobený z vybraných základových olejů a moderního komplexu aditiv. Tento olej dosahuje mimořádný výkon u vysoce zatížených náprav a převodů, kde se předpokládají extrémní tlaky a rázové namáhání. Vyznačuje se vynikající chemickou a tepelnou stabilitou, dobrým výkonem za nízkých teplot a ochranou proti rezavění.', 'API GL-5', ' Scania STO 1:0', ' Scania STO 1:0', ' Scania STO 1:0', '2425.0', 20, 'L', 0, 0, '', 'mobilube-hd-n-80w-140-20l', '', '', '2016-03-03 14:50:37', 3),
(690, 6, 9, 1, 'MOBILUBE HD-N 80W-140', 'MOBILUBE HD-N 80W-140 je vysoce výkonný víceúčelový převodový olej vyrobený z vybraných základových olejů a moderního komplexu aditiv. ', 'MOBILUBE HD-N 80W-140 je vysoce výkonný víceúčelový převodový olej vyrobený z vybraných základových olejů a moderního komplexu aditiv. Tento olej dosahuje mimořádný výkon u vysoce zatížených náprav a převodů, kde se předpokládají extrémní tlaky a rázové namáhání. Vyznačuje se vynikající chemickou a tepelnou stabilitou, dobrým výkonem za nízkých teplot a ochranou proti rezavění.', 'API GL-5', ' Scania STO 1:0', ' Scania STO 1:0', ' Scania STO 1:0', '22880.0', 208, 'L', 0, 0, '', 'mobilube-hd-n-80w-140-208l', '', '', '2016-03-03 14:50:37', 3),
(691, 6, 9, 1, 'MOBILUBE LS 85W-90', 'MOBILUBE LS 85W-90 je převodový olej nejvyšší kvality pro vysoce zatížené převodovky, vyrobený zvybraných vysoce kvalitních základových olejů a optimálně vyváženého komplexu aditiv. ', 'MOBILUBE LS 85W-90 je převodový olej nejvyšší kvality pro vysoce zatížené převodovky, vyrobený zvybraných vysoce kvalitních základových olejů a optimálně vyváženého komplexu aditiv. Tento olej je vhodný do diferenciálů s požadavkem na omezený prokluz (limited-slip) a zajišťuje spolehlivou výkonnost při extrémních tlacích a rázovém namáhání. Je doporučen pro použití v lehkých komerčních vozidlech včetně osobních vozů,ale také do nákladních vozidel, autobusů i zemědělských a stavebních strojů', 'API GL-5', ' ZF TE ML 05C/12C/16E', ' ZF TE ML 05C/12C/16E', ' ZF TE ML 05C/12C/16E', '2350.0', 20, 'L', 0, 0, '', 'mobilube-ls-85w-90-20l', '', '', '2016-03-03 14:50:37', 3),
(692, 6, 9, 1, 'MOBILUBE LS 85W-90', 'MOBILUBE LS 85W-90 je převodový olej nejvyšší kvality pro vysoce zatížené převodovky, vyrobený zvybraných vysoce kvalitních základových olejů a optimálně vyváženého komplexu aditiv. ', 'MOBILUBE LS 85W-90 je převodový olej nejvyšší kvality pro vysoce zatížené převodovky, vyrobený zvybraných vysoce kvalitních základových olejů a optimálně vyváženého komplexu aditiv. Tento olej je vhodný do diferenciálů s požadavkem na omezený prokluz (limited-slip) a zajišťuje spolehlivou výkonnost při extrémních tlacích a rázovém namáhání. Je doporučen pro použití v lehkých komerčních vozidlech včetně osobních vozů,ale také do nákladních vozidel, autobusů i zemědělských a stavebních strojů', 'API GL-5', ' ZF TE ML 05C/12C/16E', ' ZF TE ML 05C/12C/16E', ' ZF TE ML 05C/12C/16E', '21580.0', 208, 'L', 0, 0, '', 'mobilube-ls-85w-90-208l', '', '', '2016-03-03 14:50:37', 3),
(693, 7, 9, 1, 'MOBILFLUID 424', 'MOBILFLUID 424 -UTTO kapalina splňující požadavky na převodový, hydraulický a olej do mokrých brzd zemědělských a stavebních strojů. ', 'MOBILFLUID 424 je mimořádně výkonný olej pro zemědělskou a stavební techniku, vyrobený tak, aby splňoval nebo překračoval požadavky hydraulických kapalin a kapalin pro převodovky. Vyspělá technologie u Mobilfluid 424 má optimalizovat výkon u strojů pracujících vširoké škále prostředí a podmínek. Tento produkt příští generace vsobě spojuje výběrové základové oleje a soubor moderních aditiv, které slouží k zajištění různorodých výkonových parametrů olejů vyžadovaných hnacím ústrojím zemědělských a stavebních zařízení přináročných aplikacích.', 'API GL-4', ' Allison C-4', ' Ford ESN-M2C-134D', ' FNHA-2C-201.00', '2000.0', 20, 'L', 1, 1, '', 'mobilfluid-424-20l', '', '', '2016-03-03 14:50:37', 3),
(694, 7, 9, 2, 'MOBILFLUID 424', 'MOBILFLUID 424 -UTTO kapalina splňující požadavky na převodový, hydraulický a olej do mokrých brzd zemědělských a stavebních strojů. ', 'MOBILFLUID 424 je mimořádně výkonný olej pro zemědělskou a stavební techniku, vyrobený tak, aby splňoval nebo překračoval požadavky hydraulických kapalin a kapalin pro převodovky. Vyspělá technologie u Mobilfluid 424 má optimalizovat výkon u strojů pracujících vširoké škále prostředí a podmínek. Tento produkt příští generace vsobě spojuje výběrové základové oleje a soubor moderních aditiv, které slouží k zajištění různorodých výkonových parametrů olejů vyžadovaných hnacím ústrojím zemědělských a stavebních zařízení přináročných aplikacích.', 'API GL-4', ' Allison C-4', ' Ford ESN-M2C-134D', ' FNHA-2C-201.00', '18980.0', 208, 'L', 1, 1, '', 'mobilfluid-424-208l', '', '', '2016-03-03 14:50:37', 3),
